* Non vanno ridefiniti. rhhh e' in realta' r3h e gli cambio nome nel res
* oltretutto i couplings coll'higgs possono avere un ghfactor           
* che se si ridefiniscono si perde                                      
* higgs couplings                                                       
*      if (ibot(id3).or.ibot(id5).or.ibot(id7)) then                    
*         rhzz=rmz/(sw*rcw)                                             
*      endif                                                            
