*gfend                                                                  
  
* 4momenta and their sums                                               
  
* pk0 -- p=p3
      p3k0=p3(0)-p3(1)
* pk0 -- p=p4
      p4k0=p4(0)-p4(1)
* pk0 -- p=p5
      p5k0=p5(0)-p5(1)
* pk0 -- p=p6
      p6k0=p6(0)-p6(1)
* pk0 -- p=p7
      p7k0=p7(0)-p7(1)
* pk0 -- p=p8
      p8k0=p8(0)-p8(1)
  
      sqpk0=sqrt(abs(p3k0*p4k0*p5k0*p6k0*p7k0*p8k0))
  
* gluon polarizations                                                   
  
* pol -- p=p1,m=0,e1=ce1(1)%e,e2=ce1(2)%e,e3=0,nhz=0                    
      rkt=sqrt(p1(1)**2+p1(2)**2)
      IF(abs(rkt/p1(0)).GT.1.d-10)THEN
      ce1(1)%e(1)=p1(1)*p1(3)/p1(0)/rkt
      ce1(1)%e(2)=p1(2)*p1(3)/p1(0)/rkt
      ce1(1)%e(3)=-rkt/p1(0)
      ce1(2)%e(1)=-p1(2)/rkt
      ce1(2)%e(2)=p1(1)/rkt
      ELSE
      ce1(1)%e(1)=1.d0
      ce1(1)%e(2)=0.d0
      ce1(1)%e(3)=0.d0
      ce1(2)%e(1)=0.d0
      ce1(2)%e(2)=1.d0
      ENDIF
* pol -- p=p2,m=0,e1=ce2â‰¤(1)%e,e2=ce2(2)%e,e3=0,nhz=0                 
      rkt=sqrt(p2(1)**2+p2(2)**2)
      IF(abs(rkt/p2(0)).GT.1.d-10)THEN
      ce2(1)%e(1)=p2(1)*p2(3)/p2(0)/rkt
      ce2(1)%e(2)=p2(2)*p2(3)/p2(0)/rkt
      ce2(1)%e(3)=-rkt/p2(0)
      ce2(2)%e(1)=-p2(2)/rkt
      ce2(2)%e(2)=p2(1)/rkt
      ELSE
      ce2(1)%e(1)=1.d0
      ce2(1)%e(2)=0.d0
      ce2(1)%e(3)=0.d0
      ce2(2)%e(1)=0.d0
      ce2(2)%e(2)=-1.d0
      ENDIF
  
      do i=1,2
* pk0 -- p=ce1(i)%e
      ce1(i)%ek0=ce1(i)%e(0)-ce1(i)%e(1)
      end do
      do i=1,2
* pk0 -- p=ce2(i)%e
      ce2(i)%ek0=ce2(i)%e(0)-ce2(i)%e(1)
      end do
  
  
