      u7_1(i)%a(1,1)=ccr*(cauxa+ceps_0)
      u7_1(i)%a(2,2)=ccl*(cauxa-ceps_0)
      u7_1(i)%b(1,2)=ccl*(cauxb-ceps_2)
      u7_1(i)%b(2,1)=ccr*(-cauxb-ceps_2)
      u7_1(i)%c(1,2)=ccr*(cauxc+ceps_1)
      u7_1(i)%c(2,1)=ccl*(-cauxc+ceps_1)
      u7_1(i)%d(1,1)=ccl*ce1(i)%ek0
      u7_1(i)%d(2,2)=ccr*ce1(i)%ek0
      end do
  
      quqd=-(s18+rmass2(id8))/2d0
      ccr=gs/(f18)
      ccl=gs/(f18)
      do i=1,2
* T -- qu=p18,qd=p8,v=ce1(i)%e,a=d8_1(i)%a,b=d8_1(i)%b,c=d8_1(i)%c,d=d8_
* 1(i)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-ce1(i)%ek0*(p18(2)*p8(3)-p8(2)*p18(3))+p18k0*(ce1(
     & i)%e(2)*p8(3)-p8(2)*ce1(i)%e(3))-p8k0*(ce1(i)%e(2)*p18(3)
     & -p18(2)*ce1(i)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ce1(i)%e(3)*p18k0+p18(3)*ce1(i)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-ce1(i)%e(3)*p8k0+p8(3)*ce1(i)%ek0
      ceps_2=ceps_2*cim
      cvqu=ce1(i)%e(0)*p18(0)-ce1(i)%e(1)*p18(1)-ce1(i)%e(2)*p18
     & (2)-ce1(i)%e(3)*p18(3)
      cvqd=ce1(i)%e(0)*p8(0)-ce1(i)%e(1)*p8(1)-ce1(i)%e(2)*p8(2)
     & -ce1(i)%e(3)*p8(3)
      cauxa=-ce1(i)%ek0*quqd+p18k0*cvqd+p8k0*cvqu
      cauxb=-ce1(i)%ek0*p8(2)+p8k0*ce1(i)%e(2)
      cauxc=+ce1(i)%ek0*p18(2)-p18k0*ce1(i)%e(2)
      d8_1(i)%a(1,1)=ccr*(cauxa+ceps_0)
      d8_1(i)%a(2,2)=ccl*(cauxa-ceps_0)
      d8_1(i)%b(1,2)=ccl*(cauxb-ceps_2)
      d8_1(i)%b(2,1)=ccr*(-cauxb-ceps_2)
      d8_1(i)%c(1,2)=ccr*(cauxc+ceps_1)
      d8_1(i)%c(2,1)=ccl*(-cauxc+ceps_1)
      d8_1(i)%d(1,1)=ccl*ce1(i)%ek0
      d8_1(i)%d(2,2)=ccr*ce1(i)%ek0
      end do
      quqd=(s72+rmass2(id7))/2d0
      ccr=gs/(f72)
      ccl=gs/(f72)
      do i=1,2
* T -- qu=p7,qd=p72,v=ce2(i)%e,a=u7_2(i)%a,b=u7_2(i)%b,c=u7_2(i)%c,d=u7_
* 2(i)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-ce2(i)%ek0*(p7(2)*p72(3)-p72(2)*p7(3))+p7k0*(ce2(i
     & )%e(2)*p72(3)-p72(2)*ce2(i)%e(3))-p72k0*(ce2(i)%e(2)*p7(3
     & )-p7(2)*ce2(i)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ce2(i)%e(3)*p7k0+p7(3)*ce2(i)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-ce2(i)%e(3)*p72k0+p72(3)*ce2(i)%ek0
      ceps_2=ceps_2*cim
      cvqu=ce2(i)%e(0)*p7(0)-ce2(i)%e(1)*p7(1)-ce2(i)%e(2)*p7(2)
     & -ce2(i)%e(3)*p7(3)
      cvqd=ce2(i)%e(0)*p72(0)-ce2(i)%e(1)*p72(1)-ce2(i)%e(2)*p72
     & (2)-ce2(i)%e(3)*p72(3)
      cauxa=-ce2(i)%ek0*quqd+p7k0*cvqd+p72k0*cvqu
      cauxb=-ce2(i)%ek0*p72(2)+p72k0*ce2(i)%e(2)
      cauxc=+ce2(i)%ek0*p7(2)-p7k0*ce2(i)%e(2)
      u7_2(i)%a(1,1)=ccr*(cauxa+ceps_0)
      u7_2(i)%a(2,2)=ccl*(cauxa-ceps_0)
      u7_2(i)%b(1,2)=ccl*(cauxb-ceps_2)
      u7_2(i)%b(2,1)=ccr*(-cauxb-ceps_2)
      u7_2(i)%c(1,2)=ccr*(cauxc+ceps_1)
      u7_2(i)%c(2,1)=ccl*(-cauxc+ceps_1)
      u7_2(i)%d(1,1)=ccl*ce2(i)%ek0
      u7_2(i)%d(2,2)=ccr*ce2(i)%ek0
      end do
  
      quqd=-(s28+rmass2(id8))/2d0
      ccr=gs/(f28)
      ccl=gs/(f28)
      do i=1,2
* T -- qu=p28,qd=p8,v=ce2(i)%e,a=d8_2(i)%a,b=d8_2(i)%b,c=d8_2(i)%c,d=d8_
* 2(i)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-ce2(i)%ek0*(p28(2)*p8(3)-p8(2)*p28(3))+p28k0*(ce2(
     & i)%e(2)*p8(3)-p8(2)*ce2(i)%e(3))-p8k0*(ce2(i)%e(2)*p28(3)
     & -p28(2)*ce2(i)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ce2(i)%e(3)*p28k0+p28(3)*ce2(i)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-ce2(i)%e(3)*p8k0+p8(3)*ce2(i)%ek0
      ceps_2=ceps_2*cim
      cvqu=ce2(i)%e(0)*p28(0)-ce2(i)%e(1)*p28(1)-ce2(i)%e(2)*p28
     & (2)-ce2(i)%e(3)*p28(3)
      cvqd=ce2(i)%e(0)*p8(0)-ce2(i)%e(1)*p8(1)-ce2(i)%e(2)*p8(2)
     & -ce2(i)%e(3)*p8(3)
      cauxa=-ce2(i)%ek0*quqd+p28k0*cvqd+p8k0*cvqu
      cauxb=-ce2(i)%ek0*p8(2)+p8k0*ce2(i)%e(2)
      cauxc=+ce2(i)%ek0*p28(2)-p28k0*ce2(i)%e(2)
      d8_2(i)%a(1,1)=ccr*(cauxa+ceps_0)
      d8_2(i)%a(2,2)=ccl*(cauxa-ceps_0)
      d8_2(i)%b(1,2)=ccl*(cauxb-ceps_2)
      d8_2(i)%b(2,1)=ccr*(-cauxb-ceps_2)
      d8_2(i)%c(1,2)=ccr*(cauxc+ceps_1)
      d8_2(i)%c(2,1)=ccl*(-cauxc+ceps_1)
      d8_2(i)%d(1,1)=ccl*ce2(i)%ek0
      d8_2(i)%d(2,2)=ccr*ce2(i)%ek0
      end do
      endif
  
  
* compute simple forks                                                  
* (Z's, gamma's, higgs's "decaying" to two fermions)                    
  
      do mu=0,3
         p34(mu)=p3(mu)+p4(mu)
      enddo
* quqd -- p=p3,q=p4
      quqd=p3(0)*p4(0)-p3(1)*p4(1)-p3(2)*p4(2)-p3(3)*p4(3)
      s34=2.d0*quqd+rmass2(id3)+rmass2(id4)
  
*      Z's, gammas                                                      
* T -- qu=p3,qd=p4,v=0,a=clinet_mu(0)%a,b=clinet_mu(0)%b,c=clinet_mu(0)%
* c,d=clinet_mu(0)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      eps_0=-p3(2)*p4(3)+p4(2)*p3(3)
      ceps_0=eps_0*cim
      ceps_1=p3(3)*cim
      ceps_2=p4(3)*cim
      auxa=-quqd+p3k0*p4(0)+p4k0*p3(0)
      clinet_mu(0)%a(1,1)=zcr(id3)*(auxa+ceps_0)
      clinet_mu(0)%a(2,2)=zcl(id3)*(auxa-ceps_0)
      clinet_mu(0)%b(1,2)=-zcl(id3)*(p4(2)+ceps_2)
      clinet_mu(0)%b(2,1)=zcr(id3)*(p4(2)-ceps_2)
      clinet_mu(0)%c(1,2)=zcr(id3)*(p3(2)+ceps_1)
      clinet_mu(0)%c(2,1)=zcl(id3)*(-p3(2)+ceps_1)
      clinet_mu(0)%d(1,1)=zcl(id3)
      clinet_mu(0)%d(2,2)=zcr(id3)
* T -- qu=p3,qd=p4,v=1,a=clinet_mu(1)%a,b=clinet_mu(1)%b,c=clinet_mu(1)%
* c,d=clinet_mu(1)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      auxa=-quqd+p3k0*p4(1)+p4k0*p3(1)
      clinet_mu(1)%a(1,1)=zcr(id3)*(auxa+ceps_0)
      clinet_mu(1)%a(2,2)=zcl(id3)*(auxa-ceps_0)
      clinet_mu(1)%b(1,2)=-zcl(id3)*(p4(2)+ceps_2)
      clinet_mu(1)%b(2,1)=zcr(id3)*(p4(2)-ceps_2)
      clinet_mu(1)%c(1,2)=zcr(id3)*(p3(2)+ceps_1)
      clinet_mu(1)%c(2,1)=zcl(id3)*(-p3(2)+ceps_1)
      clinet_mu(1)%d(1,1)=zcl(id3)
      clinet_mu(1)%d(2,2)=zcr(id3)
* T -- qu=p3,qd=p4,v=2,a=clinet_mu(2)%a,b=clinet_mu(2)%b,c=clinet_mu(2)%
* c,d=clinet_mu(2)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      eps_0=-p3k0*p4(3)+p4k0*p3(3)
      ceps_0=eps_0*cim
      auxa=p3k0*p4(2)+p4k0*p3(2)
      clinet_mu(2)%a(1,1)=zcr(id3)*(auxa+ceps_0)
      clinet_mu(2)%a(2,2)=zcl(id3)*(auxa-ceps_0)
      clinet_mu(2)%b(1,2)=-zcl(id3)*p4k0
      clinet_mu(2)%b(2,1)=zcr(id3)*p4k0
      clinet_mu(2)%c(1,2)=zcr(id3)*p3k0
      clinet_mu(2)%c(2,1)=-zcl(id3)*p3k0
* T -- qu=p3,qd=p4,v=3,a=clinet_mu(3)%a,b=clinet_mu(3)%b,c=clinet_mu(3)%
* c,d=clinet_mu(3)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      eps_0=p3k0*p4(2)-p4k0*p3(2)
      ceps_0=eps_0*cim
      ceps_1=p3k0*cim
      ceps_2=p4k0*cim
      auxa=+p3k0*p4(3)+p4k0*p3(3)
      clinet_mu(3)%a(1,1)=zcr(id3)*(auxa+ceps_0)
      clinet_mu(3)%a(2,2)=zcl(id3)*(auxa-ceps_0)
      clinet_mu(3)%b(1,2)=-zcl(id3)*ceps_2
      clinet_mu(3)%b(2,1)=-zcr(id3)*ceps_2
      clinet_mu(3)%c(1,2)=zcr(id3)*ceps_1
      clinet_mu(3)%c(2,1)=zcl(id3)*ceps_1
      do mu=0,3
* mline -- res=cz34(&1,&2)%e(mu),abcd=clinet_mu(mu)%,m1=rmass(id3),m2=(-
* rmass(id4)),den=(-s34+cmz2),nsum=0
      do iut=1,2
      do jut=1,2
      cz34(iut,jut)%e(mu)=(clinet_mu(mu)%a(iut,jut)+rmass(id3)*c
     & linet_mu(mu)%b(iut,jut)+(-rmass(id4))*clinet_mu(mu)%c(iut
     & ,jut)+rmass(id3)*(-rmass(id4))*clinet_mu(mu)%d(iut,jut))/
     & (-s34+cmz2)
      enddo
      enddo
      end do
      if (imass(id3).eq.1) then
        do i1=1,2
          do i2=1,2
* p.q -- p.q=cauxdot,p=p34,q=cz34(i1,i2)%e,bef=,aft=
      cauxdot=(p34(0)*cz34(i1,i2)%e(0)-p34(1)*cz34(i1,i2)%e(1)-p
     & 34(2)*cz34(i1,i2)%e(2)-p34(3)*cz34(i1,i2)%e(3))
            do mu=0,3
             cz34(i1,i2)%e(mu)=
     &       cz34(i1,i2)%e(mu)-p34(mu)*cauxdot/cmz2
            enddo
          enddo
        enddo
      endif
      do i1=1,2
      do i2=1,2
* pk0 -- p=cz34(i1,i2)%e
      cz34(i1,i2)%ek0=cz34(i1,i2)%e(0)-cz34(i1,i2)%e(1)
      end do
      end do
* T -- qu=p3,qd=p4,v=0,a=clinet_mu(0)%a,b=clinet_mu(0)%b,c=clinet_mu(0)%
* c,d=clinet_mu(0)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      eps_0=-p3(2)*p4(3)+p4(2)*p3(3)
      ceps_0=eps_0*cim
      ceps_1=p3(3)*cim
      ceps_2=p4(3)*cim
      auxa=-quqd+p3k0*p4(0)+p4k0*p3(0)
      clinet_mu(0)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      clinet_mu(0)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      clinet_mu(0)%b(1,2)=-fcl(id3)*(p4(2)+ceps_2)
      clinet_mu(0)%b(2,1)=fcr(id3)*(p4(2)-ceps_2)
      clinet_mu(0)%c(1,2)=fcr(id3)*(p3(2)+ceps_1)
      clinet_mu(0)%c(2,1)=fcl(id3)*(-p3(2)+ceps_1)
      clinet_mu(0)%d(1,1)=fcl(id3)
      clinet_mu(0)%d(2,2)=fcr(id3)
* T -- qu=p3,qd=p4,v=1,a=clinet_mu(1)%a,b=clinet_mu(1)%b,c=clinet_mu(1)%
* c,d=clinet_mu(1)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      auxa=-quqd+p3k0*p4(1)+p4k0*p3(1)
      clinet_mu(1)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      clinet_mu(1)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      clinet_mu(1)%b(1,2)=-fcl(id3)*(p4(2)+ceps_2)
      clinet_mu(1)%b(2,1)=fcr(id3)*(p4(2)-ceps_2)
      clinet_mu(1)%c(1,2)=fcr(id3)*(p3(2)+ceps_1)
      clinet_mu(1)%c(2,1)=fcl(id3)*(-p3(2)+ceps_1)
      clinet_mu(1)%d(1,1)=fcl(id3)
      clinet_mu(1)%d(2,2)=fcr(id3)
* T -- qu=p3,qd=p4,v=2,a=clinet_mu(2)%a,b=clinet_mu(2)%b,c=clinet_mu(2)%
* c,d=clinet_mu(2)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      eps_0=-p3k0*p4(3)+p4k0*p3(3)
      ceps_0=eps_0*cim
      auxa=p3k0*p4(2)+p4k0*p3(2)
      clinet_mu(2)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      clinet_mu(2)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      clinet_mu(2)%b(1,2)=-fcl(id3)*p4k0
      clinet_mu(2)%b(2,1)=fcr(id3)*p4k0
      clinet_mu(2)%c(1,2)=fcr(id3)*p3k0
      clinet_mu(2)%c(2,1)=-fcl(id3)*p3k0
* T -- qu=p3,qd=p4,v=3,a=clinet_mu(3)%a,b=clinet_mu(3)%b,c=clinet_mu(3)%
* c,d=clinet_mu(3)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      eps_0=p3k0*p4(2)-p4k0*p3(2)
      ceps_0=eps_0*cim
      ceps_1=p3k0*cim
      ceps_2=p4k0*cim
      auxa=+p3k0*p4(3)+p4k0*p3(3)
      clinet_mu(3)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      clinet_mu(3)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      clinet_mu(3)%b(1,2)=-fcl(id3)*ceps_2
      clinet_mu(3)%b(2,1)=-fcr(id3)*ceps_2
      clinet_mu(3)%c(1,2)=fcr(id3)*ceps_1
      clinet_mu(3)%c(2,1)=fcl(id3)*ceps_1
      do mu=0,3
* mline -- res=cf34(&1,&2)%e(mu),abcd=clinet_mu(mu)%,m1=rmass(id3),m2=(-
* rmass(id4)),den=(-s34),nsum=0
      do iut=1,2
      do jut=1,2
      cf34(iut,jut)%e(mu)=(clinet_mu(mu)%a(iut,jut)+rmass(id3)*c
     & linet_mu(mu)%b(iut,jut)+(-rmass(id4))*clinet_mu(mu)%c(iut
     & ,jut)+rmass(id3)*(-rmass(id4))*clinet_mu(mu)%d(iut,jut))/
     & (-s34)
      enddo
      enddo
      end do
      do i1=1,2
      do i2=1,2
* pk0 -- p=cf34(i1,i2)%e
      cf34(i1,i2)%ek0=cf34(i1,i2)%e(0)-cf34(i1,i2)%e(1)
      end do
      end do
  
*      higgs                                                            
      if (ibot(id3).eq.1) then
* TH -- qu=p3,qd=p4,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p3k0*p4(2)+p4k0*p3(2)
      cauxa=auxa-cim*(p4(3)*p3k0-p3(3)*p4k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p4k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p3k0
      clineth%c(2,2)=clineth%c(1,1)
* mline -- res=ch34(&1,&2),abcd=clineth%,m1=rmass(id3),m2=(-rmass(id4)),
* den=(s34-cmh2),nsum=0
      do iut=1,2
      do jut=1,2
      ch34(iut,jut)=(clineth%a(iut,jut)+rmass(id3)*clineth%b(iut
     & ,jut)+(-rmass(id4))*clineth%c(iut,jut)+rmass(id3)*(-rmass
     & (id4))*clineth%d(iut,jut))/(s34-cmh2)
      enddo
      enddo
      endif
      do mu=0,3
         p56(mu)=p5(mu)+p6(mu)
      enddo
* quqd -- p=p5,q=p6
      quqd=p5(0)*p6(0)-p5(1)*p6(1)-p5(2)*p6(2)-p5(3)*p6(3)
      s56=2.d0*quqd+rmass2(id5)+rmass2(id6)
  
*      Z's, gammas                                                      
* T -- qu=p5,qd=p6,v=0,a=clinet_mu(0)%a,b=clinet_mu(0)%b,c=clinet_mu(0)%
* c,d=clinet_mu(0)%d,cr=zcr(id5),cl=zcl(id5),nsum=0
      eps_0=-p5(2)*p6(3)+p6(2)*p5(3)
      ceps_0=eps_0*cim
      ceps_1=p5(3)*cim
      ceps_2=p6(3)*cim
      auxa=-quqd+p5k0*p6(0)+p6k0*p5(0)
      clinet_mu(0)%a(1,1)=zcr(id5)*(auxa+ceps_0)
      clinet_mu(0)%a(2,2)=zcl(id5)*(auxa-ceps_0)
      clinet_mu(0)%b(1,2)=-zcl(id5)*(p6(2)+ceps_2)
      clinet_mu(0)%b(2,1)=zcr(id5)*(p6(2)-ceps_2)
      clinet_mu(0)%c(1,2)=zcr(id5)*(p5(2)+ceps_1)
      clinet_mu(0)%c(2,1)=zcl(id5)*(-p5(2)+ceps_1)
      clinet_mu(0)%d(1,1)=zcl(id5)
      clinet_mu(0)%d(2,2)=zcr(id5)
* T -- qu=p5,qd=p6,v=1,a=clinet_mu(1)%a,b=clinet_mu(1)%b,c=clinet_mu(1)%
* c,d=clinet_mu(1)%d,cr=zcr(id5),cl=zcl(id5),nsum=0
      auxa=-quqd+p5k0*p6(1)+p6k0*p5(1)
      clinet_mu(1)%a(1,1)=zcr(id5)*(auxa+ceps_0)
      clinet_mu(1)%a(2,2)=zcl(id5)*(auxa-ceps_0)
      clinet_mu(1)%b(1,2)=-zcl(id5)*(p6(2)+ceps_2)
