* This dotab corresponds to the loop over the base line (7\8\)(as a     
* base line can be taken any of 3 fermion lines),then to the loop       
* over the first inserted line (3\4\)(as a such line can be taken       
* any of the two fermion lines other than the base one).                
* As the  second inserted line (if there are two insertions)            
* the remaining line (5\6\) is the only option.                         
* The number of permutations is 3*2*1=6                                 
* In this way the insertions of given type are covered                  
* for all required combinations of inserted and base lines.             
  
  
  
* insertions of simple forks into fermion lines                         
  
* UP PART                                                               
  
*                                                                       
*    3  4         cz\\34, ch34                                          
*     \_/                                                               
*      |                                                                
*  ----0------------  0 is a sum over z,f,h                             
* |          p734                                                       
*  7                                                                    
  
      quqd=(s734+rmass2(id7)-s34)/2d0
  
* z insertion                                                           
      ccr=zcr(id7)/(f734)
      ccl=zcl(id7)/(f734)
      do i3=1,2
      do i4=1,2
* T -- qu=p7,qd=p734,v=cz34(i3,i4)%e,a=u7_34(i3,i4)%a,b=u7_34(i3,i4)%b,c
* =u7_34(i3,i4)%c,d=u7_34(i3,i4)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-cz34(i3,i4)%ek0*(p7(2)*p734(3)-p734(2)*p7(3))+p7k0
     & *(cz34(i3,i4)%e(2)*p734(3)-p734(2)*cz34(i3,i4)%e(3))-p734
     & k0*(cz34(i3,i4)%e(2)*p7(3)-p7(2)*cz34(i3,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz34(i3,i4)%e(3)*p7k0+p7(3)*cz34(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz34(i3,i4)%e(3)*p734k0+p734(3)*cz34(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cz34(i3,i4)%e(0)*p7(0)-cz34(i3,i4)%e(1)*p7(1)-cz34(i3
     & ,i4)%e(2)*p7(2)-cz34(i3,i4)%e(3)*p7(3)
      cvqd=cz34(i3,i4)%e(0)*p734(0)-cz34(i3,i4)%e(1)*p734(1)-cz3
     & 4(i3,i4)%e(2)*p734(2)-cz34(i3,i4)%e(3)*p734(3)
      cauxa=-cz34(i3,i4)%ek0*quqd+p7k0*cvqd+p734k0*cvqu
      cauxb=-cz34(i3,i4)%ek0*p734(2)+p734k0*cz34(i3,i4)%e(2)
      cauxc=+cz34(i3,i4)%ek0*p7(2)-p7k0*cz34(i3,i4)%e(2)
      u7_34(i3,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      u7_34(i3,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      u7_34(i3,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      u7_34(i3,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      u7_34(i3,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      u7_34(i3,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      u7_34(i3,i4)%d(1,1)=ccl*cz34(i3,i4)%ek0
      u7_34(i3,i4)%d(2,2)=ccr*cz34(i3,i4)%ek0
      end do
      end do
  
* f insertion                                                           
      ccr=fcr(id7)/(f734)
      ccl=fcl(id7)/(f734)
      do i3=1,2
      do i4=1,2
* T -- qu=p7,qd=p734,v=cf34(i3,i4)%e,a=u7_34(i3,i4)%a,b=u7_34(i3,i4)%b,c
* =u7_34(i3,i4)%c,d=u7_34(i3,i4)%d,cr=ccr,cl=ccl,nsum=1
      ceps_0=-cf34(i3,i4)%ek0*(p7(2)*p734(3)-p734(2)*p7(3))+p7k0
     & *(cf34(i3,i4)%e(2)*p734(3)-p734(2)*cf34(i3,i4)%e(3))-p734
