      cvqd=cf34(i3,i4)%e(0)*p734(0)-cf34(i3,i4)%e(1)*p734(1)-cf3
     & 4(i3,i4)%e(2)*p734(2)-cf34(i3,i4)%e(3)*p734(3)
      cauxa=-cf34(i3,i4)%ek0*quqd+p7k0*cvqd+p734k0*cvqu
      cauxb=-cf34(i3,i4)%ek0*p734(2)+p734k0*cf34(i3,i4)%e(2)
      cauxc=+cf34(i3,i4)%ek0*p7(2)-p7k0*cf34(i3,i4)%e(2)
      u7_34(i3,i4)%a(1,1)=u7_34(i3,i4)%a(1,1)+ccr*(cauxa+ceps_0)
      u7_34(i3,i4)%a(2,2)=u7_34(i3,i4)%a(2,2)+ccl*(cauxa-ceps_0)
      u7_34(i3,i4)%b(1,2)=u7_34(i3,i4)%b(1,2)+ccl*(cauxb-ceps_2)
      u7_34(i3,i4)%b(2,1)=u7_34(i3,i4)%b(2,1)+ccr*(-cauxb-ceps_2
     & )
      u7_34(i3,i4)%c(1,2)=u7_34(i3,i4)%c(1,2)+ccr*(cauxc+ceps_1)
      u7_34(i3,i4)%c(2,1)=u7_34(i3,i4)%c(2,1)+ccl*(-cauxc+ceps_1
     & )
      u7_34(i3,i4)%d(1,1)=u7_34(i3,i4)%d(1,1)+ccl*cf34(i3,i4)%ek
     & 0
      u7_34(i3,i4)%d(2,2)=u7_34(i3,i4)%d(2,2)+ccr*cf34(i3,i4)%ek
     & 0
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id3).eq.1).and.(ibot(id7).eq.1)) then
  
      ccoupl=rhbb/(f734)
* TH -- qu=p7,qd=p734,a=clineth%a,b=clineth%b,c=clineth%c,coupl=ccoupl
      auxa=-p7k0*p734(2)+p734k0*p7(2)
