      clineth%a(1,2)=ccoupl*cauxa
      clineth%a(2,1)=-ccoupl*conjg(cauxa)
      clineth%b(1,1)=ccoupl*p734k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=ccoupl*p7k0
      clineth%c(2,2)=clineth%c(1,1)
  
         do i3=1,2
            do i4=1,2
               u7_34(i3,i4)%a(1,2)=clineth%a(1,2)*ch34(i3,i4)
               u7_34(i3,i4)%a(2,1)=clineth%a(2,1)*ch34(i3,i4)
  
               u7_34(i3,i4)%b(1,1)=clineth%b(1,1)*ch34(i3,i4)
               u7_34(i3,i4)%b(2,2)=clineth%b(2,2)*ch34(i3,i4)
  
               u7_34(i3,i4)%c(1,1)=clineth%c(1,1)*ch34(i3,i4)
               u7_34(i3,i4)%c(2,2)=clineth%c(2,2)*ch34(i3,i4)
            enddo
         enddo
  
         x7_34=.true.
      else
