     & ,i4)%e(2)*p8(2)-cz34(i3,i4)%e(3)*p8(3)
      cauxa=-cz34(i3,i4)%ek0*quqd+p348k0*cvqd+p8k0*cvqu
      cauxb=-cz34(i3,i4)%ek0*p8(2)+p8k0*cz34(i3,i4)%e(2)
      cauxc=+cz34(i3,i4)%ek0*p348(2)-p348k0*cz34(i3,i4)%e(2)
      d8_34(i3,i4)%a(1,1)=zcr(id8)*(cauxa+ceps_0)
      d8_34(i3,i4)%a(2,2)=zcl(id8)*(cauxa-ceps_0)
      d8_34(i3,i4)%b(1,2)=zcl(id8)*(cauxb-ceps_2)
      d8_34(i3,i4)%b(2,1)=zcr(id8)*(-cauxb-ceps_2)
      d8_34(i3,i4)%c(1,2)=zcr(id8)*(cauxc+ceps_1)
      d8_34(i3,i4)%c(2,1)=zcl(id8)*(-cauxc+ceps_1)
      d8_34(i3,i4)%d(1,1)=zcl(id8)*cz34(i3,i4)%ek0
      d8_34(i3,i4)%d(2,2)=zcr(id8)*cz34(i3,i4)%ek0
      end do
      end do
  
* f insertion                                                           
      do i3=1,2
      do i4=1,2
* T -- qu=p348,qd=p8,v=cf34(i3,i4)%e,a=d8_34(i3,i4)%a,b=d8_34(i3,i4)%b,c
* =d8_34(i3,i4)%c,d=d8_34(i3,i4)%d,cr=fcr(id8),cl=fcl(id8),nsum=1
      ceps_0=-cf34(i3,i4)%ek0*(p348(2)*p8(3)-p8(2)*p348(3))+p348
     & k0*(cf34(i3,i4)%e(2)*p8(3)-p8(2)*cf34(i3,i4)%e(3))-p8k0*(
     & cf34(i3,i4)%e(2)*p348(3)-p348(2)*cf34(i3,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cf34(i3,i4)%e(3)*p348k0+p348(3)*cf34(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cf34(i3,i4)%e(3)*p8k0+p8(3)*cf34(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cf34(i3,i4)%e(0)*p348(0)-cf34(i3,i4)%e(1)*p348(1)-cf3
     & 4(i3,i4)%e(2)*p348(2)-cf34(i3,i4)%e(3)*p348(3)
      cvqd=cf34(i3,i4)%e(0)*p8(0)-cf34(i3,i4)%e(1)*p8(1)-cf34(i3
     & ,i4)%e(2)*p8(2)-cf34(i3,i4)%e(3)*p8(3)
      cauxa=-cf34(i3,i4)%ek0*quqd+p348k0*cvqd+p8k0*cvqu
      cauxb=-cf34(i3,i4)%ek0*p8(2)+p8k0*cf34(i3,i4)%e(2)
      cauxc=+cf34(i3,i4)%ek0*p348(2)-p348k0*cf34(i3,i4)%e(2)
      d8_34(i3,i4)%a(1,1)=d8_34(i3,i4)%a(1,1)+fcr(id8)*(cauxa+ce
     & ps_0)
      d8_34(i3,i4)%a(2,2)=d8_34(i3,i4)%a(2,2)+fcl(id8)*(cauxa-ce
     & ps_0)
      d8_34(i3,i4)%b(1,2)=d8_34(i3,i4)%b(1,2)+fcl(id8)*(cauxb-ce
     & ps_2)
      d8_34(i3,i4)%b(2,1)=d8_34(i3,i4)%b(2,1)+fcr(id8)*(-cauxb-c
     & eps_2)
      d8_34(i3,i4)%c(1,2)=d8_34(i3,i4)%c(1,2)+fcr(id8)*(cauxc+ce
     & ps_1)
      d8_34(i3,i4)%c(2,1)=d8_34(i3,i4)%c(2,1)+fcl(id8)*(-cauxc+c
     & eps_1)
      d8_34(i3,i4)%d(1,1)=d8_34(i3,i4)%d(1,1)+fcl(id8)*cf34(i3,i
     & 4)%ek0
      d8_34(i3,i4)%d(2,2)=d8_34(i3,i4)%d(2,2)+fcr(id8)*cf34(i3,i
     & 4)%ek0
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id3).eq.1).and.(ibot(id8).eq.1)) then
* TH -- qu=p348,qd=p8,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p348k0*p8(2)+p8k0*p348(2)
      cauxa=auxa-cim*(p8(3)*p348k0-p348(3)*p8k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p8k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p348k0
      clineth%c(2,2)=clineth%c(1,1)
  
         do i3=1,2
            do i4=1,2
               d8_34(i3,i4)%a(1,2)=clineth%a(1,2)*ch34(i3,i4)
               d8_34(i3,i4)%a(2,1)=clineth%a(2,1)*ch34(i3,i4)
  
               d8_34(i3,i4)%b(1,1)=clineth%b(1,1)*ch34(i3,i4)
               d8_34(i3,i4)%b(2,2)=clineth%b(2,2)*ch34(i3,i4)
  
               d8_34(i3,i4)%c(1,1)=clineth%c(1,1)*ch34(i3,i4)
               d8_34(i3,i4)%c(2,2)=clineth%c(2,2)*ch34(i3,i4)
            enddo
         enddo
         x8_34=.true.
  
      else
         x8_34=.false.
  
      endif                     ! on higgs
*** END: insertions of gluonless forks into fermion lines               
  
  
  
* insertion of simple fork and gluon into fermion line                  
  
* compute only per quark base line                                      
      if (iquark(id7).eq.1) then
  
  
* UP PART                                                               
  
*    3 4       cz\\34, ch34                                             
*     \_/                                                               
*    | |                                                                
*  ----0------------       0 is a sum over z,f,h                        
* |          p7134                                                      
*  71                                                                   
  
      quqd=(s7134+s71-s34)/2d0
* z insertion                                                           
      ccr=zcr(id7)/(f7134)
      ccl=zcl(id7)/(f7134)
      do i3=1,2
      do i4=1,2
* T -- qu=p71,qd=p7134,v=cz34(i3,i4)%e,a=clinex_ii(i3,i4)%a,b=clinex_ii(
* i3,i4)%b,c=clinex_ii(i3,i4)%c,d=clinex_ii(i3,i4)%d,cr=ccr,cl=ccl,nsum=
* 0
      ceps_0=-cz34(i3,i4)%ek0*(p71(2)*p7134(3)-p7134(2)*p71(3))+
     & p71k0*(cz34(i3,i4)%e(2)*p7134(3)-p7134(2)*cz34(i3,i4)%e(3
     & ))-p7134k0*(cz34(i3,i4)%e(2)*p71(3)-p71(2)*cz34(i3,i4)%e(
     & 3))
      ceps_0=ceps_0*cim
      ceps_1=-cz34(i3,i4)%e(3)*p71k0+p71(3)*cz34(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz34(i3,i4)%e(3)*p7134k0+p7134(3)*cz34(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cz34(i3,i4)%e(0)*p71(0)-cz34(i3,i4)%e(1)*p71(1)-cz34(
     & i3,i4)%e(2)*p71(2)-cz34(i3,i4)%e(3)*p71(3)
      cvqd=cz34(i3,i4)%e(0)*p7134(0)-cz34(i3,i4)%e(1)*p7134(1)-c
     & z34(i3,i4)%e(2)*p7134(2)-cz34(i3,i4)%e(3)*p7134(3)
      cauxa=-cz34(i3,i4)%ek0*quqd+p71k0*cvqd+p7134k0*cvqu
      cauxb=-cz34(i3,i4)%ek0*p7134(2)+p7134k0*cz34(i3,i4)%e(2)
      cauxc=+cz34(i3,i4)%ek0*p71(2)-p71k0*cz34(i3,i4)%e(2)
      clinex_ii(i3,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      clinex_ii(i3,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      clinex_ii(i3,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      clinex_ii(i3,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      clinex_ii(i3,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      clinex_ii(i3,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      clinex_ii(i3,i4)%d(1,1)=ccl*cz34(i3,i4)%ek0
      clinex_ii(i3,i4)%d(2,2)=ccr*cz34(i3,i4)%ek0
      end do
      end do
  
* f insertion                                                           
      ccr=fcr(id7)/(f7134)
      ccl=fcl(id7)/(f7134)
      do i3=1,2
      do i4=1,2
* T -- qu=p71,qd=p7134,v=cf34(i3,i4)%e,a=clinex_ii(i3,i4)%a,b=clinex_ii(
* i3,i4)%b,c=clinex_ii(i3,i4)%c,d=clinex_ii(i3,i4)%d,cr=ccr,cl=ccl,nsum=
* 1
      ceps_0=-cf34(i3,i4)%ek0*(p71(2)*p7134(3)-p7134(2)*p71(3))+
     & p71k0*(cf34(i3,i4)%e(2)*p7134(3)-p7134(2)*cf34(i3,i4)%e(3
     & ))-p7134k0*(cf34(i3,i4)%e(2)*p71(3)-p71(2)*cf34(i3,i4)%e(
     & 3))
      ceps_0=ceps_0*cim
      ceps_1=-cf34(i3,i4)%e(3)*p71k0+p71(3)*cf34(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cf34(i3,i4)%e(3)*p7134k0+p7134(3)*cf34(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cf34(i3,i4)%e(0)*p71(0)-cf34(i3,i4)%e(1)*p71(1)-cf34(
     & i3,i4)%e(2)*p71(2)-cf34(i3,i4)%e(3)*p71(3)
      cvqd=cf34(i3,i4)%e(0)*p7134(0)-cf34(i3,i4)%e(1)*p7134(1)-c
     & f34(i3,i4)%e(2)*p7134(2)-cf34(i3,i4)%e(3)*p7134(3)
      cauxa=-cf34(i3,i4)%ek0*quqd+p71k0*cvqd+p7134k0*cvqu
      cauxb=-cf34(i3,i4)%ek0*p7134(2)+p7134k0*cf34(i3,i4)%e(2)
      cauxc=+cf34(i3,i4)%ek0*p71(2)-p71k0*cf34(i3,i4)%e(2)
      clinex_ii(i3,i4)%a(1,1)=clinex_ii(i3,i4)%a(1,1)+ccr*(cauxa
     & +ceps_0)
      clinex_ii(i3,i4)%a(2,2)=clinex_ii(i3,i4)%a(2,2)+ccl*(cauxa
     & -ceps_0)
      clinex_ii(i3,i4)%b(1,2)=clinex_ii(i3,i4)%b(1,2)+ccl*(cauxb
     & -ceps_2)
      clinex_ii(i3,i4)%b(2,1)=clinex_ii(i3,i4)%b(2,1)+ccr*(-caux
     & b-ceps_2)
      clinex_ii(i3,i4)%c(1,2)=clinex_ii(i3,i4)%c(1,2)+ccr*(cauxc
     & +ceps_1)
      clinex_ii(i3,i4)%c(2,1)=clinex_ii(i3,i4)%c(2,1)+ccl*(-caux
     & c+ceps_1)
      clinex_ii(i3,i4)%d(1,1)=clinex_ii(i3,i4)%d(1,1)+ccl*cf34(i
     & 3,i4)%ek0
      clinex_ii(i3,i4)%d(2,2)=clinex_ii(i3,i4)%d(2,2)+ccr*cf34(i
     & 3,i4)%ek0
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id3).eq.1).and.(ibot(id7).eq.1)) then
      ccoupl=rhbb/(f7134)
* TH -- qu=p71,qd=p7134,a=clineth%a,b=clineth%b,c=clineth%c,coupl=ccoupl
      auxa=-p71k0*p7134(2)+p7134k0*p71(2)
      cauxa=auxa-cim*(p7134(3)*p71k0-p71(3)*p7134k0)
      clineth%a(1,2)=ccoupl*cauxa
      clineth%a(2,1)=-ccoupl*conjg(cauxa)
      clineth%b(1,1)=ccoupl*p7134k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=ccoupl*p71k0
      clineth%c(2,2)=clineth%c(1,1)
  
      do i3=1,2
         do i4=1,2
            clinex_ii(i3,i4)%a(1,2)=clineth%a(1,2)*ch34(i3,i4)
            clinex_ii(i3,i4)%a(2,1)=clineth%a(2,1)*ch34(i3,i4)
  
            clinex_ii(i3,i4)%b(1,1)=clineth%b(1,1)*ch34(i3,i4)
            clinex_ii(i3,i4)%b(2,2)=clineth%b(2,2)*ch34(i3,i4)
  
            clinex_ii(i3,i4)%c(1,1)=clineth%c(1,1)*ch34(i3,i4)
            clinex_ii(i3,i4)%c(2,2)=clineth%c(2,2)*ch34(i3,i4)
         enddo
      enddo
      x_ii=.true.
  
      else
      x_ii=.false.
  
      endif ! on higgs
  
* merge u7_1 with clinex_ii                                             
      if (x_ii) then
      do i1=1,2
      do i3=1,2
      do i4=1,2
* TTs -- aa=u7_1_34(i1,i3,i4)%a,bb=u7_1_34(i1,i3,i4)%b,cc=u7_1_34(i1,i3,
* i4)%c,dd=u7_1_34(i1,i3,i4)%d,a1=u7_1(i1)%a,b1=u7_1(i1)%b,c1=u7_1(i1)%c
* ,d1=u7_1(i1)%d,a2=clinex_ii(i3,i4)%a,b2=clinex_ii(i3,i4)%b,c2=clinex_i
* i(i3,i4)%c,d2=clinex_ii(i3,i4)%d,prq=s71,m=rmass(id7),nsum=0
      do jut=1,2
      cx1=clinex_ii(i3,i4)%a(1,jut)+rmass(id7)*clinex_ii(i3,i4)%
     & b(1,jut)
      cx2=clinex_ii(i3,i4)%a(2,jut)+rmass(id7)*clinex_ii(i3,i4)%
     & b(2,jut)
      cy1=s71*clinex_ii(i3,i4)%b(1,jut)+rmass(id7)*clinex_ii(i3,
     & i4)%a(1,jut)
      cy2=s71*clinex_ii(i3,i4)%b(2,jut)+rmass(id7)*clinex_ii(i3,
     & i4)%a(2,jut)
      cw1=clinex_ii(i3,i4)%c(1,jut)+rmass(id7)*clinex_ii(i3,i4)%
     & d(1,jut)
      cw2=clinex_ii(i3,i4)%c(2,jut)+rmass(id7)*clinex_ii(i3,i4)%
     & d(2,jut)
      cz1=s71*clinex_ii(i3,i4)%d(1,jut)+rmass(id7)*clinex_ii(i3,
     & i4)%c(1,jut)
      cz2=s71*clinex_ii(i3,i4)%d(2,jut)+rmass(id7)*clinex_ii(i3,
     & i4)%c(2,jut)
      u7_1_34(i1,i3,i4)%a(1,jut)=u7_1(i1)%a(1,1)*cx1+u7_1(i1)%c(
     & 1,2)*cy2
      u7_1_34(i1,i3,i4)%b(1,jut)=u7_1(i1)%d(1,1)*cy1+u7_1(i1)%b(
     & 1,2)*cx2
      u7_1_34(i1,i3,i4)%c(1,jut)=u7_1(i1)%a(1,1)*cw1+u7_1(i1)%c(
     & 1,2)*cz2
      u7_1_34(i1,i3,i4)%d(1,jut)=u7_1(i1)%d(1,1)*cz1+u7_1(i1)%b(
     & 1,2)*cw2
      u7_1_34(i1,i3,i4)%a(2,jut)=u7_1(i1)%c(2,1)*cy1+u7_1(i1)%a(
     & 2,2)*cx2
      u7_1_34(i1,i3,i4)%b(2,jut)=u7_1(i1)%b(2,1)*cx1+u7_1(i1)%d(
     & 2,2)*cy2
      u7_1_34(i1,i3,i4)%c(2,jut)=u7_1(i1)%c(2,1)*cz1+u7_1(i1)%a(
     & 2,2)*cw2
      u7_1_34(i1,i3,i4)%d(2,jut)=u7_1(i1)%b(2,1)*cw1+u7_1(i1)%d(
     & 2,2)*cz2
      end do
      end do
      end do
      end do
      else
      do i1=1,2
      do i3=1,2
      do i4=1,2
* TT -- aa=u7_1_34(i1,i3,i4)%a,bb=u7_1_34(i1,i3,i4)%b,cc=u7_1_34(i1,i3,i
* 4)%c,dd=u7_1_34(i1,i3,i4)%d,a1=u7_1(i1)%a,b1=u7_1(i1)%b,c1=u7_1(i1)%c,
* d1=u7_1(i1)%d,a2=clinex_ii(i3,i4)%a,b2=clinex_ii(i3,i4)%b,c2=clinex_ii
* (i3,i4)%c,d2=clinex_ii(i3,i4)%d,prq=s71,m=rmass(id7),nsum=0
      u7_1_34(i1,i3,i4)%a(1,1)=u7_1(i1)%a(1,1)*clinex_ii(i3,i4)%
     & a(1,1)+u7_1(i1)%c(1,2)*s71*clinex_ii(i3,i4)%b(2,1)
      u7_1_34(i1,i3,i4)%b(1,1)=rmass(id7)*(u7_1(i1)%d(1,1)*cline
     & x_ii(i3,i4)%a(1,1)+u7_1(i1)%b(1,2)*clinex_ii(i3,i4)%b(2,1
     & ))
      u7_1_34(i1,i3,i4)%c(1,1)=rmass(id7)*(u7_1(i1)%a(1,1)*cline
     & x_ii(i3,i4)%d(1,1)+u7_1(i1)%c(1,2)*clinex_ii(i3,i4)%c(2,1
     & ))
      u7_1_34(i1,i3,i4)%d(1,1)=u7_1(i1)%d(1,1)*s71*clinex_ii(i3,
     & i4)%d(1,1)+u7_1(i1)%b(1,2)*clinex_ii(i3,i4)%c(2,1)
      u7_1_34(i1,i3,i4)%a(1,2)=rmass(id7)*(u7_1(i1)%a(1,1)*cline
     & x_ii(i3,i4)%b(1,2)+u7_1(i1)%c(1,2)*clinex_ii(i3,i4)%a(2,2
     & ))
      u7_1_34(i1,i3,i4)%b(1,2)=u7_1(i1)%d(1,1)*s71*clinex_ii(i3,
     & i4)%b(1,2)+u7_1(i1)%b(1,2)*clinex_ii(i3,i4)%a(2,2)
      u7_1_34(i1,i3,i4)%c(1,2)=u7_1(i1)%a(1,1)*clinex_ii(i3,i4)%
     & c(1,2)+u7_1(i1)%c(1,2)*s71*clinex_ii(i3,i4)%d(2,2)
      u7_1_34(i1,i3,i4)%d(1,2)=rmass(id7)*(u7_1(i1)%d(1,1)*cline
     & x_ii(i3,i4)%c(1,2)+u7_1(i1)%b(1,2)*clinex_ii(i3,i4)%d(2,2
     & ))
      u7_1_34(i1,i3,i4)%a(2,1)=rmass(id7)*(u7_1(i1)%c(2,1)*cline
     & x_ii(i3,i4)%a(1,1)+u7_1(i1)%a(2,2)*clinex_ii(i3,i4)%b(2,1
     & ))
      u7_1_34(i1,i3,i4)%b(2,1)=u7_1(i1)%b(2,1)*clinex_ii(i3,i4)%
     & a(1,1)+u7_1(i1)%d(2,2)*s71*clinex_ii(i3,i4)%b(2,1)
      u7_1_34(i1,i3,i4)%c(2,1)=u7_1(i1)%c(2,1)*s71*clinex_ii(i3,
     & i4)%d(1,1)+u7_1(i1)%a(2,2)*clinex_ii(i3,i4)%c(2,1)
      u7_1_34(i1,i3,i4)%d(2,1)=rmass(id7)*(u7_1(i1)%b(2,1)*cline
     & x_ii(i3,i4)%d(1,1)+u7_1(i1)%d(2,2)*clinex_ii(i3,i4)%c(2,1
     & ))
