      quqd=(s756+rmass2(id7)-s56)/2d0
  
* z insertion                                                           
      ccr=zcr(id7)/(f756)
      ccl=zcl(id7)/(f756)
      do i3=1,2
      do i4=1,2
* T -- qu=p7,qd=p756,v=cz56(i3,i4)%e,a=u7_56(i3,i4)%a,b=u7_56(i3,i4)%b,c
* =u7_56(i3,i4)%c,d=u7_56(i3,i4)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-cz56(i3,i4)%ek0*(p7(2)*p756(3)-p756(2)*p7(3))+p7k0
     & *(cz56(i3,i4)%e(2)*p756(3)-p756(2)*cz56(i3,i4)%e(3))-p756
     & k0*(cz56(i3,i4)%e(2)*p7(3)-p7(2)*cz56(i3,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz56(i3,i4)%e(3)*p7k0+p7(3)*cz56(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz56(i3,i4)%e(3)*p756k0+p756(3)*cz56(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cz56(i3,i4)%e(0)*p7(0)-cz56(i3,i4)%e(1)*p7(1)-cz56(i3
     & ,i4)%e(2)*p7(2)-cz56(i3,i4)%e(3)*p7(3)
      cvqd=cz56(i3,i4)%e(0)*p756(0)-cz56(i3,i4)%e(1)*p756(1)-cz5
     & 6(i3,i4)%e(2)*p756(2)-cz56(i3,i4)%e(3)*p756(3)
      cauxa=-cz56(i3,i4)%ek0*quqd+p7k0*cvqd+p756k0*cvqu
      cauxb=-cz56(i3,i4)%ek0*p756(2)+p756k0*cz56(i3,i4)%e(2)
      cauxc=+cz56(i3,i4)%ek0*p7(2)-p7k0*cz56(i3,i4)%e(2)
      u7_56(i3,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      u7_56(i3,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      u7_56(i3,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      u7_56(i3,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      u7_56(i3,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      u7_56(i3,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      u7_56(i3,i4)%d(1,1)=ccl*cz56(i3,i4)%ek0
      u7_56(i3,i4)%d(2,2)=ccr*cz56(i3,i4)%ek0
