* f insertion                                                           
      ccr=fcr(id7)/(f756)
      ccl=fcl(id7)/(f756)
      do i3=1,2
      do i4=1,2
* T -- qu=p7,qd=p756,v=cf56(i3,i4)%e,a=u7_56(i3,i4)%a,b=u7_56(i3,i4)%b,c
* =u7_56(i3,i4)%c,d=u7_56(i3,i4)%d,cr=ccr,cl=ccl,nsum=1
      ceps_0=-cf56(i3,i4)%ek0*(p7(2)*p756(3)-p756(2)*p7(3))+p7k0
     & *(cf56(i3,i4)%e(2)*p756(3)-p756(2)*cf56(i3,i4)%e(3))-p756
     & k0*(cf56(i3,i4)%e(2)*p7(3)-p7(2)*cf56(i3,i4)%e(3))
