      ceps_2=ceps_2*cim
      cvqu=cf56(i3,i4)%e(0)*p7(0)-cf56(i3,i4)%e(1)*p7(1)-cf56(i3
     & ,i4)%e(2)*p7(2)-cf56(i3,i4)%e(3)*p7(3)
      cvqd=cf56(i3,i4)%e(0)*p756(0)-cf56(i3,i4)%e(1)*p756(1)-cf5
     & 6(i3,i4)%e(2)*p756(2)-cf56(i3,i4)%e(3)*p756(3)
      cauxa=-cf56(i3,i4)%ek0*quqd+p7k0*cvqd+p756k0*cvqu
      cauxb=-cf56(i3,i4)%ek0*p756(2)+p756k0*cf56(i3,i4)%e(2)
      cauxc=+cf56(i3,i4)%ek0*p7(2)-p7k0*cf56(i3,i4)%e(2)
      u7_56(i3,i4)%a(1,1)=u7_56(i3,i4)%a(1,1)+ccr*(cauxa+ceps_0)
      u7_56(i3,i4)%a(2,2)=u7_56(i3,i4)%a(2,2)+ccl*(cauxa-ceps_0)
      u7_56(i3,i4)%b(1,2)=u7_56(i3,i4)%b(1,2)+ccl*(cauxb-ceps_2)
      u7_56(i3,i4)%b(2,1)=u7_56(i3,i4)%b(2,1)+ccr*(-cauxb-ceps_2
     & )
      u7_56(i3,i4)%c(1,2)=u7_56(i3,i4)%c(1,2)+ccr*(cauxc+ceps_1)
      u7_56(i3,i4)%c(2,1)=u7_56(i3,i4)%c(2,1)+ccl*(-cauxc+ceps_1
     & )
      u7_56(i3,i4)%d(1,1)=u7_56(i3,i4)%d(1,1)+ccl*cf56(i3,i4)%ek
     & 0
      u7_56(i3,i4)%d(2,2)=u7_56(i3,i4)%d(2,2)+ccr*cf56(i3,i4)%ek
     & 0
