* higgs                                                                 
      if ((ibot(id5).eq.1).and.(ibot(id7).eq.1)) then
  
      ccoupl=rhbb/(f756)
* TH -- qu=p7,qd=p756,a=clineth%a,b=clineth%b,c=clineth%c,coupl=ccoupl
      auxa=-p7k0*p756(2)+p756k0*p7(2)
