      quqd=(s534+rmass2(id5)-s34)/2d0
  
* z insertion                                                           
      ccr=zcr(id5)/(f534)
      ccl=zcl(id5)/(f534)
      do i3=1,2
      do i4=1,2
* T -- qu=p5,qd=p534,v=cz34(i3,i4)%e,a=u5_34(i3,i4)%a,b=u5_34(i3,i4)%b,c
* =u5_34(i3,i4)%c,d=u5_34(i3,i4)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-cz34(i3,i4)%ek0*(p5(2)*p534(3)-p534(2)*p5(3))+p5k0
     & *(cz34(i3,i4)%e(2)*p534(3)-p534(2)*cz34(i3,i4)%e(3))-p534
     & k0*(cz34(i3,i4)%e(2)*p5(3)-p5(2)*cz34(i3,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz34(i3,i4)%e(3)*p5k0+p5(3)*cz34(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz34(i3,i4)%e(3)*p534k0+p534(3)*cz34(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cz34(i3,i4)%e(0)*p5(0)-cz34(i3,i4)%e(1)*p5(1)-cz34(i3
     & ,i4)%e(2)*p5(2)-cz34(i3,i4)%e(3)*p5(3)
      cvqd=cz34(i3,i4)%e(0)*p534(0)-cz34(i3,i4)%e(1)*p534(1)-cz3
     & 4(i3,i4)%e(2)*p534(2)-cz34(i3,i4)%e(3)*p534(3)
      cauxa=-cz34(i3,i4)%ek0*quqd+p5k0*cvqd+p534k0*cvqu
      cauxb=-cz34(i3,i4)%ek0*p534(2)+p534k0*cz34(i3,i4)%e(2)
      cauxc=+cz34(i3,i4)%ek0*p5(2)-p5k0*cz34(i3,i4)%e(2)
      u5_34(i3,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      u5_34(i3,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      u5_34(i3,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      u5_34(i3,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      u5_34(i3,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      u5_34(i3,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      u5_34(i3,i4)%d(1,1)=ccl*cz34(i3,i4)%ek0
      u5_34(i3,i4)%d(2,2)=ccr*cz34(i3,i4)%ek0
