      do i3=1,2
      do i4=1,2
* T -- qu=p5,qd=p534,v=cf34(i3,i4)%e,a=u5_34(i3,i4)%a,b=u5_34(i3,i4)%b,c
* =u5_34(i3,i4)%c,d=u5_34(i3,i4)%d,cr=ccr,cl=ccl,nsum=1
      ceps_0=-cf34(i3,i4)%ek0*(p5(2)*p534(3)-p534(2)*p5(3))+p5k0
     & *(cf34(i3,i4)%e(2)*p534(3)-p534(2)*cf34(i3,i4)%e(3))-p534
     & k0*(cf34(i3,i4)%e(2)*p5(3)-p5(2)*cf34(i3,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cf34(i3,i4)%e(3)*p5k0+p5(3)*cf34(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cf34(i3,i4)%e(3)*p534k0+p534(3)*cf34(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cf34(i3,i4)%e(0)*p5(0)-cf34(i3,i4)%e(1)*p5(1)-cf34(i3
     & ,i4)%e(2)*p5(2)-cf34(i3,i4)%e(3)*p5(3)
      cvqd=cf34(i3,i4)%e(0)*p534(0)-cf34(i3,i4)%e(1)*p534(1)-cf3
     & 4(i3,i4)%e(2)*p534(2)-cf34(i3,i4)%e(3)*p534(3)
      cauxa=-cf34(i3,i4)%ek0*quqd+p5k0*cvqd+p534k0*cvqu
      cauxb=-cf34(i3,i4)%ek0*p534(2)+p534k0*cf34(i3,i4)%e(2)
      cauxc=+cf34(i3,i4)%ek0*p5(2)-p5k0*cf34(i3,i4)%e(2)
      u5_34(i3,i4)%a(1,1)=u5_34(i3,i4)%a(1,1)+ccr*(cauxa+ceps_0)
      u5_34(i3,i4)%a(2,2)=u5_34(i3,i4)%a(2,2)+ccl*(cauxa-ceps_0)
      u5_34(i3,i4)%b(1,2)=u5_34(i3,i4)%b(1,2)+ccl*(cauxb-ceps_2)
      u5_34(i3,i4)%b(2,1)=u5_34(i3,i4)%b(2,1)+ccr*(-cauxb-ceps_2
     & )
      u5_34(i3,i4)%c(1,2)=u5_34(i3,i4)%c(1,2)+ccr*(cauxc+ceps_1)
      u5_34(i3,i4)%c(2,1)=u5_34(i3,i4)%c(2,1)+ccl*(-cauxc+ceps_1
     & )
      u5_34(i3,i4)%d(1,1)=u5_34(i3,i4)%d(1,1)+ccl*cf34(i3,i4)%ek
     & 0
      u5_34(i3,i4)%d(2,2)=u5_34(i3,i4)%d(2,2)+ccr*cf34(i3,i4)%ek
     & 0
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id3).eq.1).and.(ibot(id5).eq.1)) then
  
      ccoupl=rhbb/(f534)
* TH -- qu=p5,qd=p534,a=clineth%a,b=clineth%b,c=clineth%c,coupl=ccoupl
      auxa=-p5k0*p534(2)+p534k0*p5(2)
      cauxa=auxa-cim*(p534(3)*p5k0-p5(3)*p534k0)
      clineth%a(1,2)=ccoupl*cauxa
      clineth%a(2,1)=-ccoupl*conjg(cauxa)
      clineth%b(1,1)=ccoupl*p534k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=ccoupl*p5k0
      clineth%c(2,2)=clineth%c(1,1)
  
         do i3=1,2
            do i4=1,2
               u5_34(i3,i4)%a(1,2)=clineth%a(1,2)*ch34(i3,i4)
               u5_34(i3,i4)%a(2,1)=clineth%a(2,1)*ch34(i3,i4)
  
               u5_34(i3,i4)%b(1,1)=clineth%b(1,1)*ch34(i3,i4)
               u5_34(i3,i4)%b(2,2)=clineth%b(2,2)*ch34(i3,i4)
  
               u5_34(i3,i4)%c(1,1)=clineth%c(1,1)*ch34(i3,i4)
               u5_34(i3,i4)%c(2,2)=clineth%c(2,2)*ch34(i3,i4)
            enddo
         enddo
  
         x5_34=.true.
      else
         x5_34=.false.
      endif ! on higgs
  
  
* DOWN PART                                                             
  
*                                                                       
*           3  4                                                        
*            \_/                                                        
*             |    | 6                                                  
*  -----------0-----                                                    
*   p346                                                                
  
      quqd=(s34-s346-rmass2(id6))/2d0
  
* z insertion                                                           
      do i3=1,2
      do i4=1,2
* T -- qu=p346,qd=p6,v=cz34(i3,i4)%e,a=d6_34(i3,i4)%a,b=d6_34(i3,i4)%b,c
* =d6_34(i3,i4)%c,d=d6_34(i3,i4)%d,cr=zcr(id6),cl=zcl(id6),nsum=0
      ceps_0=-cz34(i3,i4)%ek0*(p346(2)*p6(3)-p6(2)*p346(3))+p346
     & k0*(cz34(i3,i4)%e(2)*p6(3)-p6(2)*cz34(i3,i4)%e(3))-p6k0*(
     & cz34(i3,i4)%e(2)*p346(3)-p346(2)*cz34(i3,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz34(i3,i4)%e(3)*p346k0+p346(3)*cz34(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz34(i3,i4)%e(3)*p6k0+p6(3)*cz34(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cz34(i3,i4)%e(0)*p346(0)-cz34(i3,i4)%e(1)*p346(1)-cz3
     & 4(i3,i4)%e(2)*p346(2)-cz34(i3,i4)%e(3)*p346(3)
      cvqd=cz34(i3,i4)%e(0)*p6(0)-cz34(i3,i4)%e(1)*p6(1)-cz34(i3
     & ,i4)%e(2)*p6(2)-cz34(i3,i4)%e(3)*p6(3)
      cauxa=-cz34(i3,i4)%ek0*quqd+p346k0*cvqd+p6k0*cvqu
      cauxb=-cz34(i3,i4)%ek0*p6(2)+p6k0*cz34(i3,i4)%e(2)
      cauxc=+cz34(i3,i4)%ek0*p346(2)-p346k0*cz34(i3,i4)%e(2)
      d6_34(i3,i4)%a(1,1)=zcr(id6)*(cauxa+ceps_0)
      d6_34(i3,i4)%a(2,2)=zcl(id6)*(cauxa-ceps_0)
      d6_34(i3,i4)%b(1,2)=zcl(id6)*(cauxb-ceps_2)
      d6_34(i3,i4)%b(2,1)=zcr(id6)*(-cauxb-ceps_2)
      d6_34(i3,i4)%c(1,2)=zcr(id6)*(cauxc+ceps_1)
      d6_34(i3,i4)%c(2,1)=zcl(id6)*(-cauxc+ceps_1)
      d6_34(i3,i4)%d(1,1)=zcl(id6)*cz34(i3,i4)%ek0
      d6_34(i3,i4)%d(2,2)=zcr(id6)*cz34(i3,i4)%ek0
      end do
      end do
  
* f insertion                                                           
      do i3=1,2
      do i4=1,2
* T -- qu=p346,qd=p6,v=cf34(i3,i4)%e,a=d6_34(i3,i4)%a,b=d6_34(i3,i4)%b,c
* =d6_34(i3,i4)%c,d=d6_34(i3,i4)%d,cr=fcr(id6),cl=fcl(id6),nsum=1
      ceps_0=-cf34(i3,i4)%ek0*(p346(2)*p6(3)-p6(2)*p346(3))+p346
     & k0*(cf34(i3,i4)%e(2)*p6(3)-p6(2)*cf34(i3,i4)%e(3))-p6k0*(
     & cf34(i3,i4)%e(2)*p346(3)-p346(2)*cf34(i3,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cf34(i3,i4)%e(3)*p346k0+p346(3)*cf34(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cf34(i3,i4)%e(3)*p6k0+p6(3)*cf34(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cf34(i3,i4)%e(0)*p346(0)-cf34(i3,i4)%e(1)*p346(1)-cf3
     & 4(i3,i4)%e(2)*p346(2)-cf34(i3,i4)%e(3)*p346(3)
      cvqd=cf34(i3,i4)%e(0)*p6(0)-cf34(i3,i4)%e(1)*p6(1)-cf34(i3
     & ,i4)%e(2)*p6(2)-cf34(i3,i4)%e(3)*p6(3)
      cauxa=-cf34(i3,i4)%ek0*quqd+p346k0*cvqd+p6k0*cvqu
      cauxb=-cf34(i3,i4)%ek0*p6(2)+p6k0*cf34(i3,i4)%e(2)
      cauxc=+cf34(i3,i4)%ek0*p346(2)-p346k0*cf34(i3,i4)%e(2)
      d6_34(i3,i4)%a(1,1)=d6_34(i3,i4)%a(1,1)+fcr(id6)*(cauxa+ce
     & ps_0)
      d6_34(i3,i4)%a(2,2)=d6_34(i3,i4)%a(2,2)+fcl(id6)*(cauxa-ce
     & ps_0)
      d6_34(i3,i4)%b(1,2)=d6_34(i3,i4)%b(1,2)+fcl(id6)*(cauxb-ce
     & ps_2)
      d6_34(i3,i4)%b(2,1)=d6_34(i3,i4)%b(2,1)+fcr(id6)*(-cauxb-c
     & eps_2)
      d6_34(i3,i4)%c(1,2)=d6_34(i3,i4)%c(1,2)+fcr(id6)*(cauxc+ce
     & ps_1)
      d6_34(i3,i4)%c(2,1)=d6_34(i3,i4)%c(2,1)+fcl(id6)*(-cauxc+c
     & eps_1)
      d6_34(i3,i4)%d(1,1)=d6_34(i3,i4)%d(1,1)+fcl(id6)*cf34(i3,i
     & 4)%ek0
      d6_34(i3,i4)%d(2,2)=d6_34(i3,i4)%d(2,2)+fcr(id6)*cf34(i3,i
     & 4)%ek0
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id3).eq.1).and.(ibot(id6).eq.1)) then
* TH -- qu=p346,qd=p6,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p346k0*p6(2)+p6k0*p346(2)
      cauxa=auxa-cim*(p6(3)*p346k0-p346(3)*p6k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p6k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p346k0
      clineth%c(2,2)=clineth%c(1,1)
  
         do i3=1,2
            do i4=1,2
               d6_34(i3,i4)%a(1,2)=clineth%a(1,2)*ch34(i3,i4)
               d6_34(i3,i4)%a(2,1)=clineth%a(2,1)*ch34(i3,i4)
  
               d6_34(i3,i4)%b(1,1)=clineth%b(1,1)*ch34(i3,i4)
               d6_34(i3,i4)%b(2,2)=clineth%b(2,2)*ch34(i3,i4)
  
               d6_34(i3,i4)%c(1,1)=clineth%c(1,1)*ch34(i3,i4)
               d6_34(i3,i4)%c(2,2)=clineth%c(2,2)*ch34(i3,i4)
            enddo
         enddo
         x6_34=.true.
  
      else
         x6_34=.false.
  
      endif                     ! on higgs
*** END: insertions of gluonless forks into fermion lines               
  
  
  
* insertion of simple fork and gluon into fermion line                  
  
* compute only per quark base line                                      
      if (iquark(id5).eq.1) then
  
  
* UP PART                                                               
  
*    3 4       cz\\34, ch34                                             
*     \_/                                                               
*    | |                                                                
*  ----0------------       0 is a sum over z,f,h                        
* |          p5134                                                      
*  51                                                                   
  
      quqd=(s5134+s51-s34)/2d0
* z insertion                                                           
      ccr=zcr(id5)/(f5134)
      ccl=zcl(id5)/(f5134)
      do i3=1,2
      do i4=1,2
* T -- qu=p51,qd=p5134,v=cz34(i3,i4)%e,a=clinex_ii(i3,i4)%a,b=clinex_ii(
* i3,i4)%b,c=clinex_ii(i3,i4)%c,d=clinex_ii(i3,i4)%d,cr=ccr,cl=ccl,nsum=
* 0
      ceps_0=-cz34(i3,i4)%ek0*(p51(2)*p5134(3)-p5134(2)*p51(3))+
     & p51k0*(cz34(i3,i4)%e(2)*p5134(3)-p5134(2)*cz34(i3,i4)%e(3
     & ))-p5134k0*(cz34(i3,i4)%e(2)*p51(3)-p51(2)*cz34(i3,i4)%e(
     & 3))
      ceps_0=ceps_0*cim
      ceps_1=-cz34(i3,i4)%e(3)*p51k0+p51(3)*cz34(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz34(i3,i4)%e(3)*p5134k0+p5134(3)*cz34(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cz34(i3,i4)%e(0)*p51(0)-cz34(i3,i4)%e(1)*p51(1)-cz34(
     & i3,i4)%e(2)*p51(2)-cz34(i3,i4)%e(3)*p51(3)
      cvqd=cz34(i3,i4)%e(0)*p5134(0)-cz34(i3,i4)%e(1)*p5134(1)-c
     & z34(i3,i4)%e(2)*p5134(2)-cz34(i3,i4)%e(3)*p5134(3)
      cauxa=-cz34(i3,i4)%ek0*quqd+p51k0*cvqd+p5134k0*cvqu
      cauxb=-cz34(i3,i4)%ek0*p5134(2)+p5134k0*cz34(i3,i4)%e(2)
      cauxc=+cz34(i3,i4)%ek0*p51(2)-p51k0*cz34(i3,i4)%e(2)
      clinex_ii(i3,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      clinex_ii(i3,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      clinex_ii(i3,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      clinex_ii(i3,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      clinex_ii(i3,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      clinex_ii(i3,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      clinex_ii(i3,i4)%d(1,1)=ccl*cz34(i3,i4)%ek0
      clinex_ii(i3,i4)%d(2,2)=ccr*cz34(i3,i4)%ek0
      end do
      end do
  
* f insertion                                                           
      ccr=fcr(id5)/(f5134)
      ccl=fcl(id5)/(f5134)
      do i3=1,2
      do i4=1,2
* T -- qu=p51,qd=p5134,v=cf34(i3,i4)%e,a=clinex_ii(i3,i4)%a,b=clinex_ii(
* i3,i4)%b,c=clinex_ii(i3,i4)%c,d=clinex_ii(i3,i4)%d,cr=ccr,cl=ccl,nsum=
* 1
      ceps_0=-cf34(i3,i4)%ek0*(p51(2)*p5134(3)-p5134(2)*p51(3))+
     & p51k0*(cf34(i3,i4)%e(2)*p5134(3)-p5134(2)*cf34(i3,i4)%e(3
     & ))-p5134k0*(cf34(i3,i4)%e(2)*p51(3)-p51(2)*cf34(i3,i4)%e(
     & 3))
      ceps_0=ceps_0*cim
      ceps_1=-cf34(i3,i4)%e(3)*p51k0+p51(3)*cf34(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cf34(i3,i4)%e(3)*p5134k0+p5134(3)*cf34(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cf34(i3,i4)%e(0)*p51(0)-cf34(i3,i4)%e(1)*p51(1)-cf34(
     & i3,i4)%e(2)*p51(2)-cf34(i3,i4)%e(3)*p51(3)
      cvqd=cf34(i3,i4)%e(0)*p5134(0)-cf34(i3,i4)%e(1)*p5134(1)-c
     & f34(i3,i4)%e(2)*p5134(2)-cf34(i3,i4)%e(3)*p5134(3)
      cauxa=-cf34(i3,i4)%ek0*quqd+p51k0*cvqd+p5134k0*cvqu
      cauxb=-cf34(i3,i4)%ek0*p5134(2)+p5134k0*cf34(i3,i4)%e(2)
      cauxc=+cf34(i3,i4)%ek0*p51(2)-p51k0*cf34(i3,i4)%e(2)
      clinex_ii(i3,i4)%a(1,1)=clinex_ii(i3,i4)%a(1,1)+ccr*(cauxa
     & +ceps_0)
      clinex_ii(i3,i4)%a(2,2)=clinex_ii(i3,i4)%a(2,2)+ccl*(cauxa
     & -ceps_0)
      clinex_ii(i3,i4)%b(1,2)=clinex_ii(i3,i4)%b(1,2)+ccl*(cauxb
     & -ceps_2)
      clinex_ii(i3,i4)%b(2,1)=clinex_ii(i3,i4)%b(2,1)+ccr*(-caux
     & b-ceps_2)
      clinex_ii(i3,i4)%c(1,2)=clinex_ii(i3,i4)%c(1,2)+ccr*(cauxc
     & +ceps_1)
      clinex_ii(i3,i4)%c(2,1)=clinex_ii(i3,i4)%c(2,1)+ccl*(-caux
     & c+ceps_1)
      clinex_ii(i3,i4)%d(1,1)=clinex_ii(i3,i4)%d(1,1)+ccl*cf34(i
     & 3,i4)%ek0
      clinex_ii(i3,i4)%d(2,2)=clinex_ii(i3,i4)%d(2,2)+ccr*cf34(i
     & 3,i4)%ek0
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id3).eq.1).and.(ibot(id5).eq.1)) then
      ccoupl=rhbb/(f5134)
* TH -- qu=p51,qd=p5134,a=clineth%a,b=clineth%b,c=clineth%c,coupl=ccoupl
      auxa=-p51k0*p5134(2)+p5134k0*p51(2)
      cauxa=auxa-cim*(p5134(3)*p51k0-p51(3)*p5134k0)
      clineth%a(1,2)=ccoupl*cauxa
      clineth%a(2,1)=-ccoupl*conjg(cauxa)
      clineth%b(1,1)=ccoupl*p5134k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=ccoupl*p51k0
      clineth%c(2,2)=clineth%c(1,1)
  
      do i3=1,2
         do i4=1,2
            clinex_ii(i3,i4)%a(1,2)=clineth%a(1,2)*ch34(i3,i4)
            clinex_ii(i3,i4)%a(2,1)=clineth%a(2,1)*ch34(i3,i4)
  
            clinex_ii(i3,i4)%b(1,1)=clineth%b(1,1)*ch34(i3,i4)
            clinex_ii(i3,i4)%b(2,2)=clineth%b(2,2)*ch34(i3,i4)
  
            clinex_ii(i3,i4)%c(1,1)=clineth%c(1,1)*ch34(i3,i4)
            clinex_ii(i3,i4)%c(2,2)=clineth%c(2,2)*ch34(i3,i4)
         enddo
      enddo
      x_ii=.true.
  
      else
      x_ii=.false.
  
      endif ! on higgs
  
* merge u5_1 with clinex_ii                                             
      if (x_ii) then
      do i1=1,2
      do i3=1,2
      do i4=1,2
* TTs -- aa=u5_1_34(i1,i3,i4)%a,bb=u5_1_34(i1,i3,i4)%b,cc=u5_1_34(i1,i3,
* i4)%c,dd=u5_1_34(i1,i3,i4)%d,a1=u5_1(i1)%a,b1=u5_1(i1)%b,c1=u5_1(i1)%c
* ,d1=u5_1(i1)%d,a2=clinex_ii(i3,i4)%a,b2=clinex_ii(i3,i4)%b,c2=clinex_i
* i(i3,i4)%c,d2=clinex_ii(i3,i4)%d,prq=s51,m=rmass(id5),nsum=0
      do jut=1,2
      cx1=clinex_ii(i3,i4)%a(1,jut)+rmass(id5)*clinex_ii(i3,i4)%
     & b(1,jut)
      cx2=clinex_ii(i3,i4)%a(2,jut)+rmass(id5)*clinex_ii(i3,i4)%
     & b(2,jut)
      cy1=s51*clinex_ii(i3,i4)%b(1,jut)+rmass(id5)*clinex_ii(i3,
     & i4)%a(1,jut)
      cy2=s51*clinex_ii(i3,i4)%b(2,jut)+rmass(id5)*clinex_ii(i3,
     & i4)%a(2,jut)
      cw1=clinex_ii(i3,i4)%c(1,jut)+rmass(id5)*clinex_ii(i3,i4)%
     & d(1,jut)
      cw2=clinex_ii(i3,i4)%c(2,jut)+rmass(id5)*clinex_ii(i3,i4)%
     & d(2,jut)
      cz1=s51*clinex_ii(i3,i4)%d(1,jut)+rmass(id5)*clinex_ii(i3,
     & i4)%c(1,jut)
