     & (i1)%b(2,1)*d6_78(i3,i4)%a(1,1)+clinet_i(i1)%d(2,2)*s786*
     & d6_78(i3,i4)%b(2,1)
      d6_2_78(i1,i3,i4)%c(2,1)=d6_2_78(i1,i3,i4)%c(2,1)+clinet_i
     & (i1)%c(2,1)*s786*d6_78(i3,i4)%d(1,1)+clinet_i(i1)%a(2,2)*
     & d6_78(i3,i4)%c(2,1)
      d6_2_78(i1,i3,i4)%d(2,1)=d6_2_78(i1,i3,i4)%d(2,1)+rmass(id
     & 6)*(clinet_i(i1)%b(2,1)*d6_78(i3,i4)%d(1,1)+clinet_i(i1)%
     & d(2,2)*d6_78(i3,i4)%c(2,1))
      d6_2_78(i1,i3,i4)%a(2,2)=d6_2_78(i1,i3,i4)%a(2,2)+clinet_i
     & (i1)%c(2,1)*s786*d6_78(i3,i4)%b(1,2)+clinet_i(i1)%a(2,2)*
     & d6_78(i3,i4)%a(2,2)
      d6_2_78(i1,i3,i4)%b(2,2)=d6_2_78(i1,i3,i4)%b(2,2)+rmass(id
     & 6)*(clinet_i(i1)%b(2,1)*d6_78(i3,i4)%b(1,2)+clinet_i(i1)%
     & d(2,2)*d6_78(i3,i4)%a(2,2))
      d6_2_78(i1,i3,i4)%c(2,2)=d6_2_78(i1,i3,i4)%c(2,2)+rmass(id
     & 6)*(clinet_i(i1)%c(2,1)*d6_78(i3,i4)%c(1,2)+clinet_i(i1)%
     & a(2,2)*d6_78(i3,i4)%d(2,2))
      d6_2_78(i1,i3,i4)%d(2,2)=d6_2_78(i1,i3,i4)%d(2,2)+clinet_i
     & (i1)%b(2,1)*d6_78(i3,i4)%c(1,2)+clinet_i(i1)%d(2,2)*s786*
     & d6_78(i3,i4)%d(2,2)
      end do
      end do
      end do
      endif
  
      endif ! on (iquark(id5)), compute only per quark base line
*** END: insertions of gluonless forks into fermion lines               
*** in which inserted from the outer side a gluon                       
  
  
* insertions of simple forks into fermion lines                         
  
* UP PART                                                               
  
*                                                                       
*    5  6         cz\\56, ch56                                          
*     \_/                                                               
*      |                                                                
*  ----0------------  0 is a sum over z,f,h                             
* |          p356                                                       
*  3                                                                    
  
      quqd=(s356+rmass2(id3)-s56)/2d0
  
* z insertion                                                           
      ccr=zcr(id3)/(f356)
      ccl=zcl(id3)/(f356)
      do i3=1,2
      do i4=1,2
* T -- qu=p3,qd=p356,v=cz56(i3,i4)%e,a=u3_56(i3,i4)%a,b=u3_56(i3,i4)%b,c
* =u3_56(i3,i4)%c,d=u3_56(i3,i4)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-cz56(i3,i4)%ek0*(p3(2)*p356(3)-p356(2)*p3(3))+p3k0
     & *(cz56(i3,i4)%e(2)*p356(3)-p356(2)*cz56(i3,i4)%e(3))-p356
     & k0*(cz56(i3,i4)%e(2)*p3(3)-p3(2)*cz56(i3,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz56(i3,i4)%e(3)*p3k0+p3(3)*cz56(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz56(i3,i4)%e(3)*p356k0+p356(3)*cz56(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cz56(i3,i4)%e(0)*p3(0)-cz56(i3,i4)%e(1)*p3(1)-cz56(i3
     & ,i4)%e(2)*p3(2)-cz56(i3,i4)%e(3)*p3(3)
      cvqd=cz56(i3,i4)%e(0)*p356(0)-cz56(i3,i4)%e(1)*p356(1)-cz5
     & 6(i3,i4)%e(2)*p356(2)-cz56(i3,i4)%e(3)*p356(3)
      cauxa=-cz56(i3,i4)%ek0*quqd+p3k0*cvqd+p356k0*cvqu
      cauxb=-cz56(i3,i4)%ek0*p356(2)+p356k0*cz56(i3,i4)%e(2)
      cauxc=+cz56(i3,i4)%ek0*p3(2)-p3k0*cz56(i3,i4)%e(2)
      u3_56(i3,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      u3_56(i3,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      u3_56(i3,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      u3_56(i3,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      u3_56(i3,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      u3_56(i3,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      u3_56(i3,i4)%d(1,1)=ccl*cz56(i3,i4)%ek0
      u3_56(i3,i4)%d(2,2)=ccr*cz56(i3,i4)%ek0
      end do
      end do
  
* f insertion                                                           
      ccr=fcr(id3)/(f356)
      ccl=fcl(id3)/(f356)
      do i3=1,2
      do i4=1,2
* T -- qu=p3,qd=p356,v=cf56(i3,i4)%e,a=u3_56(i3,i4)%a,b=u3_56(i3,i4)%b,c
* =u3_56(i3,i4)%c,d=u3_56(i3,i4)%d,cr=ccr,cl=ccl,nsum=1
      ceps_0=-cf56(i3,i4)%ek0*(p3(2)*p356(3)-p356(2)*p3(3))+p3k0
     & *(cf56(i3,i4)%e(2)*p356(3)-p356(2)*cf56(i3,i4)%e(3))-p356
     & k0*(cf56(i3,i4)%e(2)*p3(3)-p3(2)*cf56(i3,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cf56(i3,i4)%e(3)*p3k0+p3(3)*cf56(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cf56(i3,i4)%e(3)*p356k0+p356(3)*cf56(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cf56(i3,i4)%e(0)*p3(0)-cf56(i3,i4)%e(1)*p3(1)-cf56(i3
     & ,i4)%e(2)*p3(2)-cf56(i3,i4)%e(3)*p3(3)
      cvqd=cf56(i3,i4)%e(0)*p356(0)-cf56(i3,i4)%e(1)*p356(1)-cf5
     & 6(i3,i4)%e(2)*p356(2)-cf56(i3,i4)%e(3)*p356(3)
      cauxa=-cf56(i3,i4)%ek0*quqd+p3k0*cvqd+p356k0*cvqu
      cauxb=-cf56(i3,i4)%ek0*p356(2)+p356k0*cf56(i3,i4)%e(2)
      cauxc=+cf56(i3,i4)%ek0*p3(2)-p3k0*cf56(i3,i4)%e(2)
      u3_56(i3,i4)%a(1,1)=u3_56(i3,i4)%a(1,1)+ccr*(cauxa+ceps_0)
      u3_56(i3,i4)%a(2,2)=u3_56(i3,i4)%a(2,2)+ccl*(cauxa-ceps_0)
      u3_56(i3,i4)%b(1,2)=u3_56(i3,i4)%b(1,2)+ccl*(cauxb-ceps_2)
      u3_56(i3,i4)%b(2,1)=u3_56(i3,i4)%b(2,1)+ccr*(-cauxb-ceps_2
     & )
      u3_56(i3,i4)%c(1,2)=u3_56(i3,i4)%c(1,2)+ccr*(cauxc+ceps_1)
      u3_56(i3,i4)%c(2,1)=u3_56(i3,i4)%c(2,1)+ccl*(-cauxc+ceps_1
     & )
      u3_56(i3,i4)%d(1,1)=u3_56(i3,i4)%d(1,1)+ccl*cf56(i3,i4)%ek
     & 0
      u3_56(i3,i4)%d(2,2)=u3_56(i3,i4)%d(2,2)+ccr*cf56(i3,i4)%ek
     & 0
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id5).eq.1).and.(ibot(id3).eq.1)) then
  
      ccoupl=rhbb/(f356)
* TH -- qu=p3,qd=p356,a=clineth%a,b=clineth%b,c=clineth%c,coupl=ccoupl
      auxa=-p3k0*p356(2)+p356k0*p3(2)
      cauxa=auxa-cim*(p356(3)*p3k0-p3(3)*p356k0)
      clineth%a(1,2)=ccoupl*cauxa
      clineth%a(2,1)=-ccoupl*conjg(cauxa)
      clineth%b(1,1)=ccoupl*p356k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=ccoupl*p3k0
      clineth%c(2,2)=clineth%c(1,1)
  
         do i3=1,2
            do i4=1,2
               u3_56(i3,i4)%a(1,2)=clineth%a(1,2)*ch56(i3,i4)
               u3_56(i3,i4)%a(2,1)=clineth%a(2,1)*ch56(i3,i4)
  
               u3_56(i3,i4)%b(1,1)=clineth%b(1,1)*ch56(i3,i4)
               u3_56(i3,i4)%b(2,2)=clineth%b(2,2)*ch56(i3,i4)
  
               u3_56(i3,i4)%c(1,1)=clineth%c(1,1)*ch56(i3,i4)
               u3_56(i3,i4)%c(2,2)=clineth%c(2,2)*ch56(i3,i4)
            enddo
         enddo
  
         x3_56=.true.
      else
         x3_56=.false.
      endif ! on higgs
  
  
* DOWN PART                                                             
  
*                                                                       
*           5  6                                                        
*            \_/                                                        
*             |    | 4                                                  
*  -----------0-----                                                    
*   p564                                                                
  
      quqd=(s56-s564-rmass2(id4))/2d0
  
* z insertion                                                           
      do i3=1,2
      do i4=1,2
* T -- qu=p564,qd=p4,v=cz56(i3,i4)%e,a=d4_56(i3,i4)%a,b=d4_56(i3,i4)%b,c
* =d4_56(i3,i4)%c,d=d4_56(i3,i4)%d,cr=zcr(id4),cl=zcl(id4),nsum=0
      ceps_0=-cz56(i3,i4)%ek0*(p564(2)*p4(3)-p4(2)*p564(3))+p564
     & k0*(cz56(i3,i4)%e(2)*p4(3)-p4(2)*cz56(i3,i4)%e(3))-p4k0*(
     & cz56(i3,i4)%e(2)*p564(3)-p564(2)*cz56(i3,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz56(i3,i4)%e(3)*p564k0+p564(3)*cz56(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz56(i3,i4)%e(3)*p4k0+p4(3)*cz56(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cz56(i3,i4)%e(0)*p564(0)-cz56(i3,i4)%e(1)*p564(1)-cz5
     & 6(i3,i4)%e(2)*p564(2)-cz56(i3,i4)%e(3)*p564(3)
      cvqd=cz56(i3,i4)%e(0)*p4(0)-cz56(i3,i4)%e(1)*p4(1)-cz56(i3
     & ,i4)%e(2)*p4(2)-cz56(i3,i4)%e(3)*p4(3)
      cauxa=-cz56(i3,i4)%ek0*quqd+p564k0*cvqd+p4k0*cvqu
      cauxb=-cz56(i3,i4)%ek0*p4(2)+p4k0*cz56(i3,i4)%e(2)
      cauxc=+cz56(i3,i4)%ek0*p564(2)-p564k0*cz56(i3,i4)%e(2)
      d4_56(i3,i4)%a(1,1)=zcr(id4)*(cauxa+ceps_0)
      d4_56(i3,i4)%a(2,2)=zcl(id4)*(cauxa-ceps_0)
      d4_56(i3,i4)%b(1,2)=zcl(id4)*(cauxb-ceps_2)
      d4_56(i3,i4)%b(2,1)=zcr(id4)*(-cauxb-ceps_2)
      d4_56(i3,i4)%c(1,2)=zcr(id4)*(cauxc+ceps_1)
      d4_56(i3,i4)%c(2,1)=zcl(id4)*(-cauxc+ceps_1)
      d4_56(i3,i4)%d(1,1)=zcl(id4)*cz56(i3,i4)%ek0
      d4_56(i3,i4)%d(2,2)=zcr(id4)*cz56(i3,i4)%ek0
      end do
      end do
  
* f insertion                                                           
      do i3=1,2
      do i4=1,2
* T -- qu=p564,qd=p4,v=cf56(i3,i4)%e,a=d4_56(i3,i4)%a,b=d4_56(i3,i4)%b,c
* =d4_56(i3,i4)%c,d=d4_56(i3,i4)%d,cr=fcr(id4),cl=fcl(id4),nsum=1
      ceps_0=-cf56(i3,i4)%ek0*(p564(2)*p4(3)-p4(2)*p564(3))+p564
     & k0*(cf56(i3,i4)%e(2)*p4(3)-p4(2)*cf56(i3,i4)%e(3))-p4k0*(
     & cf56(i3,i4)%e(2)*p564(3)-p564(2)*cf56(i3,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cf56(i3,i4)%e(3)*p564k0+p564(3)*cf56(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cf56(i3,i4)%e(3)*p4k0+p4(3)*cf56(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cf56(i3,i4)%e(0)*p564(0)-cf56(i3,i4)%e(1)*p564(1)-cf5
     & 6(i3,i4)%e(2)*p564(2)-cf56(i3,i4)%e(3)*p564(3)
      cvqd=cf56(i3,i4)%e(0)*p4(0)-cf56(i3,i4)%e(1)*p4(1)-cf56(i3
     & ,i4)%e(2)*p4(2)-cf56(i3,i4)%e(3)*p4(3)
      cauxa=-cf56(i3,i4)%ek0*quqd+p564k0*cvqd+p4k0*cvqu
      cauxb=-cf56(i3,i4)%ek0*p4(2)+p4k0*cf56(i3,i4)%e(2)
      cauxc=+cf56(i3,i4)%ek0*p564(2)-p564k0*cf56(i3,i4)%e(2)
      d4_56(i3,i4)%a(1,1)=d4_56(i3,i4)%a(1,1)+fcr(id4)*(cauxa+ce
     & ps_0)
      d4_56(i3,i4)%a(2,2)=d4_56(i3,i4)%a(2,2)+fcl(id4)*(cauxa-ce
     & ps_0)
      d4_56(i3,i4)%b(1,2)=d4_56(i3,i4)%b(1,2)+fcl(id4)*(cauxb-ce
     & ps_2)
      d4_56(i3,i4)%b(2,1)=d4_56(i3,i4)%b(2,1)+fcr(id4)*(-cauxb-c
     & eps_2)
      d4_56(i3,i4)%c(1,2)=d4_56(i3,i4)%c(1,2)+fcr(id4)*(cauxc+ce
     & ps_1)
      d4_56(i3,i4)%c(2,1)=d4_56(i3,i4)%c(2,1)+fcl(id4)*(-cauxc+c
     & eps_1)
      d4_56(i3,i4)%d(1,1)=d4_56(i3,i4)%d(1,1)+fcl(id4)*cf56(i3,i
     & 4)%ek0
      d4_56(i3,i4)%d(2,2)=d4_56(i3,i4)%d(2,2)+fcr(id4)*cf56(i3,i
     & 4)%ek0
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id5).eq.1).and.(ibot(id4).eq.1)) then
* TH -- qu=p564,qd=p4,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p564k0*p4(2)+p4k0*p564(2)
      cauxa=auxa-cim*(p4(3)*p564k0-p564(3)*p4k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p4k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p564k0
      clineth%c(2,2)=clineth%c(1,1)
  
         do i3=1,2
            do i4=1,2
               d4_56(i3,i4)%a(1,2)=clineth%a(1,2)*ch56(i3,i4)
               d4_56(i3,i4)%a(2,1)=clineth%a(2,1)*ch56(i3,i4)
  
               d4_56(i3,i4)%b(1,1)=clineth%b(1,1)*ch56(i3,i4)
               d4_56(i3,i4)%b(2,2)=clineth%b(2,2)*ch56(i3,i4)
  
               d4_56(i3,i4)%c(1,1)=clineth%c(1,1)*ch56(i3,i4)
               d4_56(i3,i4)%c(2,2)=clineth%c(2,2)*ch56(i3,i4)
            enddo
         enddo
         x4_56=.true.
  
      else
         x4_56=.false.
  
      endif                     ! on higgs
*** END: insertions of gluonless forks into fermion lines               
  
  
  
* insertion of simple fork and gluon into fermion line                  
  
* compute only per quark base line                                      
      if (iquark(id3).eq.1) then
  
  
* UP PART                                                               
  
*    5 6       cz\\56, ch56                                             
*     \_/                                                               
*    | |                                                                
*  ----0------------       0 is a sum over z,f,h                        
* |          p3156                                                      
*  31                                                                   
  
      quqd=(s3156+s31-s56)/2d0
* z insertion                                                           
      ccr=zcr(id3)/(f3156)
      ccl=zcl(id3)/(f3156)
      do i3=1,2
      do i4=1,2
* T -- qu=p31,qd=p3156,v=cz56(i3,i4)%e,a=clinex_ii(i3,i4)%a,b=clinex_ii(
* i3,i4)%b,c=clinex_ii(i3,i4)%c,d=clinex_ii(i3,i4)%d,cr=ccr,cl=ccl,nsum=
* 0
      ceps_0=-cz56(i3,i4)%ek0*(p31(2)*p3156(3)-p3156(2)*p31(3))+
     & p31k0*(cz56(i3,i4)%e(2)*p3156(3)-p3156(2)*cz56(i3,i4)%e(3
     & ))-p3156k0*(cz56(i3,i4)%e(2)*p31(3)-p31(2)*cz56(i3,i4)%e(
     & 3))
      ceps_0=ceps_0*cim
      ceps_1=-cz56(i3,i4)%e(3)*p31k0+p31(3)*cz56(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz56(i3,i4)%e(3)*p3156k0+p3156(3)*cz56(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cz56(i3,i4)%e(0)*p31(0)-cz56(i3,i4)%e(1)*p31(1)-cz56(
     & i3,i4)%e(2)*p31(2)-cz56(i3,i4)%e(3)*p31(3)
      cvqd=cz56(i3,i4)%e(0)*p3156(0)-cz56(i3,i4)%e(1)*p3156(1)-c
     & z56(i3,i4)%e(2)*p3156(2)-cz56(i3,i4)%e(3)*p3156(3)
      cauxa=-cz56(i3,i4)%ek0*quqd+p31k0*cvqd+p3156k0*cvqu
      cauxb=-cz56(i3,i4)%ek0*p3156(2)+p3156k0*cz56(i3,i4)%e(2)
      cauxc=+cz56(i3,i4)%ek0*p31(2)-p31k0*cz56(i3,i4)%e(2)
      clinex_ii(i3,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      clinex_ii(i3,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      clinex_ii(i3,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      clinex_ii(i3,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      clinex_ii(i3,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      clinex_ii(i3,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      clinex_ii(i3,i4)%d(1,1)=ccl*cz56(i3,i4)%ek0
      clinex_ii(i3,i4)%d(2,2)=ccr*cz56(i3,i4)%ek0
      end do
      end do
  
* f insertion                                                           
      ccr=fcr(id3)/(f3156)
      ccl=fcl(id3)/(f3156)
      do i3=1,2
      do i4=1,2
