      d4_2_56(i1,i3,i4)%a(1,1)=d4_2_56(i1,i3,i4)%a(1,1)+clinet_i
     & (i1)%a(1,1)*d4_56(i3,i4)%a(1,1)+clinet_i(i1)%c(1,2)*s564*
     & d4_56(i3,i4)%b(2,1)
      d4_2_56(i1,i3,i4)%b(1,1)=d4_2_56(i1,i3,i4)%b(1,1)+rmass(id
     & 4)*(clinet_i(i1)%d(1,1)*d4_56(i3,i4)%a(1,1)+clinet_i(i1)%
     & b(1,2)*d4_56(i3,i4)%b(2,1))
      d4_2_56(i1,i3,i4)%c(1,1)=d4_2_56(i1,i3,i4)%c(1,1)+rmass(id
     & 4)*(clinet_i(i1)%a(1,1)*d4_56(i3,i4)%d(1,1)+clinet_i(i1)%
     & c(1,2)*d4_56(i3,i4)%c(2,1))
      d4_2_56(i1,i3,i4)%d(1,1)=d4_2_56(i1,i3,i4)%d(1,1)+clinet_i
     & (i1)%d(1,1)*s564*d4_56(i3,i4)%d(1,1)+clinet_i(i1)%b(1,2)*
     & d4_56(i3,i4)%c(2,1)
      d4_2_56(i1,i3,i4)%a(1,2)=d4_2_56(i1,i3,i4)%a(1,2)+rmass(id
     & 4)*(clinet_i(i1)%a(1,1)*d4_56(i3,i4)%b(1,2)+clinet_i(i1)%
     & c(1,2)*d4_56(i3,i4)%a(2,2))
      d4_2_56(i1,i3,i4)%b(1,2)=d4_2_56(i1,i3,i4)%b(1,2)+clinet_i
     & (i1)%d(1,1)*s564*d4_56(i3,i4)%b(1,2)+clinet_i(i1)%b(1,2)*
     & d4_56(i3,i4)%a(2,2)
      d4_2_56(i1,i3,i4)%c(1,2)=d4_2_56(i1,i3,i4)%c(1,2)+clinet_i
     & (i1)%a(1,1)*d4_56(i3,i4)%c(1,2)+clinet_i(i1)%c(1,2)*s564*
     & d4_56(i3,i4)%d(2,2)
      d4_2_56(i1,i3,i4)%d(1,2)=d4_2_56(i1,i3,i4)%d(1,2)+rmass(id
     & 4)*(clinet_i(i1)%d(1,1)*d4_56(i3,i4)%c(1,2)+clinet_i(i1)%
     & b(1,2)*d4_56(i3,i4)%d(2,2))
      d4_2_56(i1,i3,i4)%a(2,1)=d4_2_56(i1,i3,i4)%a(2,1)+rmass(id
     & 4)*(clinet_i(i1)%c(2,1)*d4_56(i3,i4)%a(1,1)+clinet_i(i1)%
     & a(2,2)*d4_56(i3,i4)%b(2,1))
      d4_2_56(i1,i3,i4)%b(2,1)=d4_2_56(i1,i3,i4)%b(2,1)+clinet_i
     & (i1)%b(2,1)*d4_56(i3,i4)%a(1,1)+clinet_i(i1)%d(2,2)*s564*
     & d4_56(i3,i4)%b(2,1)
      d4_2_56(i1,i3,i4)%c(2,1)=d4_2_56(i1,i3,i4)%c(2,1)+clinet_i
     & (i1)%c(2,1)*s564*d4_56(i3,i4)%d(1,1)+clinet_i(i1)%a(2,2)*
     & d4_56(i3,i4)%c(2,1)
      d4_2_56(i1,i3,i4)%d(2,1)=d4_2_56(i1,i3,i4)%d(2,1)+rmass(id
     & 4)*(clinet_i(i1)%b(2,1)*d4_56(i3,i4)%d(1,1)+clinet_i(i1)%
     & d(2,2)*d4_56(i3,i4)%c(2,1))
      d4_2_56(i1,i3,i4)%a(2,2)=d4_2_56(i1,i3,i4)%a(2,2)+clinet_i
     & (i1)%c(2,1)*s564*d4_56(i3,i4)%b(1,2)+clinet_i(i1)%a(2,2)*
     & d4_56(i3,i4)%a(2,2)
      d4_2_56(i1,i3,i4)%b(2,2)=d4_2_56(i1,i3,i4)%b(2,2)+rmass(id
     & 4)*(clinet_i(i1)%b(2,1)*d4_56(i3,i4)%b(1,2)+clinet_i(i1)%
     & d(2,2)*d4_56(i3,i4)%a(2,2))
      d4_2_56(i1,i3,i4)%c(2,2)=d4_2_56(i1,i3,i4)%c(2,2)+rmass(id
     & 4)*(clinet_i(i1)%c(2,1)*d4_56(i3,i4)%c(1,2)+clinet_i(i1)%
     & a(2,2)*d4_56(i3,i4)%d(2,2))
      d4_2_56(i1,i3,i4)%d(2,2)=d4_2_56(i1,i3,i4)%d(2,2)+clinet_i
     & (i1)%b(2,1)*d4_56(i3,i4)%c(1,2)+clinet_i(i1)%d(2,2)*s564*
     & d4_56(i3,i4)%d(2,2)
      end do
      end do
      end do
      endif
  
      endif ! on (iquark(id3)), compute only per quark base line
*** END: insertions of gluonless forks into fermion lines               
*** in which inserted from the outer side a gluon                       
  
  
* insertions of simple forks into fermion lines                         
  
* UP PART                                                               
  
*                                                                       
*    7  8         cz\\78, ch78                                          
*     \_/                                                               
*      |                                                                
*  ----0------------  0 is a sum over z,f,h                             
* |          p378                                                       
*  3                                                                    
  
      quqd=(s378+rmass2(id3)-s78)/2d0
  
* z insertion                                                           
      ccr=zcr(id3)/(f378)
      ccl=zcl(id3)/(f378)
      do i3=1,2
      do i4=1,2
* T -- qu=p3,qd=p378,v=cz78(i3,i4)%e,a=u3_78(i3,i4)%a,b=u3_78(i3,i4)%b,c
* =u3_78(i3,i4)%c,d=u3_78(i3,i4)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-cz78(i3,i4)%ek0*(p3(2)*p378(3)-p378(2)*p3(3))+p3k0
     & *(cz78(i3,i4)%e(2)*p378(3)-p378(2)*cz78(i3,i4)%e(3))-p378
     & k0*(cz78(i3,i4)%e(2)*p3(3)-p3(2)*cz78(i3,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz78(i3,i4)%e(3)*p3k0+p3(3)*cz78(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz78(i3,i4)%e(3)*p378k0+p378(3)*cz78(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cz78(i3,i4)%e(0)*p3(0)-cz78(i3,i4)%e(1)*p3(1)-cz78(i3
     & ,i4)%e(2)*p3(2)-cz78(i3,i4)%e(3)*p3(3)
      cvqd=cz78(i3,i4)%e(0)*p378(0)-cz78(i3,i4)%e(1)*p378(1)-cz7
     & 8(i3,i4)%e(2)*p378(2)-cz78(i3,i4)%e(3)*p378(3)
      cauxa=-cz78(i3,i4)%ek0*quqd+p3k0*cvqd+p378k0*cvqu
      cauxb=-cz78(i3,i4)%ek0*p378(2)+p378k0*cz78(i3,i4)%e(2)
      cauxc=+cz78(i3,i4)%ek0*p3(2)-p3k0*cz78(i3,i4)%e(2)
      u3_78(i3,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      u3_78(i3,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      u3_78(i3,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      u3_78(i3,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      u3_78(i3,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      u3_78(i3,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      u3_78(i3,i4)%d(1,1)=ccl*cz78(i3,i4)%ek0
      u3_78(i3,i4)%d(2,2)=ccr*cz78(i3,i4)%ek0
      end do
      end do
  
* f insertion                                                           
      ccr=fcr(id3)/(f378)
      ccl=fcl(id3)/(f378)
      do i3=1,2
      do i4=1,2
* T -- qu=p3,qd=p378,v=cf78(i3,i4)%e,a=u3_78(i3,i4)%a,b=u3_78(i3,i4)%b,c
* =u3_78(i3,i4)%c,d=u3_78(i3,i4)%d,cr=ccr,cl=ccl,nsum=1
      ceps_0=-cf78(i3,i4)%ek0*(p3(2)*p378(3)-p378(2)*p3(3))+p3k0
     & *(cf78(i3,i4)%e(2)*p378(3)-p378(2)*cf78(i3,i4)%e(3))-p378
     & k0*(cf78(i3,i4)%e(2)*p3(3)-p3(2)*cf78(i3,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cf78(i3,i4)%e(3)*p3k0+p3(3)*cf78(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cf78(i3,i4)%e(3)*p378k0+p378(3)*cf78(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cf78(i3,i4)%e(0)*p3(0)-cf78(i3,i4)%e(1)*p3(1)-cf78(i3
     & ,i4)%e(2)*p3(2)-cf78(i3,i4)%e(3)*p3(3)
      cvqd=cf78(i3,i4)%e(0)*p378(0)-cf78(i3,i4)%e(1)*p378(1)-cf7
     & 8(i3,i4)%e(2)*p378(2)-cf78(i3,i4)%e(3)*p378(3)
      cauxa=-cf78(i3,i4)%ek0*quqd+p3k0*cvqd+p378k0*cvqu
      cauxb=-cf78(i3,i4)%ek0*p378(2)+p378k0*cf78(i3,i4)%e(2)
      cauxc=+cf78(i3,i4)%ek0*p3(2)-p3k0*cf78(i3,i4)%e(2)
      u3_78(i3,i4)%a(1,1)=u3_78(i3,i4)%a(1,1)+ccr*(cauxa+ceps_0)
      u3_78(i3,i4)%a(2,2)=u3_78(i3,i4)%a(2,2)+ccl*(cauxa-ceps_0)
      u3_78(i3,i4)%b(1,2)=u3_78(i3,i4)%b(1,2)+ccl*(cauxb-ceps_2)
      u3_78(i3,i4)%b(2,1)=u3_78(i3,i4)%b(2,1)+ccr*(-cauxb-ceps_2
     & )
      u3_78(i3,i4)%c(1,2)=u3_78(i3,i4)%c(1,2)+ccr*(cauxc+ceps_1)
      u3_78(i3,i4)%c(2,1)=u3_78(i3,i4)%c(2,1)+ccl*(-cauxc+ceps_1
     & )
      u3_78(i3,i4)%d(1,1)=u3_78(i3,i4)%d(1,1)+ccl*cf78(i3,i4)%ek
     & 0
      u3_78(i3,i4)%d(2,2)=u3_78(i3,i4)%d(2,2)+ccr*cf78(i3,i4)%ek
     & 0
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id7).eq.1).and.(ibot(id3).eq.1)) then
  
      ccoupl=rhbb/(f378)
* TH -- qu=p3,qd=p378,a=clineth%a,b=clineth%b,c=clineth%c,coupl=ccoupl
      auxa=-p3k0*p378(2)+p378k0*p3(2)
      cauxa=auxa-cim*(p378(3)*p3k0-p3(3)*p378k0)
      clineth%a(1,2)=ccoupl*cauxa
      clineth%a(2,1)=-ccoupl*conjg(cauxa)
      clineth%b(1,1)=ccoupl*p378k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=ccoupl*p3k0
      clineth%c(2,2)=clineth%c(1,1)
  
         do i3=1,2
            do i4=1,2
               u3_78(i3,i4)%a(1,2)=clineth%a(1,2)*ch78(i3,i4)
               u3_78(i3,i4)%a(2,1)=clineth%a(2,1)*ch78(i3,i4)
  
               u3_78(i3,i4)%b(1,1)=clineth%b(1,1)*ch78(i3,i4)
               u3_78(i3,i4)%b(2,2)=clineth%b(2,2)*ch78(i3,i4)
  
               u3_78(i3,i4)%c(1,1)=clineth%c(1,1)*ch78(i3,i4)
               u3_78(i3,i4)%c(2,2)=clineth%c(2,2)*ch78(i3,i4)
            enddo
         enddo
  
         x3_78=.true.
      else
         x3_78=.false.
      endif ! on higgs
  
  
* DOWN PART                                                             
  
*                                                                       
*           7  8                                                        
*            \_/                                                        
*             |    | 4                                                  
*  -----------0-----                                                    
*   p784                                                                
  
      quqd=(s78-s784-rmass2(id4))/2d0
  
* z insertion                                                           
      do i3=1,2
      do i4=1,2
* T -- qu=p784,qd=p4,v=cz78(i3,i4)%e,a=d4_78(i3,i4)%a,b=d4_78(i3,i4)%b,c
* =d4_78(i3,i4)%c,d=d4_78(i3,i4)%d,cr=zcr(id4),cl=zcl(id4),nsum=0
      ceps_0=-cz78(i3,i4)%ek0*(p784(2)*p4(3)-p4(2)*p784(3))+p784
     & k0*(cz78(i3,i4)%e(2)*p4(3)-p4(2)*cz78(i3,i4)%e(3))-p4k0*(
     & cz78(i3,i4)%e(2)*p784(3)-p784(2)*cz78(i3,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz78(i3,i4)%e(3)*p784k0+p784(3)*cz78(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz78(i3,i4)%e(3)*p4k0+p4(3)*cz78(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cz78(i3,i4)%e(0)*p784(0)-cz78(i3,i4)%e(1)*p784(1)-cz7
     & 8(i3,i4)%e(2)*p784(2)-cz78(i3,i4)%e(3)*p784(3)
      cvqd=cz78(i3,i4)%e(0)*p4(0)-cz78(i3,i4)%e(1)*p4(1)-cz78(i3
     & ,i4)%e(2)*p4(2)-cz78(i3,i4)%e(3)*p4(3)
      cauxa=-cz78(i3,i4)%ek0*quqd+p784k0*cvqd+p4k0*cvqu
      cauxb=-cz78(i3,i4)%ek0*p4(2)+p4k0*cz78(i3,i4)%e(2)
      cauxc=+cz78(i3,i4)%ek0*p784(2)-p784k0*cz78(i3,i4)%e(2)
      d4_78(i3,i4)%a(1,1)=zcr(id4)*(cauxa+ceps_0)
      d4_78(i3,i4)%a(2,2)=zcl(id4)*(cauxa-ceps_0)
      d4_78(i3,i4)%b(1,2)=zcl(id4)*(cauxb-ceps_2)
      d4_78(i3,i4)%b(2,1)=zcr(id4)*(-cauxb-ceps_2)
      d4_78(i3,i4)%c(1,2)=zcr(id4)*(cauxc+ceps_1)
      d4_78(i3,i4)%c(2,1)=zcl(id4)*(-cauxc+ceps_1)
      d4_78(i3,i4)%d(1,1)=zcl(id4)*cz78(i3,i4)%ek0
      d4_78(i3,i4)%d(2,2)=zcr(id4)*cz78(i3,i4)%ek0
      end do
      end do
  
* f insertion                                                           
      do i3=1,2
      do i4=1,2
* T -- qu=p784,qd=p4,v=cf78(i3,i4)%e,a=d4_78(i3,i4)%a,b=d4_78(i3,i4)%b,c
* =d4_78(i3,i4)%c,d=d4_78(i3,i4)%d,cr=fcr(id4),cl=fcl(id4),nsum=1
      ceps_0=-cf78(i3,i4)%ek0*(p784(2)*p4(3)-p4(2)*p784(3))+p784
     & k0*(cf78(i3,i4)%e(2)*p4(3)-p4(2)*cf78(i3,i4)%e(3))-p4k0*(
     & cf78(i3,i4)%e(2)*p784(3)-p784(2)*cf78(i3,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cf78(i3,i4)%e(3)*p784k0+p784(3)*cf78(i3,i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cf78(i3,i4)%e(3)*p4k0+p4(3)*cf78(i3,i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cf78(i3,i4)%e(0)*p784(0)-cf78(i3,i4)%e(1)*p784(1)-cf7
     & 8(i3,i4)%e(2)*p784(2)-cf78(i3,i4)%e(3)*p784(3)
      cvqd=cf78(i3,i4)%e(0)*p4(0)-cf78(i3,i4)%e(1)*p4(1)-cf78(i3
     & ,i4)%e(2)*p4(2)-cf78(i3,i4)%e(3)*p4(3)
      cauxa=-cf78(i3,i4)%ek0*quqd+p784k0*cvqd+p4k0*cvqu
      cauxb=-cf78(i3,i4)%ek0*p4(2)+p4k0*cf78(i3,i4)%e(2)
      cauxc=+cf78(i3,i4)%ek0*p784(2)-p784k0*cf78(i3,i4)%e(2)
      d4_78(i3,i4)%a(1,1)=d4_78(i3,i4)%a(1,1)+fcr(id4)*(cauxa+ce
     & ps_0)
      d4_78(i3,i4)%a(2,2)=d4_78(i3,i4)%a(2,2)+fcl(id4)*(cauxa-ce
     & ps_0)
      d4_78(i3,i4)%b(1,2)=d4_78(i3,i4)%b(1,2)+fcl(id4)*(cauxb-ce
     & ps_2)
      d4_78(i3,i4)%b(2,1)=d4_78(i3,i4)%b(2,1)+fcr(id4)*(-cauxb-c
     & eps_2)
      d4_78(i3,i4)%c(1,2)=d4_78(i3,i4)%c(1,2)+fcr(id4)*(cauxc+ce
     & ps_1)
      d4_78(i3,i4)%c(2,1)=d4_78(i3,i4)%c(2,1)+fcl(id4)*(-cauxc+c
     & eps_1)
      d4_78(i3,i4)%d(1,1)=d4_78(i3,i4)%d(1,1)+fcl(id4)*cf78(i3,i
     & 4)%ek0
      d4_78(i3,i4)%d(2,2)=d4_78(i3,i4)%d(2,2)+fcr(id4)*cf78(i3,i
     & 4)%ek0
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id7).eq.1).and.(ibot(id4).eq.1)) then
* TH -- qu=p784,qd=p4,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p784k0*p4(2)+p4k0*p784(2)
      cauxa=auxa-cim*(p4(3)*p784k0-p784(3)*p4k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p4k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p784k0
      clineth%c(2,2)=clineth%c(1,1)
  
         do i3=1,2
            do i4=1,2
               d4_78(i3,i4)%a(1,2)=clineth%a(1,2)*ch78(i3,i4)
               d4_78(i3,i4)%a(2,1)=clineth%a(2,1)*ch78(i3,i4)
  
               d4_78(i3,i4)%b(1,1)=clineth%b(1,1)*ch78(i3,i4)
               d4_78(i3,i4)%b(2,2)=clineth%b(2,2)*ch78(i3,i4)
  
               d4_78(i3,i4)%c(1,1)=clineth%c(1,1)*ch78(i3,i4)
               d4_78(i3,i4)%c(2,2)=clineth%c(2,2)*ch78(i3,i4)
            enddo
         enddo
         x4_78=.true.
  
      else
         x4_78=.false.
  
      endif                     ! on higgs
*** END: insertions of gluonless forks into fermion lines               
  
  
  
* insertion of simple fork and gluon into fermion line                  
  
* compute only per quark base line                                      
      if (iquark(id3).eq.1) then
  
  
* UP PART                                                               
  
*    7 8       cz\\78, ch78                                             
*     \_/                                                               
