      cw2=d4_78(i3,i4)%c(2,jut)+rmass(id4)*d4_78(i3,i4)%d(2,jut)
      cz1=s784*d4_78(i3,i4)%d(1,jut)+rmass(id4)*d4_78(i3,i4)%c(1
     & ,jut)
      cz2=s784*d4_78(i3,i4)%d(2,jut)+rmass(id4)*d4_78(i3,i4)%c(2
     & ,jut)
      d4_2_78(i1,i3,i4)%a(1,jut)=d4_2_78(i1,i3,i4)%a(1,jut)+clin
     & et_i(i1)%a(1,1)*cx1+clinet_i(i1)%c(1,2)*cy2
      d4_2_78(i1,i3,i4)%b(1,jut)=d4_2_78(i1,i3,i4)%b(1,jut)+clin
     & et_i(i1)%d(1,1)*cy1+clinet_i(i1)%b(1,2)*cx2
      d4_2_78(i1,i3,i4)%c(1,jut)=d4_2_78(i1,i3,i4)%c(1,jut)+clin
     & et_i(i1)%a(1,1)*cw1+clinet_i(i1)%c(1,2)*cz2
      d4_2_78(i1,i3,i4)%d(1,jut)=d4_2_78(i1,i3,i4)%d(1,jut)+clin
     & et_i(i1)%d(1,1)*cz1+clinet_i(i1)%b(1,2)*cw2
      d4_2_78(i1,i3,i4)%a(2,jut)=d4_2_78(i1,i3,i4)%a(2,jut)+clin
     & et_i(i1)%c(2,1)*cy1+clinet_i(i1)%a(2,2)*cx2
      d4_2_78(i1,i3,i4)%b(2,jut)=d4_2_78(i1,i3,i4)%b(2,jut)+clin
     & et_i(i1)%b(2,1)*cx1+clinet_i(i1)%d(2,2)*cy2
      d4_2_78(i1,i3,i4)%c(2,jut)=d4_2_78(i1,i3,i4)%c(2,jut)+clin
     & et_i(i1)%c(2,1)*cz1+clinet_i(i1)%a(2,2)*cw2
      d4_2_78(i1,i3,i4)%d(2,jut)=d4_2_78(i1,i3,i4)%d(2,jut)+clin
     & et_i(i1)%b(2,1)*cw1+clinet_i(i1)%d(2,2)*cz2
      end do
      end do
      end do
      end do
      else
      do i1=1,2
      do i3=1,2
      do i4=1,2
* TT -- aa=d4_2_78(i1,i3,i4)%a,bb=d4_2_78(i1,i3,i4)%b,cc=d4_2_78(i1,i3,i
* 4)%c,dd=d4_2_78(i1,i3,i4)%d,a1=clinet_i(i1)%a,b1=clinet_i(i1)%b,c1=cli
* net_i(i1)%c,d1=clinet_i(i1)%d,a2=d4_78(i3,i4)%a,b2=d4_78(i3,i4)%b,c2=d
* 4_78(i3,i4)%c,d2=d4_78(i3,i4)%d,prq=s784,m=rmass(id4),nsum=1
      d4_2_78(i1,i3,i4)%a(1,1)=d4_2_78(i1,i3,i4)%a(1,1)+clinet_i
     & (i1)%a(1,1)*d4_78(i3,i4)%a(1,1)+clinet_i(i1)%c(1,2)*s784*
     & d4_78(i3,i4)%b(2,1)
      d4_2_78(i1,i3,i4)%b(1,1)=d4_2_78(i1,i3,i4)%b(1,1)+rmass(id
     & 4)*(clinet_i(i1)%d(1,1)*d4_78(i3,i4)%a(1,1)+clinet_i(i1)%
     & b(1,2)*d4_78(i3,i4)%b(2,1))
      d4_2_78(i1,i3,i4)%c(1,1)=d4_2_78(i1,i3,i4)%c(1,1)+rmass(id
     & 4)*(clinet_i(i1)%a(1,1)*d4_78(i3,i4)%d(1,1)+clinet_i(i1)%
     & c(1,2)*d4_78(i3,i4)%c(2,1))
      d4_2_78(i1,i3,i4)%d(1,1)=d4_2_78(i1,i3,i4)%d(1,1)+clinet_i
     & (i1)%d(1,1)*s784*d4_78(i3,i4)%d(1,1)+clinet_i(i1)%b(1,2)*
     & d4_78(i3,i4)%c(2,1)
      d4_2_78(i1,i3,i4)%a(1,2)=d4_2_78(i1,i3,i4)%a(1,2)+rmass(id
     & 4)*(clinet_i(i1)%a(1,1)*d4_78(i3,i4)%b(1,2)+clinet_i(i1)%
     & c(1,2)*d4_78(i3,i4)%a(2,2))
      d4_2_78(i1,i3,i4)%b(1,2)=d4_2_78(i1,i3,i4)%b(1,2)+clinet_i
     & (i1)%d(1,1)*s784*d4_78(i3,i4)%b(1,2)+clinet_i(i1)%b(1,2)*
     & d4_78(i3,i4)%a(2,2)
      d4_2_78(i1,i3,i4)%c(1,2)=d4_2_78(i1,i3,i4)%c(1,2)+clinet_i
     & (i1)%a(1,1)*d4_78(i3,i4)%c(1,2)+clinet_i(i1)%c(1,2)*s784*
     & d4_78(i3,i4)%d(2,2)
      d4_2_78(i1,i3,i4)%d(1,2)=d4_2_78(i1,i3,i4)%d(1,2)+rmass(id
     & 4)*(clinet_i(i1)%d(1,1)*d4_78(i3,i4)%c(1,2)+clinet_i(i1)%
     & b(1,2)*d4_78(i3,i4)%d(2,2))
      d4_2_78(i1,i3,i4)%a(2,1)=d4_2_78(i1,i3,i4)%a(2,1)+rmass(id
     & 4)*(clinet_i(i1)%c(2,1)*d4_78(i3,i4)%a(1,1)+clinet_i(i1)%
     & a(2,2)*d4_78(i3,i4)%b(2,1))
      d4_2_78(i1,i3,i4)%b(2,1)=d4_2_78(i1,i3,i4)%b(2,1)+clinet_i
     & (i1)%b(2,1)*d4_78(i3,i4)%a(1,1)+clinet_i(i1)%d(2,2)*s784*
     & d4_78(i3,i4)%b(2,1)
      d4_2_78(i1,i3,i4)%c(2,1)=d4_2_78(i1,i3,i4)%c(2,1)+clinet_i
     & (i1)%c(2,1)*s784*d4_78(i3,i4)%d(1,1)+clinet_i(i1)%a(2,2)*
     & d4_78(i3,i4)%c(2,1)
      d4_2_78(i1,i3,i4)%d(2,1)=d4_2_78(i1,i3,i4)%d(2,1)+rmass(id
     & 4)*(clinet_i(i1)%b(2,1)*d4_78(i3,i4)%d(1,1)+clinet_i(i1)%
     & d(2,2)*d4_78(i3,i4)%c(2,1))
      d4_2_78(i1,i3,i4)%a(2,2)=d4_2_78(i1,i3,i4)%a(2,2)+clinet_i
     & (i1)%c(2,1)*s784*d4_78(i3,i4)%b(1,2)+clinet_i(i1)%a(2,2)*
     & d4_78(i3,i4)%a(2,2)
      d4_2_78(i1,i3,i4)%b(2,2)=d4_2_78(i1,i3,i4)%b(2,2)+rmass(id
     & 4)*(clinet_i(i1)%b(2,1)*d4_78(i3,i4)%b(1,2)+clinet_i(i1)%
     & d(2,2)*d4_78(i3,i4)%a(2,2))
      d4_2_78(i1,i3,i4)%c(2,2)=d4_2_78(i1,i3,i4)%c(2,2)+rmass(id
     & 4)*(clinet_i(i1)%c(2,1)*d4_78(i3,i4)%c(1,2)+clinet_i(i1)%
     & a(2,2)*d4_78(i3,i4)%d(2,2))
      d4_2_78(i1,i3,i4)%d(2,2)=d4_2_78(i1,i3,i4)%d(2,2)+clinet_i
     & (i1)%b(2,1)*d4_78(i3,i4)%c(1,2)+clinet_i(i1)%d(2,2)*s784*
     & d4_78(i3,i4)%d(2,2)
      end do
      end do
      end do
      endif
  
      endif ! on (iquark(id3)), compute only per quark base line
*** END: insertions of gluonless forks into fermion lines               
*** in which inserted from the outer side a gluon                       
  
  
  
* momenta for forks with one gluon                                      
      do mu=0,3
         p134(mu)=p1(mu)+p34(mu)
         p234(mu)=p2(mu)+p34(mu)
      enddo
* p.q -- p.q=s134,p=p134,q=p134,bef=,aft=
      s134=(p134(0)*p134(0)-p134(1)*p134(1)-p134(2)*p134(2)-p134
     & (3)*p134(3))
* p.q -- p.q=s234,p=p234,q=p234,bef=,aft=
      s234=(p234(0)*p234(0)-p234(1)*p234(1)-p234(2)*p234(2)-p234
     & (3)*p234(3))
      do mu=0,3
         p156(mu)=p1(mu)+p56(mu)
         p256(mu)=p2(mu)+p56(mu)
      enddo
* p.q -- p.q=s156,p=p156,q=p156,bef=,aft=
      s156=(p156(0)*p156(0)-p156(1)*p156(1)-p156(2)*p156(2)-p156
     & (3)*p156(3))
* p.q -- p.q=s256,p=p256,q=p256,bef=,aft=
      s256=(p256(0)*p256(0)-p256(1)*p256(1)-p256(2)*p256(2)-p256
     & (3)*p256(3))
      do mu=0,3
         p178(mu)=p1(mu)+p78(mu)
         p278(mu)=p2(mu)+p78(mu)
      enddo
* p.q -- p.q=s178,p=p178,q=p178,bef=,aft=
      s178=(p178(0)*p178(0)-p178(1)*p178(1)-p178(2)*p178(2)-p178
     & (3)*p178(3))
* p.q -- p.q=s278,p=p278,q=p278,bef=,aft=
      s278=(p278(0)*p278(0)-p278(1)*p278(1)-p278(2)*p278(2)-p278
     & (3)*p278(3))
  
* compute forks ( Z's, gamma's, higgs's) with one gluon                 
  
*      Z's and gammas                                                   
      if(iquark(id3).eq.1)then
      quqd_a=(s134-s31-rmass2(id4))/2d0
      quqd_b=(rmass2(id3)+s14-s134)/2d0
      quqd=quqd_a
* T -- qu=p31,qd=p4,v=0,a=clinet_mu(0)%a,b=clinet_mu(0)%b,c=clinet_mu(0)
* %c,d=clinet_mu(0)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      eps_0=-p31(2)*p4(3)+p4(2)*p31(3)
      ceps_0=eps_0*cim
      ceps_1=p31(3)*cim
      ceps_2=p4(3)*cim
      auxa=-quqd+p31k0*p4(0)+p4k0*p31(0)
      clinet_mu(0)%a(1,1)=zcr(id3)*(auxa+ceps_0)
      clinet_mu(0)%a(2,2)=zcl(id3)*(auxa-ceps_0)
      clinet_mu(0)%b(1,2)=-zcl(id3)*(p4(2)+ceps_2)
      clinet_mu(0)%b(2,1)=zcr(id3)*(p4(2)-ceps_2)
      clinet_mu(0)%c(1,2)=zcr(id3)*(p31(2)+ceps_1)
      clinet_mu(0)%c(2,1)=zcl(id3)*(-p31(2)+ceps_1)
      clinet_mu(0)%d(1,1)=zcl(id3)
      clinet_mu(0)%d(2,2)=zcr(id3)
* T -- qu=p31,qd=p4,v=1,a=clinet_mu(1)%a,b=clinet_mu(1)%b,c=clinet_mu(1)
* %c,d=clinet_mu(1)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      auxa=-quqd+p31k0*p4(1)+p4k0*p31(1)
      clinet_mu(1)%a(1,1)=zcr(id3)*(auxa+ceps_0)
      clinet_mu(1)%a(2,2)=zcl(id3)*(auxa-ceps_0)
      clinet_mu(1)%b(1,2)=-zcl(id3)*(p4(2)+ceps_2)
      clinet_mu(1)%b(2,1)=zcr(id3)*(p4(2)-ceps_2)
      clinet_mu(1)%c(1,2)=zcr(id3)*(p31(2)+ceps_1)
      clinet_mu(1)%c(2,1)=zcl(id3)*(-p31(2)+ceps_1)
      clinet_mu(1)%d(1,1)=zcl(id3)
      clinet_mu(1)%d(2,2)=zcr(id3)
* T -- qu=p31,qd=p4,v=2,a=clinet_mu(2)%a,b=clinet_mu(2)%b,c=clinet_mu(2)
* %c,d=clinet_mu(2)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      eps_0=-p31k0*p4(3)+p4k0*p31(3)
      ceps_0=eps_0*cim
      auxa=p31k0*p4(2)+p4k0*p31(2)
      clinet_mu(2)%a(1,1)=zcr(id3)*(auxa+ceps_0)
      clinet_mu(2)%a(2,2)=zcl(id3)*(auxa-ceps_0)
      clinet_mu(2)%b(1,2)=-zcl(id3)*p4k0
      clinet_mu(2)%b(2,1)=zcr(id3)*p4k0
      clinet_mu(2)%c(1,2)=zcr(id3)*p31k0
      clinet_mu(2)%c(2,1)=-zcl(id3)*p31k0
* T -- qu=p31,qd=p4,v=3,a=clinet_mu(3)%a,b=clinet_mu(3)%b,c=clinet_mu(3)
* %c,d=clinet_mu(3)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      eps_0=p31k0*p4(2)-p4k0*p31(2)
      ceps_0=eps_0*cim
      ceps_1=p31k0*cim
      ceps_2=p4k0*cim
      auxa=+p31k0*p4(3)+p4k0*p31(3)
      clinet_mu(3)%a(1,1)=zcr(id3)*(auxa+ceps_0)
      clinet_mu(3)%a(2,2)=zcl(id3)*(auxa-ceps_0)
      clinet_mu(3)%b(1,2)=-zcl(id3)*ceps_2
      clinet_mu(3)%b(2,1)=-zcr(id3)*ceps_2
      clinet_mu(3)%c(1,2)=zcr(id3)*ceps_1
      clinet_mu(3)%c(2,1)=zcl(id3)*ceps_1
      do i=1,2
      do mu=0,3
* TT -- aa=clinets_i_mu(i,mu)%a,bb=clinets_i_mu(i,mu)%b,cc=clinets_i_mu(
* i,mu)%c,dd=clinets_i_mu(i,mu)%d,a1=u3_1(i)%a,b1=u3_1(i)%b,c1=u3_1(i)%c
* ,d1=u3_1(i)%d,a2=clinet_mu(mu)%a,b2=clinet_mu(mu)%b,c2=clinet_mu(mu)%c
* ,d2=clinet_mu(mu)%d,prq=s31,m=rmass(id3),nsum=0
      clinets_i_mu(i,mu)%a(1,1)=u3_1(i)%a(1,1)*clinet_mu(mu)%a(1
     & ,1)+u3_1(i)%c(1,2)*s31*clinet_mu(mu)%b(2,1)
      clinets_i_mu(i,mu)%b(1,1)=rmass(id3)*(u3_1(i)%d(1,1)*cline
     & t_mu(mu)%a(1,1)+u3_1(i)%b(1,2)*clinet_mu(mu)%b(2,1))
      clinets_i_mu(i,mu)%c(1,1)=rmass(id3)*(u3_1(i)%a(1,1)*cline
     & t_mu(mu)%d(1,1)+u3_1(i)%c(1,2)*clinet_mu(mu)%c(2,1))
      clinets_i_mu(i,mu)%d(1,1)=u3_1(i)%d(1,1)*s31*clinet_mu(mu)
     & %d(1,1)+u3_1(i)%b(1,2)*clinet_mu(mu)%c(2,1)
      clinets_i_mu(i,mu)%a(1,2)=rmass(id3)*(u3_1(i)%a(1,1)*cline
     & t_mu(mu)%b(1,2)+u3_1(i)%c(1,2)*clinet_mu(mu)%a(2,2))
      clinets_i_mu(i,mu)%b(1,2)=u3_1(i)%d(1,1)*s31*clinet_mu(mu)
     & %b(1,2)+u3_1(i)%b(1,2)*clinet_mu(mu)%a(2,2)
      clinets_i_mu(i,mu)%c(1,2)=u3_1(i)%a(1,1)*clinet_mu(mu)%c(1
     & ,2)+u3_1(i)%c(1,2)*s31*clinet_mu(mu)%d(2,2)
      clinets_i_mu(i,mu)%d(1,2)=rmass(id3)*(u3_1(i)%d(1,1)*cline
     & t_mu(mu)%c(1,2)+u3_1(i)%b(1,2)*clinet_mu(mu)%d(2,2))
      clinets_i_mu(i,mu)%a(2,1)=rmass(id3)*(u3_1(i)%c(2,1)*cline
     & t_mu(mu)%a(1,1)+u3_1(i)%a(2,2)*clinet_mu(mu)%b(2,1))
      clinets_i_mu(i,mu)%b(2,1)=u3_1(i)%b(2,1)*clinet_mu(mu)%a(1
     & ,1)+u3_1(i)%d(2,2)*s31*clinet_mu(mu)%b(2,1)
      clinets_i_mu(i,mu)%c(2,1)=u3_1(i)%c(2,1)*s31*clinet_mu(mu)
     & %d(1,1)+u3_1(i)%a(2,2)*clinet_mu(mu)%c(2,1)
      clinets_i_mu(i,mu)%d(2,1)=rmass(id3)*(u3_1(i)%b(2,1)*cline
     & t_mu(mu)%d(1,1)+u3_1(i)%d(2,2)*clinet_mu(mu)%c(2,1))
      clinets_i_mu(i,mu)%a(2,2)=u3_1(i)%c(2,1)*s31*clinet_mu(mu)
     & %b(1,2)+u3_1(i)%a(2,2)*clinet_mu(mu)%a(2,2)
      clinets_i_mu(i,mu)%b(2,2)=rmass(id3)*(u3_1(i)%b(2,1)*cline
     & t_mu(mu)%b(1,2)+u3_1(i)%d(2,2)*clinet_mu(mu)%a(2,2))
      clinets_i_mu(i,mu)%c(2,2)=rmass(id3)*(u3_1(i)%c(2,1)*cline
     & t_mu(mu)%c(1,2)+u3_1(i)%a(2,2)*clinet_mu(mu)%d(2,2))
      clinets_i_mu(i,mu)%d(2,2)=u3_1(i)%b(2,1)*clinet_mu(mu)%c(1
     & ,2)+u3_1(i)%d(2,2)*s31*clinet_mu(mu)%d(2,2)
      end do
      end do
  
      quqd=quqd_b
* T -- qu=p3,qd=p14,v=0,a=clinet_mu(0)%a,b=clinet_mu(0)%b,c=clinet_mu(0)
* %c,d=clinet_mu(0)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      eps_0=-p3(2)*p14(3)+p14(2)*p3(3)
      ceps_0=eps_0*cim
      ceps_1=p3(3)*cim
      ceps_2=p14(3)*cim
      auxa=-quqd+p3k0*p14(0)+p14k0*p3(0)
      clinet_mu(0)%a(1,1)=zcr(id3)*(auxa+ceps_0)
      clinet_mu(0)%a(2,2)=zcl(id3)*(auxa-ceps_0)
      clinet_mu(0)%b(1,2)=-zcl(id3)*(p14(2)+ceps_2)
      clinet_mu(0)%b(2,1)=zcr(id3)*(p14(2)-ceps_2)
      clinet_mu(0)%c(1,2)=zcr(id3)*(p3(2)+ceps_1)
      clinet_mu(0)%c(2,1)=zcl(id3)*(-p3(2)+ceps_1)
      clinet_mu(0)%d(1,1)=zcl(id3)
      clinet_mu(0)%d(2,2)=zcr(id3)
* T -- qu=p3,qd=p14,v=1,a=clinet_mu(1)%a,b=clinet_mu(1)%b,c=clinet_mu(1)
* %c,d=clinet_mu(1)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      auxa=-quqd+p3k0*p14(1)+p14k0*p3(1)
      clinet_mu(1)%a(1,1)=zcr(id3)*(auxa+ceps_0)
      clinet_mu(1)%a(2,2)=zcl(id3)*(auxa-ceps_0)
      clinet_mu(1)%b(1,2)=-zcl(id3)*(p14(2)+ceps_2)
      clinet_mu(1)%b(2,1)=zcr(id3)*(p14(2)-ceps_2)
      clinet_mu(1)%c(1,2)=zcr(id3)*(p3(2)+ceps_1)
      clinet_mu(1)%c(2,1)=zcl(id3)*(-p3(2)+ceps_1)
      clinet_mu(1)%d(1,1)=zcl(id3)
      clinet_mu(1)%d(2,2)=zcr(id3)
* T -- qu=p3,qd=p14,v=2,a=clinet_mu(2)%a,b=clinet_mu(2)%b,c=clinet_mu(2)
* %c,d=clinet_mu(2)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      eps_0=-p3k0*p14(3)+p14k0*p3(3)
