* TH -- qu=p31,qd=p4,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p31k0*p4(2)+p4k0*p31(2)
      cauxa=auxa-cim*(p4(3)*p31k0-p31(3)*p4k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p4k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p31k0
      clineth%c(2,2)=clineth%c(1,1)
      do i=1,2
* TTSC -- aa=clinets_i(i)%a,bb=clinets_i(i)%b,cc=clinets_i(i)%c,dd=cline
* ts_i(i)%d,a1=u3_1(i)%a,b1=u3_1(i)%b,c1=u3_1(i)%c,d1=u3_1(i)%d,a2=cline
* th%a,b2=clineth%b,c2=clineth%c,prq=s31,m=rmass(id3),nsum=0
      clinets_i(i)%a(1,2)=u3_1(i)%a(1,1)*clineth%a(1,2)+u3_1(i)%
     & c(1,2)*s31*clineth%b(2,2)
      clinets_i(i)%b(1,2)=rmass(id3)*(u3_1(i)%d(1,1)*clineth%a(1
     & ,2)+u3_1(i)%b(1,2)*clineth%b(2,2))
      clinets_i(i)%c(1,2)=rmass(id3)*u3_1(i)%c(1,2)*clineth%c(2,
     & 2)
      clinets_i(i)%d(1,2)=u3_1(i)%b(1,2)*clineth%c(2,2)
      clinets_i(i)%a(1,1)=rmass(id3)*(u3_1(i)%a(1,1)*clineth%b(1
     & ,1)+u3_1(i)%c(1,2)*clineth%a(2,1))
      clinets_i(i)%b(1,1)=u3_1(i)%d(1,1)*s31*clineth%b(1,1)+u3_1
     & (i)%b(1,2)*clineth%a(2,1)
      clinets_i(i)%c(1,1)=u3_1(i)%a(1,1)*clineth%c(1,1)
      clinets_i(i)%d(1,1)=rmass(id3)*u3_1(i)%d(1,1)*clineth%c(1,
     & 1)
      clinets_i(i)%a(2,2)=rmass(id3)*(u3_1(i)%c(2,1)*clineth%a(1
     & ,2)+u3_1(i)%a(2,2)*clineth%b(2,2))
      clinets_i(i)%b(2,2)=u3_1(i)%b(2,1)*clineth%a(1,2)+u3_1(i)%
     & d(2,2)*s31*clineth%b(2,2)
      clinets_i(i)%c(2,2)=u3_1(i)%a(2,2)*clineth%c(2,2)
      clinets_i(i)%d(2,2)=rmass(id3)*u3_1(i)%d(2,2)*clineth%c(2,
     & 2)
      clinets_i(i)%a(2,1)=u3_1(i)%c(2,1)*s31*clineth%b(1,1)+u3_1
     & (i)%a(2,2)*clineth%a(2,1)
      clinets_i(i)%b(2,1)=rmass(id3)*(u3_1(i)%b(2,1)*clineth%b(1
     & ,1)+u3_1(i)%d(2,2)*clineth%a(2,1))
      clinets_i(i)%c(2,1)=rmass(id3)*u3_1(i)%c(2,1)*clineth%c(1,
     & 1)
      clinets_i(i)%d(2,1)=u3_1(i)%b(2,1)*clineth%c(1,1)
      end do
  
* TH -- qu=p3,qd=p14,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p3k0*p14(2)+p14k0*p3(2)
      cauxa=auxa-cim*(p14(3)*p3k0-p3(3)*p14k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p14k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p3k0
      clineth%c(2,2)=clineth%c(1,1)
      do i=1,2
* TSCT -- aa=clinets_i(i)%a,bb=clinets_i(i)%b,cc=clinets_i(i)%c,dd=cline
* ts_i(i)%d,a1=clineth%a,b1=clineth%b,c1=clineth%c,a2=d4_1(i)%a,b2=d4_1(
* i)%b,c2=d4_1(i)%c,d2=d4_1(i)%d,prq=s14,m=rmass(id3),nsum=1
      clinets_i(i)%a(2,1)=clinets_i(i)%a(2,1)+clineth%a(2,1)*d4_
     & 1(i)%a(1,1)+clineth%c(2,2)*s14*d4_1(i)%b(2,1)
      clinets_i(i)%b(2,1)=clinets_i(i)%b(2,1)+rmass(id3)*clineth
     & %b(2,2)*d4_1(i)%b(2,1)
      clinets_i(i)%c(2,1)=clinets_i(i)%c(2,1)+rmass(id3)*(clinet
     & h%a(2,1)*d4_1(i)%d(1,1)+clineth%c(2,2)*d4_1(i)%c(2,1))
      clinets_i(i)%d(2,1)=clinets_i(i)%d(2,1)+clineth%b(2,2)*d4_
     & 1(i)%c(2,1)
      clinets_i(i)%a(2,2)=clinets_i(i)%a(2,2)+rmass(id3)*(clinet
     & h%a(2,1)*d4_1(i)%b(1,2)+clineth%c(2,2)*d4_1(i)%a(2,2))
      clinets_i(i)%b(2,2)=clinets_i(i)%b(2,2)+clineth%b(2,2)*d4_
     & 1(i)%a(2,2)
      clinets_i(i)%c(2,2)=clinets_i(i)%c(2,2)+clineth%a(2,1)*d4_
     & 1(i)%c(1,2)+clineth%c(2,2)*s14*d4_1(i)%d(2,2)
      clinets_i(i)%d(2,2)=clinets_i(i)%d(2,2)+rmass(id3)*clineth
     & %b(2,2)*d4_1(i)%d(2,2)
      clinets_i(i)%a(1,1)=clinets_i(i)%a(1,1)+rmass(id3)*(clinet
     & h%c(1,1)*d4_1(i)%a(1,1)+clineth%a(1,2)*d4_1(i)%b(2,1))
      clinets_i(i)%b(1,1)=clinets_i(i)%b(1,1)+clineth%b(1,1)*d4_
     & 1(i)%a(1,1)
      clinets_i(i)%c(1,1)=clinets_i(i)%c(1,1)+clineth%c(1,1)*s14
     & *d4_1(i)%d(1,1)+clineth%a(1,2)*d4_1(i)%c(2,1)
      clinets_i(i)%d(1,1)=clinets_i(i)%d(1,1)+rmass(id3)*clineth
     & %b(1,1)*d4_1(i)%d(1,1)
      clinets_i(i)%a(1,2)=clinets_i(i)%a(1,2)+clineth%c(1,1)*s14
     & *d4_1(i)%b(1,2)+clineth%a(1,2)*d4_1(i)%a(2,2)
      clinets_i(i)%b(1,2)=clinets_i(i)%b(1,2)+rmass(id3)*clineth
     & %b(1,1)*d4_1(i)%b(1,2)
      clinets_i(i)%c(1,2)=clinets_i(i)%c(1,2)+rmass(id3)*(clinet
     & h%c(1,1)*d4_1(i)%c(1,2)+clineth%a(1,2)*d4_1(i)%d(2,2))
      clinets_i(i)%d(1,2)=clinets_i(i)%d(1,2)+clineth%b(1,1)*d4_
     & 1(i)%c(1,2)
      end do
  
      do i=1,2
* mline -- res=ch314(&1,i,&2),abcd=clinets_i(i)%,m1=rmass(id3),m2=(-rmas
* s(id4)),den=(s134-cmh2),nsum=0
      do iut=1,2
      do jut=1,2
      ch314(iut,i,jut)=(clinets_i(i)%a(iut,jut)+rmass(id3)*cline
     & ts_i(i)%b(iut,jut)+(-rmass(id4))*clinets_i(i)%c(iut,jut)+
     & rmass(id3)*(-rmass(id4))*clinets_i(i)%d(iut,jut))/(s134-c
     & mh2)
      enddo
      enddo
      end do
* TH -- qu=p32,qd=p4,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p32k0*p4(2)+p4k0*p32(2)
      cauxa=auxa-cim*(p4(3)*p32k0-p32(3)*p4k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p4k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p32k0
      clineth%c(2,2)=clineth%c(1,1)
      do i=1,2
* TTSC -- aa=clinets_i(i)%a,bb=clinets_i(i)%b,cc=clinets_i(i)%c,dd=cline
* ts_i(i)%d,a1=u3_2(i)%a,b1=u3_2(i)%b,c1=u3_2(i)%c,d1=u3_2(i)%d,a2=cline
* th%a,b2=clineth%b,c2=clineth%c,prq=s32,m=rmass(id3),nsum=0
      clinets_i(i)%a(1,2)=u3_2(i)%a(1,1)*clineth%a(1,2)+u3_2(i)%
     & c(1,2)*s32*clineth%b(2,2)
      clinets_i(i)%b(1,2)=rmass(id3)*(u3_2(i)%d(1,1)*clineth%a(1
     & ,2)+u3_2(i)%b(1,2)*clineth%b(2,2))
      clinets_i(i)%c(1,2)=rmass(id3)*u3_2(i)%c(1,2)*clineth%c(2,
     & 2)
      clinets_i(i)%d(1,2)=u3_2(i)%b(1,2)*clineth%c(2,2)
      clinets_i(i)%a(1,1)=rmass(id3)*(u3_2(i)%a(1,1)*clineth%b(1
     & ,1)+u3_2(i)%c(1,2)*clineth%a(2,1))
      clinets_i(i)%b(1,1)=u3_2(i)%d(1,1)*s32*clineth%b(1,1)+u3_2
     & (i)%b(1,2)*clineth%a(2,1)
      clinets_i(i)%c(1,1)=u3_2(i)%a(1,1)*clineth%c(1,1)
      clinets_i(i)%d(1,1)=rmass(id3)*u3_2(i)%d(1,1)*clineth%c(1,
     & 1)
      clinets_i(i)%a(2,2)=rmass(id3)*(u3_2(i)%c(2,1)*clineth%a(1
     & ,2)+u3_2(i)%a(2,2)*clineth%b(2,2))
      clinets_i(i)%b(2,2)=u3_2(i)%b(2,1)*clineth%a(1,2)+u3_2(i)%
     & d(2,2)*s32*clineth%b(2,2)
      clinets_i(i)%c(2,2)=u3_2(i)%a(2,2)*clineth%c(2,2)
      clinets_i(i)%d(2,2)=rmass(id3)*u3_2(i)%d(2,2)*clineth%c(2,
     & 2)
      clinets_i(i)%a(2,1)=u3_2(i)%c(2,1)*s32*clineth%b(1,1)+u3_2
     & (i)%a(2,2)*clineth%a(2,1)
      clinets_i(i)%b(2,1)=rmass(id3)*(u3_2(i)%b(2,1)*clineth%b(1
     & ,1)+u3_2(i)%d(2,2)*clineth%a(2,1))
      clinets_i(i)%c(2,1)=rmass(id3)*u3_2(i)%c(2,1)*clineth%c(1,
     & 1)
      clinets_i(i)%d(2,1)=u3_2(i)%b(2,1)*clineth%c(1,1)
      end do
  
* TH -- qu=p3,qd=p24,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p3k0*p24(2)+p24k0*p3(2)
      cauxa=auxa-cim*(p24(3)*p3k0-p3(3)*p24k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p24k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p3k0
      clineth%c(2,2)=clineth%c(1,1)
      do i=1,2
* TSCT -- aa=clinets_i(i)%a,bb=clinets_i(i)%b,cc=clinets_i(i)%c,dd=cline
* ts_i(i)%d,a1=clineth%a,b1=clineth%b,c1=clineth%c,a2=d4_2(i)%a,b2=d4_2(
* i)%b,c2=d4_2(i)%c,d2=d4_2(i)%d,prq=s24,m=rmass(id3),nsum=1
      clinets_i(i)%a(2,1)=clinets_i(i)%a(2,1)+clineth%a(2,1)*d4_
     & 2(i)%a(1,1)+clineth%c(2,2)*s24*d4_2(i)%b(2,1)
      clinets_i(i)%b(2,1)=clinets_i(i)%b(2,1)+rmass(id3)*clineth
     & %b(2,2)*d4_2(i)%b(2,1)
      clinets_i(i)%c(2,1)=clinets_i(i)%c(2,1)+rmass(id3)*(clinet
     & h%a(2,1)*d4_2(i)%d(1,1)+clineth%c(2,2)*d4_2(i)%c(2,1))
      clinets_i(i)%d(2,1)=clinets_i(i)%d(2,1)+clineth%b(2,2)*d4_
     & 2(i)%c(2,1)
      clinets_i(i)%a(2,2)=clinets_i(i)%a(2,2)+rmass(id3)*(clinet
     & h%a(2,1)*d4_2(i)%b(1,2)+clineth%c(2,2)*d4_2(i)%a(2,2))
      clinets_i(i)%b(2,2)=clinets_i(i)%b(2,2)+clineth%b(2,2)*d4_
     & 2(i)%a(2,2)
      clinets_i(i)%c(2,2)=clinets_i(i)%c(2,2)+clineth%a(2,1)*d4_
     & 2(i)%c(1,2)+clineth%c(2,2)*s24*d4_2(i)%d(2,2)
      clinets_i(i)%d(2,2)=clinets_i(i)%d(2,2)+rmass(id3)*clineth
     & %b(2,2)*d4_2(i)%d(2,2)
      clinets_i(i)%a(1,1)=clinets_i(i)%a(1,1)+rmass(id3)*(clinet
     & h%c(1,1)*d4_2(i)%a(1,1)+clineth%a(1,2)*d4_2(i)%b(2,1))
      clinets_i(i)%b(1,1)=clinets_i(i)%b(1,1)+clineth%b(1,1)*d4_
     & 2(i)%a(1,1)
      clinets_i(i)%c(1,1)=clinets_i(i)%c(1,1)+clineth%c(1,1)*s24
     & *d4_2(i)%d(1,1)+clineth%a(1,2)*d4_2(i)%c(2,1)
      clinets_i(i)%d(1,1)=clinets_i(i)%d(1,1)+rmass(id3)*clineth
     & %b(1,1)*d4_2(i)%d(1,1)
      clinets_i(i)%a(1,2)=clinets_i(i)%a(1,2)+clineth%c(1,1)*s24
     & *d4_2(i)%b(1,2)+clineth%a(1,2)*d4_2(i)%a(2,2)
      clinets_i(i)%b(1,2)=clinets_i(i)%b(1,2)+rmass(id3)*clineth
     & %b(1,1)*d4_2(i)%b(1,2)
      clinets_i(i)%c(1,2)=clinets_i(i)%c(1,2)+rmass(id3)*(clinet
     & h%c(1,1)*d4_2(i)%c(1,2)+clineth%a(1,2)*d4_2(i)%d(2,2))
      clinets_i(i)%d(1,2)=clinets_i(i)%d(1,2)+clineth%b(1,1)*d4_
     & 2(i)%c(1,2)
      end do
  
      do i=1,2
* mline -- res=ch324(&1,i,&2),abcd=clinets_i(i)%,m1=rmass(id3),m2=(-rmas
* s(id4)),den=(s234-cmh2),nsum=0
      do iut=1,2
      do jut=1,2
      ch324(iut,i,jut)=(clinets_i(i)%a(iut,jut)+rmass(id3)*cline
     & ts_i(i)%b(iut,jut)+(-rmass(id4))*clinets_i(i)%c(iut,jut)+
     & rmass(id3)*(-rmass(id4))*clinets_i(i)%d(iut,jut))/(s234-c
     & mh2)
      enddo
      enddo
      end do
      endif ! on higgs computation
  
*      Z's and gammas                                                   
      if(iquark(id5).eq.1)then
      quqd_a=(s156-s51-rmass2(id6))/2d0
      quqd_b=(rmass2(id5)+s16-s156)/2d0
      quqd=quqd_a
* T -- qu=p51,qd=p6,v=0,a=clinet_mu(0)%a,b=clinet_mu(0)%b,c=clinet_mu(0)
* %c,d=clinet_mu(0)%d,cr=zcr(id5),cl=zcl(id5),nsum=0
      eps_0=-p51(2)*p6(3)+p6(2)*p51(3)
      ceps_0=eps_0*cim
      ceps_1=p51(3)*cim
      ceps_2=p6(3)*cim
      auxa=-quqd+p51k0*p6(0)+p6k0*p51(0)
      clinet_mu(0)%a(1,1)=zcr(id5)*(auxa+ceps_0)
      clinet_mu(0)%a(2,2)=zcl(id5)*(auxa-ceps_0)
      clinet_mu(0)%b(1,2)=-zcl(id5)*(p6(2)+ceps_2)
      clinet_mu(0)%b(2,1)=zcr(id5)*(p6(2)-ceps_2)
      clinet_mu(0)%c(1,2)=zcr(id5)*(p51(2)+ceps_1)
      clinet_mu(0)%c(2,1)=zcl(id5)*(-p51(2)+ceps_1)
      clinet_mu(0)%d(1,1)=zcl(id5)
      clinet_mu(0)%d(2,2)=zcr(id5)
* T -- qu=p51,qd=p6,v=1,a=clinet_mu(1)%a,b=clinet_mu(1)%b,c=clinet_mu(1)
* %c,d=clinet_mu(1)%d,cr=zcr(id5),cl=zcl(id5),nsum=0
      auxa=-quqd+p51k0*p6(1)+p6k0*p51(1)
      clinet_mu(1)%a(1,1)=zcr(id5)*(auxa+ceps_0)
      clinet_mu(1)%a(2,2)=zcl(id5)*(auxa-ceps_0)
      clinet_mu(1)%b(1,2)=-zcl(id5)*(p6(2)+ceps_2)
      clinet_mu(1)%b(2,1)=zcr(id5)*(p6(2)-ceps_2)
      clinet_mu(1)%c(1,2)=zcr(id5)*(p51(2)+ceps_1)
      clinet_mu(1)%c(2,1)=zcl(id5)*(-p51(2)+ceps_1)
      clinet_mu(1)%d(1,1)=zcl(id5)
      clinet_mu(1)%d(2,2)=zcr(id5)
* T -- qu=p51,qd=p6,v=2,a=clinet_mu(2)%a,b=clinet_mu(2)%b,c=clinet_mu(2)
* %c,d=clinet_mu(2)%d,cr=zcr(id5),cl=zcl(id5),nsum=0
      eps_0=-p51k0*p6(3)+p6k0*p51(3)
      ceps_0=eps_0*cim
      auxa=p51k0*p6(2)+p6k0*p51(2)
      clinet_mu(2)%a(1,1)=zcr(id5)*(auxa+ceps_0)
      clinet_mu(2)%a(2,2)=zcl(id5)*(auxa-ceps_0)
      clinet_mu(2)%b(1,2)=-zcl(id5)*p6k0
      clinet_mu(2)%b(2,1)=zcr(id5)*p6k0
      clinet_mu(2)%c(1,2)=zcr(id5)*p51k0
      clinet_mu(2)%c(2,1)=-zcl(id5)*p51k0
* T -- qu=p51,qd=p6,v=3,a=clinet_mu(3)%a,b=clinet_mu(3)%b,c=clinet_mu(3)
* %c,d=clinet_mu(3)%d,cr=zcr(id5),cl=zcl(id5),nsum=0
      eps_0=p51k0*p6(2)-p6k0*p51(2)
      ceps_0=eps_0*cim
      ceps_1=p51k0*cim
      ceps_2=p6k0*cim
      auxa=+p51k0*p6(3)+p6k0*p51(3)
      clinet_mu(3)%a(1,1)=zcr(id5)*(auxa+ceps_0)
      clinet_mu(3)%a(2,2)=zcl(id5)*(auxa-ceps_0)
      clinet_mu(3)%b(1,2)=-zcl(id5)*ceps_2
      clinet_mu(3)%b(2,1)=-zcr(id5)*ceps_2
      clinet_mu(3)%c(1,2)=zcr(id5)*ceps_1
      clinet_mu(3)%c(2,1)=zcl(id5)*ceps_1
      do i=1,2
      do mu=0,3
* TT -- aa=clinets_i_mu(i,mu)%a,bb=clinets_i_mu(i,mu)%b,cc=clinets_i_mu(
* i,mu)%c,dd=clinets_i_mu(i,mu)%d,a1=u5_1(i)%a,b1=u5_1(i)%b,c1=u5_1(i)%c
* ,d1=u5_1(i)%d,a2=clinet_mu(mu)%a,b2=clinet_mu(mu)%b,c2=clinet_mu(mu)%c
* ,d2=clinet_mu(mu)%d,prq=s51,m=rmass(id5),nsum=0
