* TTSC -- aa=clinets_i(i)%a,bb=clinets_i(i)%b,cc=clinets_i(i)%c,dd=cline
* ts_i(i)%d,a1=u7_2(i)%a,b1=u7_2(i)%b,c1=u7_2(i)%c,d1=u7_2(i)%d,a2=cline
* th%a,b2=clineth%b,c2=clineth%c,prq=s72,m=rmass(id7),nsum=0
      clinets_i(i)%a(1,2)=u7_2(i)%a(1,1)*clineth%a(1,2)+u7_2(i)%
     & c(1,2)*s72*clineth%b(2,2)
      clinets_i(i)%b(1,2)=rmass(id7)*(u7_2(i)%d(1,1)*clineth%a(1
     & ,2)+u7_2(i)%b(1,2)*clineth%b(2,2))
      clinets_i(i)%c(1,2)=rmass(id7)*u7_2(i)%c(1,2)*clineth%c(2,
     & 2)
      clinets_i(i)%d(1,2)=u7_2(i)%b(1,2)*clineth%c(2,2)
      clinets_i(i)%a(1,1)=rmass(id7)*(u7_2(i)%a(1,1)*clineth%b(1
     & ,1)+u7_2(i)%c(1,2)*clineth%a(2,1))
      clinets_i(i)%b(1,1)=u7_2(i)%d(1,1)*s72*clineth%b(1,1)+u7_2
     & (i)%b(1,2)*clineth%a(2,1)
      clinets_i(i)%c(1,1)=u7_2(i)%a(1,1)*clineth%c(1,1)
      clinets_i(i)%d(1,1)=rmass(id7)*u7_2(i)%d(1,1)*clineth%c(1,
     & 1)
      clinets_i(i)%a(2,2)=rmass(id7)*(u7_2(i)%c(2,1)*clineth%a(1
     & ,2)+u7_2(i)%a(2,2)*clineth%b(2,2))
      clinets_i(i)%b(2,2)=u7_2(i)%b(2,1)*clineth%a(1,2)+u7_2(i)%
     & d(2,2)*s72*clineth%b(2,2)
      clinets_i(i)%c(2,2)=u7_2(i)%a(2,2)*clineth%c(2,2)
      clinets_i(i)%d(2,2)=rmass(id7)*u7_2(i)%d(2,2)*clineth%c(2,
     & 2)
      clinets_i(i)%a(2,1)=u7_2(i)%c(2,1)*s72*clineth%b(1,1)+u7_2
     & (i)%a(2,2)*clineth%a(2,1)
      clinets_i(i)%b(2,1)=rmass(id7)*(u7_2(i)%b(2,1)*clineth%b(1
     & ,1)+u7_2(i)%d(2,2)*clineth%a(2,1))
      clinets_i(i)%c(2,1)=rmass(id7)*u7_2(i)%c(2,1)*clineth%c(1,
     & 1)
      clinets_i(i)%d(2,1)=u7_2(i)%b(2,1)*clineth%c(1,1)
      end do
  
* TH -- qu=p7,qd=p28,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p7k0*p28(2)+p28k0*p7(2)
      cauxa=auxa-cim*(p28(3)*p7k0-p7(3)*p28k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p28k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p7k0
      clineth%c(2,2)=clineth%c(1,1)
      do i=1,2
* TSCT -- aa=clinets_i(i)%a,bb=clinets_i(i)%b,cc=clinets_i(i)%c,dd=cline
* ts_i(i)%d,a1=clineth%a,b1=clineth%b,c1=clineth%c,a2=d8_2(i)%a,b2=d8_2(
* i)%b,c2=d8_2(i)%c,d2=d8_2(i)%d,prq=s28,m=rmass(id7),nsum=1
      clinets_i(i)%a(2,1)=clinets_i(i)%a(2,1)+clineth%a(2,1)*d8_
     & 2(i)%a(1,1)+clineth%c(2,2)*s28*d8_2(i)%b(2,1)
      clinets_i(i)%b(2,1)=clinets_i(i)%b(2,1)+rmass(id7)*clineth
     & %b(2,2)*d8_2(i)%b(2,1)
      clinets_i(i)%c(2,1)=clinets_i(i)%c(2,1)+rmass(id7)*(clinet
     & h%a(2,1)*d8_2(i)%d(1,1)+clineth%c(2,2)*d8_2(i)%c(2,1))
      clinets_i(i)%d(2,1)=clinets_i(i)%d(2,1)+clineth%b(2,2)*d8_
     & 2(i)%c(2,1)
      clinets_i(i)%a(2,2)=clinets_i(i)%a(2,2)+rmass(id7)*(clinet
     & h%a(2,1)*d8_2(i)%b(1,2)+clineth%c(2,2)*d8_2(i)%a(2,2))
      clinets_i(i)%b(2,2)=clinets_i(i)%b(2,2)+clineth%b(2,2)*d8_
     & 2(i)%a(2,2)
      clinets_i(i)%c(2,2)=clinets_i(i)%c(2,2)+clineth%a(2,1)*d8_
     & 2(i)%c(1,2)+clineth%c(2,2)*s28*d8_2(i)%d(2,2)
      clinets_i(i)%d(2,2)=clinets_i(i)%d(2,2)+rmass(id7)*clineth
     & %b(2,2)*d8_2(i)%d(2,2)
      clinets_i(i)%a(1,1)=clinets_i(i)%a(1,1)+rmass(id7)*(clinet
     & h%c(1,1)*d8_2(i)%a(1,1)+clineth%a(1,2)*d8_2(i)%b(2,1))
      clinets_i(i)%b(1,1)=clinets_i(i)%b(1,1)+clineth%b(1,1)*d8_
     & 2(i)%a(1,1)
      clinets_i(i)%c(1,1)=clinets_i(i)%c(1,1)+clineth%c(1,1)*s28
     & *d8_2(i)%d(1,1)+clineth%a(1,2)*d8_2(i)%c(2,1)
      clinets_i(i)%d(1,1)=clinets_i(i)%d(1,1)+rmass(id7)*clineth
     & %b(1,1)*d8_2(i)%d(1,1)
      clinets_i(i)%a(1,2)=clinets_i(i)%a(1,2)+clineth%c(1,1)*s28
     & *d8_2(i)%b(1,2)+clineth%a(1,2)*d8_2(i)%a(2,2)
      clinets_i(i)%b(1,2)=clinets_i(i)%b(1,2)+rmass(id7)*clineth
     & %b(1,1)*d8_2(i)%b(1,2)
      clinets_i(i)%c(1,2)=clinets_i(i)%c(1,2)+rmass(id7)*(clinet
     & h%c(1,1)*d8_2(i)%c(1,2)+clineth%a(1,2)*d8_2(i)%d(2,2))
      clinets_i(i)%d(1,2)=clinets_i(i)%d(1,2)+clineth%b(1,1)*d8_
     & 2(i)%c(1,2)
      end do
  
      do i=1,2
* mline -- res=ch728(&1,i,&2),abcd=clinets_i(i)%,m1=rmass(id7),m2=(-rmas
* s(id8)),den=(s278-cmh2),nsum=0
      do iut=1,2
      do jut=1,2
      ch728(iut,i,jut)=(clinets_i(i)%a(iut,jut)+rmass(id7)*cline
     & ts_i(i)%b(iut,jut)+(-rmass(id8))*clinets_i(i)%c(iut,jut)+
     & rmass(id7)*(-rmass(id8))*clinets_i(i)%d(iut,jut))/(s278-c
     & mh2)
      enddo
      enddo
      end do
      endif ! on higgs computation
  
  
* This dotab corresponds to the loop over the base line (7\8\)(as a     
* base line can be taken any of 3 fermion lines),then to the loop       
* over the first inserted line (3\4\)(as a such line can be taken       
* any of the two fermion lines other than the base one).                
* As the  second inserted line (if there are two insertions)            
* the remaining line (5\6\) is the only option.                         
* The number of permutations is 3*2*1=6                                 
* In this way the insertions of given type are covered                  
* for all required combinations of inserted and base lines.             
  
  
* insertions of forks with one gluon into fermion lines                 
  
* gluons are involved, compute only per quark forks                     
      if (iquark(id3).eq.1) then
  
* UP PART                                                               
  
*    314       cz\\314, ch314                                           
*     \|/                                                               
*      o       o is a sum over 2 gluon positions                        
*      |                                                                
*  ----0------------       0 is a sum over z,f,h                        
* |          p7134                                                      
*  7                                                                    
  
      quqd=(s7134-s134+rmass2(id7))/2d0
  
* z insertion                                                           
      ccr=zcr(id7)/(f7134)
      ccl=zcl(id7)/(f7134)
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p7,qd=p7134,v=cz314(i3,i1,i4)%e,a=u7_314(i3,i1,i4)%a,b=u7_314(
* i3,i1,i4)%b,c=u7_314(i3,i1,i4)%c,d=u7_314(i3,i1,i4)%d,cr=ccr,cl=ccl,ns
* um=0
      ceps_0=-cz314(i3,i1,i4)%ek0*(p7(2)*p7134(3)-p7134(2)*p7(3)
     & )+p7k0*(cz314(i3,i1,i4)%e(2)*p7134(3)-p7134(2)*cz314(i3,i
     & 1,i4)%e(3))-p7134k0*(cz314(i3,i1,i4)%e(2)*p7(3)-p7(2)*cz3
     & 14(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz314(i3,i1,i4)%e(3)*p7k0+p7(3)*cz314(i3,i1,i4)%ek
     & 0
      ceps_1=ceps_1*cim
      ceps_2=-cz314(i3,i1,i4)%e(3)*p7134k0+p7134(3)*cz314(i3,i1,
     & i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cz314(i3,i1,i4)%e(0)*p7(0)-cz314(i3,i1,i4)%e(1)*p7(1)
     & -cz314(i3,i1,i4)%e(2)*p7(2)-cz314(i3,i1,i4)%e(3)*p7(3)
      cvqd=cz314(i3,i1,i4)%e(0)*p7134(0)-cz314(i3,i1,i4)%e(1)*p7
     & 134(1)-cz314(i3,i1,i4)%e(2)*p7134(2)-cz314(i3,i1,i4)%e(3)
     & *p7134(3)
      cauxa=-cz314(i3,i1,i4)%ek0*quqd+p7k0*cvqd+p7134k0*cvqu
      cauxb=-cz314(i3,i1,i4)%ek0*p7134(2)+p7134k0*cz314(i3,i1,i4
     & )%e(2)
      cauxc=+cz314(i3,i1,i4)%ek0*p7(2)-p7k0*cz314(i3,i1,i4)%e(2)
      u7_314(i3,i1,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      u7_314(i3,i1,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      u7_314(i3,i1,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      u7_314(i3,i1,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      u7_314(i3,i1,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      u7_314(i3,i1,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      u7_314(i3,i1,i4)%d(1,1)=ccl*cz314(i3,i1,i4)%ek0
      u7_314(i3,i1,i4)%d(2,2)=ccr*cz314(i3,i1,i4)%ek0
      end do
      end do
      end do
  
* f insertion                                                           
      ccr=fcr(id7)/(f7134)
      ccl=fcl(id7)/(f7134)
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p7,qd=p7134,v=cf314(i3,i1,i4)%e,a=u7_314(i3,i1,i4)%a,b=u7_314(
* i3,i1,i4)%b,c=u7_314(i3,i1,i4)%c,d=u7_314(i3,i1,i4)%d,cr=ccr,cl=ccl,ns
* um=1
      ceps_0=-cf314(i3,i1,i4)%ek0*(p7(2)*p7134(3)-p7134(2)*p7(3)
     & )+p7k0*(cf314(i3,i1,i4)%e(2)*p7134(3)-p7134(2)*cf314(i3,i
     & 1,i4)%e(3))-p7134k0*(cf314(i3,i1,i4)%e(2)*p7(3)-p7(2)*cf3
     & 14(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cf314(i3,i1,i4)%e(3)*p7k0+p7(3)*cf314(i3,i1,i4)%ek
     & 0
      ceps_1=ceps_1*cim
      ceps_2=-cf314(i3,i1,i4)%e(3)*p7134k0+p7134(3)*cf314(i3,i1,
     & i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cf314(i3,i1,i4)%e(0)*p7(0)-cf314(i3,i1,i4)%e(1)*p7(1)
     & -cf314(i3,i1,i4)%e(2)*p7(2)-cf314(i3,i1,i4)%e(3)*p7(3)
      cvqd=cf314(i3,i1,i4)%e(0)*p7134(0)-cf314(i3,i1,i4)%e(1)*p7
     & 134(1)-cf314(i3,i1,i4)%e(2)*p7134(2)-cf314(i3,i1,i4)%e(3)
     & *p7134(3)
      cauxa=-cf314(i3,i1,i4)%ek0*quqd+p7k0*cvqd+p7134k0*cvqu
      cauxb=-cf314(i3,i1,i4)%ek0*p7134(2)+p7134k0*cf314(i3,i1,i4
     & )%e(2)
      cauxc=+cf314(i3,i1,i4)%ek0*p7(2)-p7k0*cf314(i3,i1,i4)%e(2)
      u7_314(i3,i1,i4)%a(1,1)=u7_314(i3,i1,i4)%a(1,1)+ccr*(cauxa
     & +ceps_0)
      u7_314(i3,i1,i4)%a(2,2)=u7_314(i3,i1,i4)%a(2,2)+ccl*(cauxa
     & -ceps_0)
      u7_314(i3,i1,i4)%b(1,2)=u7_314(i3,i1,i4)%b(1,2)+ccl*(cauxb
     & -ceps_2)
      u7_314(i3,i1,i4)%b(2,1)=u7_314(i3,i1,i4)%b(2,1)+ccr*(-caux
     & b-ceps_2)
      u7_314(i3,i1,i4)%c(1,2)=u7_314(i3,i1,i4)%c(1,2)+ccr*(cauxc
     & +ceps_1)
      u7_314(i3,i1,i4)%c(2,1)=u7_314(i3,i1,i4)%c(2,1)+ccl*(-caux
     & c+ceps_1)
      u7_314(i3,i1,i4)%d(1,1)=u7_314(i3,i1,i4)%d(1,1)+ccl*cf314(
     & i3,i1,i4)%ek0
      u7_314(i3,i1,i4)%d(2,2)=u7_314(i3,i1,i4)%d(2,2)+ccr*cf314(
     & i3,i1,i4)%ek0
      end do
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id3).eq.1).and.(ibot(id7).eq.1)) then
      ccoupl=rhbb/(f7134)
* TH -- qu=p7,qd=p7134,a=clineth%a,b=clineth%b,c=clineth%c,coupl=ccoupl
      auxa=-p7k0*p7134(2)+p7134k0*p7(2)
      cauxa=auxa-cim*(p7134(3)*p7k0-p7(3)*p7134k0)
      clineth%a(1,2)=ccoupl*cauxa
      clineth%a(2,1)=-ccoupl*conjg(cauxa)
      clineth%b(1,1)=ccoupl*p7134k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=ccoupl*p7k0
      clineth%c(2,2)=clineth%c(1,1)
  
      do i3=1,2
      do i1=1,2
      do i4=1,2
         u7_314(i3,i1,i4)%a(1,2)=clineth%a(1,2)*ch314(i3,i1,i4)
         u7_314(i3,i1,i4)%a(2,1)=clineth%a(2,1)*ch314(i3,i1,i4)
  
         u7_314(i3,i1,i4)%b(1,1)=clineth%b(1,1)*ch314(i3,i1,i4)
         u7_314(i3,i1,i4)%b(2,2)=clineth%b(2,2)*ch314(i3,i1,i4)
  
         u7_314(i3,i1,i4)%c(1,1)=clineth%c(1,1)*ch314(i3,i1,i4)
         u7_314(i3,i1,i4)%c(2,2)=clineth%c(2,2)*ch314(i3,i1,i4)
      enddo
      enddo
      enddo
      x7_314=.true.
  
      else
      x7_314=.false.
  
      endif ! on higgs
  
* DOWN PART                                                             
  
*           314                                                         
*            \|/                                                        
*             o                                                         
*             |    | 8                                                  
*  -----------o-----                                                    
*   p1348=p7256                                                         
  
      quqd=(s134-s7256-rmass2(id8))/2d0
* z insertion                                                           
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p7256,qd=p8,v=cz314(i3,i1,i4)%e,a=d8_314(i3,i1,i4)%a,b=d8_314(
* i3,i1,i4)%b,c=d8_314(i3,i1,i4)%c,d=d8_314(i3,i1,i4)%d,cr=zcr(id8),cl=z
* cl(id8),nsum=0
      ceps_0=-cz314(i3,i1,i4)%ek0*(p7256(2)*p8(3)-p8(2)*p7256(3)
     & )+p7256k0*(cz314(i3,i1,i4)%e(2)*p8(3)-p8(2)*cz314(i3,i1,i
     & 4)%e(3))-p8k0*(cz314(i3,i1,i4)%e(2)*p7256(3)-p7256(2)*cz3
     & 14(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz314(i3,i1,i4)%e(3)*p7256k0+p7256(3)*cz314(i3,i1,
     & i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz314(i3,i1,i4)%e(3)*p8k0+p8(3)*cz314(i3,i1,i4)%ek
     & 0
      ceps_2=ceps_2*cim
      cvqu=cz314(i3,i1,i4)%e(0)*p7256(0)-cz314(i3,i1,i4)%e(1)*p7
     & 256(1)-cz314(i3,i1,i4)%e(2)*p7256(2)-cz314(i3,i1,i4)%e(3)
     & *p7256(3)
      cvqd=cz314(i3,i1,i4)%e(0)*p8(0)-cz314(i3,i1,i4)%e(1)*p8(1)
     & -cz314(i3,i1,i4)%e(2)*p8(2)-cz314(i3,i1,i4)%e(3)*p8(3)
      cauxa=-cz314(i3,i1,i4)%ek0*quqd+p7256k0*cvqd+p8k0*cvqu
      cauxb=-cz314(i3,i1,i4)%ek0*p8(2)+p8k0*cz314(i3,i1,i4)%e(2)
      cauxc=+cz314(i3,i1,i4)%ek0*p7256(2)-p7256k0*cz314(i3,i1,i4
     & )%e(2)
      d8_314(i3,i1,i4)%a(1,1)=zcr(id8)*(cauxa+ceps_0)
      d8_314(i3,i1,i4)%a(2,2)=zcl(id8)*(cauxa-ceps_0)
      d8_314(i3,i1,i4)%b(1,2)=zcl(id8)*(cauxb-ceps_2)
      d8_314(i3,i1,i4)%b(2,1)=zcr(id8)*(-cauxb-ceps_2)
      d8_314(i3,i1,i4)%c(1,2)=zcr(id8)*(cauxc+ceps_1)
      d8_314(i3,i1,i4)%c(2,1)=zcl(id8)*(-cauxc+ceps_1)
      d8_314(i3,i1,i4)%d(1,1)=zcl(id8)*cz314(i3,i1,i4)%ek0
      d8_314(i3,i1,i4)%d(2,2)=zcr(id8)*cz314(i3,i1,i4)%ek0
      end do
      end do
      end do
  
* f insertion                                                           
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p7256,qd=p8,v=cf314(i3,i1,i4)%e,a=d8_314(i3,i1,i4)%a,b=d8_314(
* i3,i1,i4)%b,c=d8_314(i3,i1,i4)%c,d=d8_314(i3,i1,i4)%d,cr=fcr(id8),cl=f
* cl(id8),nsum=1
      ceps_0=-cf314(i3,i1,i4)%ek0*(p7256(2)*p8(3)-p8(2)*p7256(3)
     & )+p7256k0*(cf314(i3,i1,i4)%e(2)*p8(3)-p8(2)*cf314(i3,i1,i
     & 4)%e(3))-p8k0*(cf314(i3,i1,i4)%e(2)*p7256(3)-p7256(2)*cf3
     & 14(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cf314(i3,i1,i4)%e(3)*p7256k0+p7256(3)*cf314(i3,i1,
     & i4)%ek0
      ceps_1=ceps_1*cim
