      quqd=(s756+s28-s134)/2d0
* z insertion                                                           
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p756,qd=p28,v=cz314(i3,i1,i4)%e,a=clinex_iii(i3,i1,i4)%a,b=cli
* nex_iii(i3,i1,i4)%b,c=clinex_iii(i3,i1,i4)%c,d=clinex_iii(i3,i1,i4)%d,
