      ceps_0=-cz314(i3,i1,i4)%ek0*(p756(2)*p28(3)-p28(2)*p756(3)
     & )+p756k0*(cz314(i3,i1,i4)%e(2)*p28(3)-p28(2)*cz314(i3,i1,
     & i4)%e(3))-p28k0*(cz314(i3,i1,i4)%e(2)*p756(3)-p756(2)*cz3
     & 14(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz314(i3,i1,i4)%e(3)*p756k0+p756(3)*cz314(i3,i1,i4
     & )%ek0
