      ceps_2=-cz314(i3,i1,i4)%e(3)*p28k0+p28(3)*cz314(i3,i1,i4)%
     & ek0
      ceps_2=ceps_2*cim
      cvqu=cz314(i3,i1,i4)%e(0)*p756(0)-cz314(i3,i1,i4)%e(1)*p75
     & 6(1)-cz314(i3,i1,i4)%e(2)*p756(2)-cz314(i3,i1,i4)%e(3)*p7
     & 56(3)
      cvqd=cz314(i3,i1,i4)%e(0)*p28(0)-cz314(i3,i1,i4)%e(1)*p28(
     & 1)-cz314(i3,i1,i4)%e(2)*p28(2)-cz314(i3,i1,i4)%e(3)*p28(3
     & )
      cauxa=-cz314(i3,i1,i4)%ek0*quqd+p756k0*cvqd+p28k0*cvqu
      cauxb=-cz314(i3,i1,i4)%ek0*p28(2)+p28k0*cz314(i3,i1,i4)%e(
     & 2)
      cauxc=+cz314(i3,i1,i4)%ek0*p756(2)-p756k0*cz314(i3,i1,i4)%
     & e(2)
      clinex_iii(i3,i1,i4)%a(1,1)=zcr(id8)*(cauxa+ceps_0)
