         d8_526(i3,i1,i4)%a(1,2)=clineth%a(1,2)*ch526(i3,i1,i4)
         d8_526(i3,i1,i4)%a(2,1)=clineth%a(2,1)*ch526(i3,i1,i4)
  
         d8_526(i3,i1,i4)%b(1,1)=clineth%b(1,1)*ch526(i3,i1,i4)
         d8_526(i3,i1,i4)%b(2,2)=clineth%b(2,2)*ch526(i3,i1,i4)
  
         d8_526(i3,i1,i4)%c(1,1)=clineth%c(1,1)*ch526(i3,i1,i4)
         d8_526(i3,i1,i4)%c(2,2)=clineth%c(2,2)*ch526(i3,i1,i4)
      enddo
      enddo
      enddo
      x8_526=.true.
  
      else
