*** END: insertions of forks with one gluon into fermion lines          
  
  
* insertions of forks with one gluon into fermion lines                 
* in which inserted from the outer side the other gluon                 
  
* gluons are involved, compute only per (quark base line AND            
* quark fork)                                                           
      if ((iquark(id7).eq.1).and.(iquark(id5).eq.1)) then
  
  
* UP PART                                                               
  
*    516       cz\\516, ch516                                           
*     \|/                                                               
*      o       o is a sum over 2 gluon positions                        
*    | |                                                                
*  ----0------------       0 is a sum over z,f,h                        
* |          p348                                                       
*  72                                                                   
  
      quqd=(s348+s72-s156)/2d0
* z insertion                                                           
      ccr=zcr(id7)/(f348)
      ccl=zcl(id7)/(f348)
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p72,qd=p348,v=cz516(i3,i1,i4)%e,a=clinex_iii(i3,i1,i4)%a,b=cli
* nex_iii(i3,i1,i4)%b,c=clinex_iii(i3,i1,i4)%c,d=clinex_iii(i3,i1,i4)%d,
* cr=ccr,cl=ccl,nsum=0
      ceps_0=-cz516(i3,i1,i4)%ek0*(p72(2)*p348(3)-p348(2)*p72(3)
     & )+p72k0*(cz516(i3,i1,i4)%e(2)*p348(3)-p348(2)*cz516(i3,i1
     & ,i4)%e(3))-p348k0*(cz516(i3,i1,i4)%e(2)*p72(3)-p72(2)*cz5
     & 16(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz516(i3,i1,i4)%e(3)*p72k0+p72(3)*cz516(i3,i1,i4)%
     & ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz516(i3,i1,i4)%e(3)*p348k0+p348(3)*cz516(i3,i1,i4
     & )%ek0
      ceps_2=ceps_2*cim
      cvqu=cz516(i3,i1,i4)%e(0)*p72(0)-cz516(i3,i1,i4)%e(1)*p72(
     & 1)-cz516(i3,i1,i4)%e(2)*p72(2)-cz516(i3,i1,i4)%e(3)*p72(3
     & )
      cvqd=cz516(i3,i1,i4)%e(0)*p348(0)-cz516(i3,i1,i4)%e(1)*p34
     & 8(1)-cz516(i3,i1,i4)%e(2)*p348(2)-cz516(i3,i1,i4)%e(3)*p3
     & 48(3)
      cauxa=-cz516(i3,i1,i4)%ek0*quqd+p72k0*cvqd+p348k0*cvqu
      cauxb=-cz516(i3,i1,i4)%ek0*p348(2)+p348k0*cz516(i3,i1,i4)%
     & e(2)
      cauxc=+cz516(i3,i1,i4)%ek0*p72(2)-p72k0*cz516(i3,i1,i4)%e(
     & 2)
      clinex_iii(i3,i1,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      clinex_iii(i3,i1,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      clinex_iii(i3,i1,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%d(1,1)=ccl*cz516(i3,i1,i4)%ek0
      clinex_iii(i3,i1,i4)%d(2,2)=ccr*cz516(i3,i1,i4)%ek0
      end do
      end do
      end do
  
* f insertion                                                           
      ccr=fcr(id7)/(f348)
      ccl=fcl(id7)/(f348)
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p72,qd=p348,v=cf516(i3,i1,i4)%e,a=clinex_iii(i3,i1,i4)%a,b=cli
* nex_iii(i3,i1,i4)%b,c=clinex_iii(i3,i1,i4)%c,d=clinex_iii(i3,i1,i4)%d,
* cr=ccr,cl=ccl,nsum=1
      ceps_0=-cf516(i3,i1,i4)%ek0*(p72(2)*p348(3)-p348(2)*p72(3)
     & )+p72k0*(cf516(i3,i1,i4)%e(2)*p348(3)-p348(2)*cf516(i3,i1
     & ,i4)%e(3))-p348k0*(cf516(i3,i1,i4)%e(2)*p72(3)-p72(2)*cf5
     & 16(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cf516(i3,i1,i4)%e(3)*p72k0+p72(3)*cf516(i3,i1,i4)%
     & ek0
      ceps_1=ceps_1*cim
      ceps_2=-cf516(i3,i1,i4)%e(3)*p348k0+p348(3)*cf516(i3,i1,i4
     & )%ek0
      ceps_2=ceps_2*cim
      cvqu=cf516(i3,i1,i4)%e(0)*p72(0)-cf516(i3,i1,i4)%e(1)*p72(
     & 1)-cf516(i3,i1,i4)%e(2)*p72(2)-cf516(i3,i1,i4)%e(3)*p72(3
     & )
      cvqd=cf516(i3,i1,i4)%e(0)*p348(0)-cf516(i3,i1,i4)%e(1)*p34
     & 8(1)-cf516(i3,i1,i4)%e(2)*p348(2)-cf516(i3,i1,i4)%e(3)*p3
     & 48(3)
      cauxa=-cf516(i3,i1,i4)%ek0*quqd+p72k0*cvqd+p348k0*cvqu
      cauxb=-cf516(i3,i1,i4)%ek0*p348(2)+p348k0*cf516(i3,i1,i4)%
     & e(2)
      cauxc=+cf516(i3,i1,i4)%ek0*p72(2)-p72k0*cf516(i3,i1,i4)%e(
     & 2)
      clinex_iii(i3,i1,i4)%a(1,1)=clinex_iii(i3,i1,i4)%a(1,1)+cc
     & r*(cauxa+ceps_0)
      clinex_iii(i3,i1,i4)%a(2,2)=clinex_iii(i3,i1,i4)%a(2,2)+cc
     & l*(cauxa-ceps_0)
      clinex_iii(i3,i1,i4)%b(1,2)=clinex_iii(i3,i1,i4)%b(1,2)+cc
     & l*(cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%b(2,1)=clinex_iii(i3,i1,i4)%b(2,1)+cc
     & r*(-cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%c(1,2)=clinex_iii(i3,i1,i4)%c(1,2)+cc
     & r*(cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%c(2,1)=clinex_iii(i3,i1,i4)%c(2,1)+cc
     & l*(-cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%d(1,1)=clinex_iii(i3,i1,i4)%d(1,1)+cc
     & l*cf516(i3,i1,i4)%ek0
      clinex_iii(i3,i1,i4)%d(2,2)=clinex_iii(i3,i1,i4)%d(2,2)+cc
     & r*cf516(i3,i1,i4)%ek0
      end do
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id5).eq.1).and.(ibot(id7).eq.1)) then
      ccoupl=rhbb/(f348)
* TH -- qu=p72,qd=p348,a=clineth%a,b=clineth%b,c=clineth%c,coupl=ccoupl
      auxa=-p72k0*p348(2)+p348k0*p72(2)
      cauxa=auxa-cim*(p348(3)*p72k0-p72(3)*p348k0)
      clineth%a(1,2)=ccoupl*cauxa
      clineth%a(2,1)=-ccoupl*conjg(cauxa)
      clineth%b(1,1)=ccoupl*p348k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=ccoupl*p72k0
      clineth%c(2,2)=clineth%c(1,1)
  
      do i3=1,2
      do i1=1,2
      do i4=1,2
         clinex_iii(i3,i1,i4)%a(1,2)=clineth%a(1,2)*ch516(i3,i1,i4)
         clinex_iii(i3,i1,i4)%a(2,1)=clineth%a(2,1)*ch516(i3,i1,i4)
  
         clinex_iii(i3,i1,i4)%b(1,1)=clineth%b(1,1)*ch516(i3,i1,i4)
         clinex_iii(i3,i1,i4)%b(2,2)=clineth%b(2,2)*ch516(i3,i1,i4)
  
         clinex_iii(i3,i1,i4)%c(1,1)=clineth%c(1,1)*ch516(i3,i1,i4)
         clinex_iii(i3,i1,i4)%c(2,2)=clineth%c(2,2)*ch516(i3,i1,i4)
      enddo
      enddo
      enddo
      x_iii=.true.
      else
      x_iii=.false.
  
