      cx2=clinex_iii(i3,i1,i4)%a(2,jut)+rmass(id7)*clinex_iii(i3
     & ,i1,i4)%b(2,jut)
      cy1=s72*clinex_iii(i3,i1,i4)%b(1,jut)+rmass(id7)*clinex_ii
     & i(i3,i1,i4)%a(1,jut)
      cy2=s72*clinex_iii(i3,i1,i4)%b(2,jut)+rmass(id7)*clinex_ii
     & i(i3,i1,i4)%a(2,jut)
      cw1=clinex_iii(i3,i1,i4)%c(1,jut)+rmass(id7)*clinex_iii(i3
     & ,i1,i4)%d(1,jut)
      cw2=clinex_iii(i3,i1,i4)%c(2,jut)+rmass(id7)*clinex_iii(i3
     & ,i1,i4)%d(2,jut)
      cz1=s72*clinex_iii(i3,i1,i4)%d(1,jut)+rmass(id7)*clinex_ii
     & i(i3,i1,i4)%c(1,jut)
      cz2=s72*clinex_iii(i3,i1,i4)%d(2,jut)+rmass(id7)*clinex_ii
     & i(i3,i1,i4)%c(2,jut)
      u72_516(i2,i3,i1,i4)%a(1,jut)=u7_2(i2)%a(1,1)*cx1+u7_2(i2)
     & %c(1,2)*cy2
      u72_516(i2,i3,i1,i4)%b(1,jut)=u7_2(i2)%d(1,1)*cy1+u7_2(i2)
     & %b(1,2)*cx2
      u72_516(i2,i3,i1,i4)%c(1,jut)=u7_2(i2)%a(1,1)*cw1+u7_2(i2)
     & %c(1,2)*cz2
      u72_516(i2,i3,i1,i4)%d(1,jut)=u7_2(i2)%d(1,1)*cz1+u7_2(i2)
     & %b(1,2)*cw2
      u72_516(i2,i3,i1,i4)%a(2,jut)=u7_2(i2)%c(2,1)*cy1+u7_2(i2)
     & %a(2,2)*cx2
      u72_516(i2,i3,i1,i4)%b(2,jut)=u7_2(i2)%b(2,1)*cx1+u7_2(i2)
     & %d(2,2)*cy2
      u72_516(i2,i3,i1,i4)%c(2,jut)=u7_2(i2)%c(2,1)*cz1+u7_2(i2)
     & %a(2,2)*cw2
      u72_516(i2,i3,i1,i4)%d(2,jut)=u7_2(i2)%b(2,1)*cw1+u7_2(i2)
     & %d(2,2)*cz2
      end do
      end do
      end do
      end do
      end do
      else
