* 2,i3,i1,i4)%c,dd=u72_516(i2,i3,i1,i4)%d,a1=u7_2(i2)%a,b1=u7_2(i2)%b,c1
* =u7_2(i2)%c,d1=u7_2(i2)%d,a2=clinex_iii(i3,i1,i4)%a,b2=clinex_iii(i3,i
* 1,i4)%b,c2=clinex_iii(i3,i1,i4)%c,d2=clinex_iii(i3,i1,i4)%d,prq=s72,m=
* rmass(id7),nsum=0
      u72_516(i2,i3,i1,i4)%a(1,1)=u7_2(i2)%a(1,1)*clinex_iii(i3,
