      u72_516(i2,i3,i1,i4)%b(1,2)=u7_2(i2)%d(1,1)*s72*clinex_iii
     & (i3,i1,i4)%b(1,2)+u7_2(i2)%b(1,2)*clinex_iii(i3,i1,i4)%a(
