     & 2,1)
      u72_516(i2,i3,i1,i4)%d(2,1)=rmass(id7)*(u7_2(i2)%b(2,1)*cl
     & inex_iii(i3,i1,i4)%d(1,1)+u7_2(i2)%d(2,2)*clinex_iii(i3,i
     & 1,i4)%c(2,1))
      u72_516(i2,i3,i1,i4)%a(2,2)=u7_2(i2)%c(2,1)*s72*clinex_iii
