      u72_516(i2,i3,i1,i4)%b(2,2)=rmass(id7)*(u7_2(i2)%b(2,1)*cl
     & inex_iii(i3,i1,i4)%b(1,2)+u7_2(i2)%d(2,2)*clinex_iii(i3,i
