      cvqd=cz516(i3,i1,i4)%e(0)*p28(0)-cz516(i3,i1,i4)%e(1)*p28(
     & 1)-cz516(i3,i1,i4)%e(2)*p28(2)-cz516(i3,i1,i4)%e(3)*p28(3
