      if (iquark(id3).eq.1) then
  
* UP PART                                                               
  
*    314       cz\\314, ch314                                           
*     \|/                                                               
*      o       o is a sum over 2 gluon positions                        
*      |                                                                
*  ----0------------       0 is a sum over z,f,h                        
* |          p5134                                                      
*  5                                                                    
  
      quqd=(s5134-s134+rmass2(id5))/2d0
  
* z insertion                                                           
      ccr=zcr(id5)/(f5134)
      ccl=zcl(id5)/(f5134)
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p5,qd=p5134,v=cz314(i3,i1,i4)%e,a=u5_314(i3,i1,i4)%a,b=u5_314(
* i3,i1,i4)%b,c=u5_314(i3,i1,i4)%c,d=u5_314(i3,i1,i4)%d,cr=ccr,cl=ccl,ns
* um=0
      ceps_0=-cz314(i3,i1,i4)%ek0*(p5(2)*p5134(3)-p5134(2)*p5(3)
     & )+p5k0*(cz314(i3,i1,i4)%e(2)*p5134(3)-p5134(2)*cz314(i3,i
     & 1,i4)%e(3))-p5134k0*(cz314(i3,i1,i4)%e(2)*p5(3)-p5(2)*cz3
     & 14(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz314(i3,i1,i4)%e(3)*p5k0+p5(3)*cz314(i3,i1,i4)%ek
     & 0
      ceps_1=ceps_1*cim
      ceps_2=-cz314(i3,i1,i4)%e(3)*p5134k0+p5134(3)*cz314(i3,i1,
     & i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cz314(i3,i1,i4)%e(0)*p5(0)-cz314(i3,i1,i4)%e(1)*p5(1)
     & -cz314(i3,i1,i4)%e(2)*p5(2)-cz314(i3,i1,i4)%e(3)*p5(3)
      cvqd=cz314(i3,i1,i4)%e(0)*p5134(0)-cz314(i3,i1,i4)%e(1)*p5
     & 134(1)-cz314(i3,i1,i4)%e(2)*p5134(2)-cz314(i3,i1,i4)%e(3)
     & *p5134(3)
      cauxa=-cz314(i3,i1,i4)%ek0*quqd+p5k0*cvqd+p5134k0*cvqu
      cauxb=-cz314(i3,i1,i4)%ek0*p5134(2)+p5134k0*cz314(i3,i1,i4
     & )%e(2)
      cauxc=+cz314(i3,i1,i4)%ek0*p5(2)-p5k0*cz314(i3,i1,i4)%e(2)
      u5_314(i3,i1,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      u5_314(i3,i1,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      u5_314(i3,i1,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      u5_314(i3,i1,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      u5_314(i3,i1,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      u5_314(i3,i1,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      u5_314(i3,i1,i4)%d(1,1)=ccl*cz314(i3,i1,i4)%ek0
      u5_314(i3,i1,i4)%d(2,2)=ccr*cz314(i3,i1,i4)%ek0
      end do
      end do
      end do
  
* f insertion                                                           
      ccr=fcr(id5)/(f5134)
      ccl=fcl(id5)/(f5134)
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p5,qd=p5134,v=cf314(i3,i1,i4)%e,a=u5_314(i3,i1,i4)%a,b=u5_314(
* i3,i1,i4)%b,c=u5_314(i3,i1,i4)%c,d=u5_314(i3,i1,i4)%d,cr=ccr,cl=ccl,ns
* um=1
      ceps_0=-cf314(i3,i1,i4)%ek0*(p5(2)*p5134(3)-p5134(2)*p5(3)
     & )+p5k0*(cf314(i3,i1,i4)%e(2)*p5134(3)-p5134(2)*cf314(i3,i
     & 1,i4)%e(3))-p5134k0*(cf314(i3,i1,i4)%e(2)*p5(3)-p5(2)*cf3
     & 14(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cf314(i3,i1,i4)%e(3)*p5k0+p5(3)*cf314(i3,i1,i4)%ek
     & 0
      ceps_1=ceps_1*cim
      ceps_2=-cf314(i3,i1,i4)%e(3)*p5134k0+p5134(3)*cf314(i3,i1,
     & i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cf314(i3,i1,i4)%e(0)*p5(0)-cf314(i3,i1,i4)%e(1)*p5(1)
     & -cf314(i3,i1,i4)%e(2)*p5(2)-cf314(i3,i1,i4)%e(3)*p5(3)
      cvqd=cf314(i3,i1,i4)%e(0)*p5134(0)-cf314(i3,i1,i4)%e(1)*p5
     & 134(1)-cf314(i3,i1,i4)%e(2)*p5134(2)-cf314(i3,i1,i4)%e(3)
     & *p5134(3)
      cauxa=-cf314(i3,i1,i4)%ek0*quqd+p5k0*cvqd+p5134k0*cvqu
      cauxb=-cf314(i3,i1,i4)%ek0*p5134(2)+p5134k0*cf314(i3,i1,i4
     & )%e(2)
      cauxc=+cf314(i3,i1,i4)%ek0*p5(2)-p5k0*cf314(i3,i1,i4)%e(2)
      u5_314(i3,i1,i4)%a(1,1)=u5_314(i3,i1,i4)%a(1,1)+ccr*(cauxa
     & +ceps_0)
      u5_314(i3,i1,i4)%a(2,2)=u5_314(i3,i1,i4)%a(2,2)+ccl*(cauxa
     & -ceps_0)
      u5_314(i3,i1,i4)%b(1,2)=u5_314(i3,i1,i4)%b(1,2)+ccl*(cauxb
     & -ceps_2)
      u5_314(i3,i1,i4)%b(2,1)=u5_314(i3,i1,i4)%b(2,1)+ccr*(-caux
     & b-ceps_2)
      u5_314(i3,i1,i4)%c(1,2)=u5_314(i3,i1,i4)%c(1,2)+ccr*(cauxc
     & +ceps_1)
      u5_314(i3,i1,i4)%c(2,1)=u5_314(i3,i1,i4)%c(2,1)+ccl*(-caux
     & c+ceps_1)
      u5_314(i3,i1,i4)%d(1,1)=u5_314(i3,i1,i4)%d(1,1)+ccl*cf314(
     & i3,i1,i4)%ek0
      u5_314(i3,i1,i4)%d(2,2)=u5_314(i3,i1,i4)%d(2,2)+ccr*cf314(
     & i3,i1,i4)%ek0
      end do
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id3).eq.1).and.(ibot(id5).eq.1)) then
      ccoupl=rhbb/(f5134)
* TH -- qu=p5,qd=p5134,a=clineth%a,b=clineth%b,c=clineth%c,coupl=ccoupl
      auxa=-p5k0*p5134(2)+p5134k0*p5(2)
      cauxa=auxa-cim*(p5134(3)*p5k0-p5(3)*p5134k0)
      clineth%a(1,2)=ccoupl*cauxa
      clineth%a(2,1)=-ccoupl*conjg(cauxa)
      clineth%b(1,1)=ccoupl*p5134k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=ccoupl*p5k0
      clineth%c(2,2)=clineth%c(1,1)
  
      do i3=1,2
      do i1=1,2
      do i4=1,2
         u5_314(i3,i1,i4)%a(1,2)=clineth%a(1,2)*ch314(i3,i1,i4)
         u5_314(i3,i1,i4)%a(2,1)=clineth%a(2,1)*ch314(i3,i1,i4)
  
         u5_314(i3,i1,i4)%b(1,1)=clineth%b(1,1)*ch314(i3,i1,i4)
         u5_314(i3,i1,i4)%b(2,2)=clineth%b(2,2)*ch314(i3,i1,i4)
  
         u5_314(i3,i1,i4)%c(1,1)=clineth%c(1,1)*ch314(i3,i1,i4)
         u5_314(i3,i1,i4)%c(2,2)=clineth%c(2,2)*ch314(i3,i1,i4)
      enddo
      enddo
      enddo
      x5_314=.true.
  
      else
      x5_314=.false.
  
      endif ! on higgs
  
