     & 14(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz314(i3,i1,i4)%e(3)*p5278k0+p5278(3)*cz314(i3,i1,
     & i4)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz314(i3,i1,i4)%e(3)*p6k0+p6(3)*cz314(i3,i1,i4)%ek
     & 0
      ceps_2=ceps_2*cim
      cvqu=cz314(i3,i1,i4)%e(0)*p5278(0)-cz314(i3,i1,i4)%e(1)*p5
     & 278(1)-cz314(i3,i1,i4)%e(2)*p5278(2)-cz314(i3,i1,i4)%e(3)
     & *p5278(3)
      cvqd=cz314(i3,i1,i4)%e(0)*p6(0)-cz314(i3,i1,i4)%e(1)*p6(1)
     & -cz314(i3,i1,i4)%e(2)*p6(2)-cz314(i3,i1,i4)%e(3)*p6(3)
      cauxa=-cz314(i3,i1,i4)%ek0*quqd+p5278k0*cvqd+p6k0*cvqu
      cauxb=-cz314(i3,i1,i4)%ek0*p6(2)+p6k0*cz314(i3,i1,i4)%e(2)
      cauxc=+cz314(i3,i1,i4)%ek0*p5278(2)-p5278k0*cz314(i3,i1,i4
     & )%e(2)
      d6_314(i3,i1,i4)%a(1,1)=zcr(id6)*(cauxa+ceps_0)
      d6_314(i3,i1,i4)%a(2,2)=zcl(id6)*(cauxa-ceps_0)
      d6_314(i3,i1,i4)%b(1,2)=zcl(id6)*(cauxb-ceps_2)
      d6_314(i3,i1,i4)%b(2,1)=zcr(id6)*(-cauxb-ceps_2)
      d6_314(i3,i1,i4)%c(1,2)=zcr(id6)*(cauxc+ceps_1)
      d6_314(i3,i1,i4)%c(2,1)=zcl(id6)*(-cauxc+ceps_1)
      d6_314(i3,i1,i4)%d(1,1)=zcl(id6)*cz314(i3,i1,i4)%ek0
