* TH -- qu=p5178,qd=p6,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p5178k0*p6(2)+p6k0*p5178(2)
      cauxa=auxa-cim*(p6(3)*p5178k0-p5178(3)*p6k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p6k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p5178k0
      clineth%c(2,2)=clineth%c(1,1)
  
      do i3=1,2
      do i1=1,2
      do i4=1,2
         d6_324(i3,i1,i4)%a(1,2)=clineth%a(1,2)*ch324(i3,i1,i4)
         d6_324(i3,i1,i4)%a(2,1)=clineth%a(2,1)*ch324(i3,i1,i4)
  
         d6_324(i3,i1,i4)%b(1,1)=clineth%b(1,1)*ch324(i3,i1,i4)
         d6_324(i3,i1,i4)%b(2,2)=clineth%b(2,2)*ch324(i3,i1,i4)
  
         d6_324(i3,i1,i4)%c(1,1)=clineth%c(1,1)*ch324(i3,i1,i4)
         d6_324(i3,i1,i4)%c(2,2)=clineth%c(2,2)*ch324(i3,i1,i4)
      enddo
      enddo
      enddo
      x6_324=.true.
  
      else
      x6_324=.false.
  
      endif ! on higgs
  
