*** END: insertions of forks with one gluon into fermion lines          
  
  
* insertions of forks with one gluon into fermion lines                 
* in which inserted from the outer side the other gluon                 
  
* gluons are involved, compute only per (quark base line AND            
* quark fork)                                                           
      if ((iquark(id5).eq.1).and.(iquark(id3).eq.1)) then
  
  
* UP PART                                                               
  
*    314       cz\\314, ch314                                           
*     \|/                                                               
*      o       o is a sum over 2 gluon positions                        
*    | |                                                                
*  ----0------------       0 is a sum over z,f,h                        
* |          p786                                                       
*  52                                                                   
  
      quqd=(s786+s52-s134)/2d0
* z insertion                                                           
      ccr=zcr(id5)/(f786)
      ccl=zcl(id5)/(f786)
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p52,qd=p786,v=cz314(i3,i1,i4)%e,a=clinex_iii(i3,i1,i4)%a,b=cli
* nex_iii(i3,i1,i4)%b,c=clinex_iii(i3,i1,i4)%c,d=clinex_iii(i3,i1,i4)%d,
* cr=ccr,cl=ccl,nsum=0
      ceps_0=-cz314(i3,i1,i4)%ek0*(p52(2)*p786(3)-p786(2)*p52(3)
     & )+p52k0*(cz314(i3,i1,i4)%e(2)*p786(3)-p786(2)*cz314(i3,i1
     & ,i4)%e(3))-p786k0*(cz314(i3,i1,i4)%e(2)*p52(3)-p52(2)*cz3
     & 14(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz314(i3,i1,i4)%e(3)*p52k0+p52(3)*cz314(i3,i1,i4)%
     & ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz314(i3,i1,i4)%e(3)*p786k0+p786(3)*cz314(i3,i1,i4
     & )%ek0
      ceps_2=ceps_2*cim
      cvqu=cz314(i3,i1,i4)%e(0)*p52(0)-cz314(i3,i1,i4)%e(1)*p52(
     & 1)-cz314(i3,i1,i4)%e(2)*p52(2)-cz314(i3,i1,i4)%e(3)*p52(3
     & )
      cvqd=cz314(i3,i1,i4)%e(0)*p786(0)-cz314(i3,i1,i4)%e(1)*p78
     & 6(1)-cz314(i3,i1,i4)%e(2)*p786(2)-cz314(i3,i1,i4)%e(3)*p7
     & 86(3)
      cauxa=-cz314(i3,i1,i4)%ek0*quqd+p52k0*cvqd+p786k0*cvqu
      cauxb=-cz314(i3,i1,i4)%ek0*p786(2)+p786k0*cz314(i3,i1,i4)%
     & e(2)
      cauxc=+cz314(i3,i1,i4)%ek0*p52(2)-p52k0*cz314(i3,i1,i4)%e(
     & 2)
      clinex_iii(i3,i1,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      clinex_iii(i3,i1,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      clinex_iii(i3,i1,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%d(1,1)=ccl*cz314(i3,i1,i4)%ek0
      clinex_iii(i3,i1,i4)%d(2,2)=ccr*cz314(i3,i1,i4)%ek0
      end do
      end do
      end do
  
* f insertion                                                           
      ccr=fcr(id5)/(f786)
      ccl=fcl(id5)/(f786)
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p52,qd=p786,v=cf314(i3,i1,i4)%e,a=clinex_iii(i3,i1,i4)%a,b=cli
* nex_iii(i3,i1,i4)%b,c=clinex_iii(i3,i1,i4)%c,d=clinex_iii(i3,i1,i4)%d,
* cr=ccr,cl=ccl,nsum=1
      ceps_0=-cf314(i3,i1,i4)%ek0*(p52(2)*p786(3)-p786(2)*p52(3)
     & )+p52k0*(cf314(i3,i1,i4)%e(2)*p786(3)-p786(2)*cf314(i3,i1
     & ,i4)%e(3))-p786k0*(cf314(i3,i1,i4)%e(2)*p52(3)-p52(2)*cf3
     & 14(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cf314(i3,i1,i4)%e(3)*p52k0+p52(3)*cf314(i3,i1,i4)%
     & ek0
      ceps_1=ceps_1*cim
      ceps_2=-cf314(i3,i1,i4)%e(3)*p786k0+p786(3)*cf314(i3,i1,i4
     & )%ek0
      ceps_2=ceps_2*cim
      cvqu=cf314(i3,i1,i4)%e(0)*p52(0)-cf314(i3,i1,i4)%e(1)*p52(
     & 1)-cf314(i3,i1,i4)%e(2)*p52(2)-cf314(i3,i1,i4)%e(3)*p52(3
     & )
      cvqd=cf314(i3,i1,i4)%e(0)*p786(0)-cf314(i3,i1,i4)%e(1)*p78
     & 6(1)-cf314(i3,i1,i4)%e(2)*p786(2)-cf314(i3,i1,i4)%e(3)*p7
     & 86(3)
      cauxa=-cf314(i3,i1,i4)%ek0*quqd+p52k0*cvqd+p786k0*cvqu
      cauxb=-cf314(i3,i1,i4)%ek0*p786(2)+p786k0*cf314(i3,i1,i4)%
     & e(2)
      cauxc=+cf314(i3,i1,i4)%ek0*p52(2)-p52k0*cf314(i3,i1,i4)%e(
     & 2)
      clinex_iii(i3,i1,i4)%a(1,1)=clinex_iii(i3,i1,i4)%a(1,1)+cc
     & r*(cauxa+ceps_0)
      clinex_iii(i3,i1,i4)%a(2,2)=clinex_iii(i3,i1,i4)%a(2,2)+cc
     & l*(cauxa-ceps_0)
      clinex_iii(i3,i1,i4)%b(1,2)=clinex_iii(i3,i1,i4)%b(1,2)+cc
     & l*(cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%b(2,1)=clinex_iii(i3,i1,i4)%b(2,1)+cc
     & r*(-cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%c(1,2)=clinex_iii(i3,i1,i4)%c(1,2)+cc
     & r*(cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%c(2,1)=clinex_iii(i3,i1,i4)%c(2,1)+cc
     & l*(-cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%d(1,1)=clinex_iii(i3,i1,i4)%d(1,1)+cc
     & l*cf314(i3,i1,i4)%ek0
      clinex_iii(i3,i1,i4)%d(2,2)=clinex_iii(i3,i1,i4)%d(2,2)+cc
     & r*cf314(i3,i1,i4)%ek0
      end do
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id3).eq.1).and.(ibot(id5).eq.1)) then
      ccoupl=rhbb/(f786)
* TH -- qu=p52,qd=p786,a=clineth%a,b=clineth%b,c=clineth%c,coupl=ccoupl
      auxa=-p52k0*p786(2)+p786k0*p52(2)
      cauxa=auxa-cim*(p786(3)*p52k0-p52(3)*p786k0)
      clineth%a(1,2)=ccoupl*cauxa
      clineth%a(2,1)=-ccoupl*conjg(cauxa)
      clineth%b(1,1)=ccoupl*p786k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=ccoupl*p52k0
      clineth%c(2,2)=clineth%c(1,1)
  
      do i3=1,2
      do i1=1,2
      do i4=1,2
         clinex_iii(i3,i1,i4)%a(1,2)=clineth%a(1,2)*ch314(i3,i1,i4)
         clinex_iii(i3,i1,i4)%a(2,1)=clineth%a(2,1)*ch314(i3,i1,i4)
  
         clinex_iii(i3,i1,i4)%b(1,1)=clineth%b(1,1)*ch314(i3,i1,i4)
         clinex_iii(i3,i1,i4)%b(2,2)=clineth%b(2,2)*ch314(i3,i1,i4)
  
         clinex_iii(i3,i1,i4)%c(1,1)=clineth%c(1,1)*ch314(i3,i1,i4)
         clinex_iii(i3,i1,i4)%c(2,2)=clineth%c(2,2)*ch314(i3,i1,i4)
      enddo
      enddo
      enddo
      x_iii=.true.
      else
      x_iii=.false.
  
      endif ! on higgs
  
* merge u5_2 with clinex_iii                                            
      if (x_iii) then
      do i2=1,2
      do i3=1,2
      do i1=1,2
      do i4=1,2
* TTs -- aa=u52_314(i2,i3,i1,i4)%a,bb=u52_314(i2,i3,i1,i4)%b,cc=u52_314(
* i2,i3,i1,i4)%c,dd=u52_314(i2,i3,i1,i4)%d,a1=u5_2(i2)%a,b1=u5_2(i2)%b,c
* 1=u5_2(i2)%c,d1=u5_2(i2)%d,a2=clinex_iii(i3,i1,i4)%a,b2=clinex_iii(i3,
* i1,i4)%b,c2=clinex_iii(i3,i1,i4)%c,d2=clinex_iii(i3,i1,i4)%d,prq=s52,m
* =rmass(id5),nsum=0
      do jut=1,2
      cx1=clinex_iii(i3,i1,i4)%a(1,jut)+rmass(id5)*clinex_iii(i3
     & ,i1,i4)%b(1,jut)
      cx2=clinex_iii(i3,i1,i4)%a(2,jut)+rmass(id5)*clinex_iii(i3
     & ,i1,i4)%b(2,jut)
      cy1=s52*clinex_iii(i3,i1,i4)%b(1,jut)+rmass(id5)*clinex_ii
     & i(i3,i1,i4)%a(1,jut)
      cy2=s52*clinex_iii(i3,i1,i4)%b(2,jut)+rmass(id5)*clinex_ii
     & i(i3,i1,i4)%a(2,jut)
      cw1=clinex_iii(i3,i1,i4)%c(1,jut)+rmass(id5)*clinex_iii(i3
     & ,i1,i4)%d(1,jut)
      cw2=clinex_iii(i3,i1,i4)%c(2,jut)+rmass(id5)*clinex_iii(i3
     & ,i1,i4)%d(2,jut)
      cz1=s52*clinex_iii(i3,i1,i4)%d(1,jut)+rmass(id5)*clinex_ii
     & i(i3,i1,i4)%c(1,jut)
      cz2=s52*clinex_iii(i3,i1,i4)%d(2,jut)+rmass(id5)*clinex_ii
     & i(i3,i1,i4)%c(2,jut)
      u52_314(i2,i3,i1,i4)%a(1,jut)=u5_2(i2)%a(1,1)*cx1+u5_2(i2)
     & %c(1,2)*cy2
      u52_314(i2,i3,i1,i4)%b(1,jut)=u5_2(i2)%d(1,1)*cy1+u5_2(i2)
     & %b(1,2)*cx2
      u52_314(i2,i3,i1,i4)%c(1,jut)=u5_2(i2)%a(1,1)*cw1+u5_2(i2)
     & %c(1,2)*cz2
      u52_314(i2,i3,i1,i4)%d(1,jut)=u5_2(i2)%d(1,1)*cz1+u5_2(i2)
     & %b(1,2)*cw2
      u52_314(i2,i3,i1,i4)%a(2,jut)=u5_2(i2)%c(2,1)*cy1+u5_2(i2)
     & %a(2,2)*cx2
      u52_314(i2,i3,i1,i4)%b(2,jut)=u5_2(i2)%b(2,1)*cx1+u5_2(i2)
     & %d(2,2)*cy2
      u52_314(i2,i3,i1,i4)%c(2,jut)=u5_2(i2)%c(2,1)*cz1+u5_2(i2)
     & %a(2,2)*cw2
      u52_314(i2,i3,i1,i4)%d(2,jut)=u5_2(i2)%b(2,1)*cw1+u5_2(i2)
     & %d(2,2)*cz2
      end do
      end do
      end do
      end do
      end do
      else
      do i2=1,2
      do i3=1,2
      do i1=1,2
      do i4=1,2
* TT -- aa=u52_314(i2,i3,i1,i4)%a,bb=u52_314(i2,i3,i1,i4)%b,cc=u52_314(i
* 2,i3,i1,i4)%c,dd=u52_314(i2,i3,i1,i4)%d,a1=u5_2(i2)%a,b1=u5_2(i2)%b,c1
* =u5_2(i2)%c,d1=u5_2(i2)%d,a2=clinex_iii(i3,i1,i4)%a,b2=clinex_iii(i3,i
* 1,i4)%b,c2=clinex_iii(i3,i1,i4)%c,d2=clinex_iii(i3,i1,i4)%d,prq=s52,m=
* rmass(id5),nsum=0
      u52_314(i2,i3,i1,i4)%a(1,1)=u5_2(i2)%a(1,1)*clinex_iii(i3,
     & i1,i4)%a(1,1)+u5_2(i2)%c(1,2)*s52*clinex_iii(i3,i1,i4)%b(
     & 2,1)
      u52_314(i2,i3,i1,i4)%b(1,1)=rmass(id5)*(u5_2(i2)%d(1,1)*cl
     & inex_iii(i3,i1,i4)%a(1,1)+u5_2(i2)%b(1,2)*clinex_iii(i3,i
     & 1,i4)%b(2,1))
      u52_314(i2,i3,i1,i4)%c(1,1)=rmass(id5)*(u5_2(i2)%a(1,1)*cl
     & inex_iii(i3,i1,i4)%d(1,1)+u5_2(i2)%c(1,2)*clinex_iii(i3,i
     & 1,i4)%c(2,1))
      u52_314(i2,i3,i1,i4)%d(1,1)=u5_2(i2)%d(1,1)*s52*clinex_iii
     & (i3,i1,i4)%d(1,1)+u5_2(i2)%b(1,2)*clinex_iii(i3,i1,i4)%c(
     & 2,1)
      u52_314(i2,i3,i1,i4)%a(1,2)=rmass(id5)*(u5_2(i2)%a(1,1)*cl
     & inex_iii(i3,i1,i4)%b(1,2)+u5_2(i2)%c(1,2)*clinex_iii(i3,i
     & 1,i4)%a(2,2))
      u52_314(i2,i3,i1,i4)%b(1,2)=u5_2(i2)%d(1,1)*s52*clinex_iii
     & (i3,i1,i4)%b(1,2)+u5_2(i2)%b(1,2)*clinex_iii(i3,i1,i4)%a(
     & 2,2)
      u52_314(i2,i3,i1,i4)%c(1,2)=u5_2(i2)%a(1,1)*clinex_iii(i3,
     & i1,i4)%c(1,2)+u5_2(i2)%c(1,2)*s52*clinex_iii(i3,i1,i4)%d(
     & 2,2)
      u52_314(i2,i3,i1,i4)%d(1,2)=rmass(id5)*(u5_2(i2)%d(1,1)*cl
     & inex_iii(i3,i1,i4)%c(1,2)+u5_2(i2)%b(1,2)*clinex_iii(i3,i
     & 1,i4)%d(2,2))
      u52_314(i2,i3,i1,i4)%a(2,1)=rmass(id5)*(u5_2(i2)%c(2,1)*cl
     & inex_iii(i3,i1,i4)%a(1,1)+u5_2(i2)%a(2,2)*clinex_iii(i3,i
     & 1,i4)%b(2,1))
      u52_314(i2,i3,i1,i4)%b(2,1)=u5_2(i2)%b(2,1)*clinex_iii(i3,
     & i1,i4)%a(1,1)+u5_2(i2)%d(2,2)*s52*clinex_iii(i3,i1,i4)%b(
     & 2,1)
      u52_314(i2,i3,i1,i4)%c(2,1)=u5_2(i2)%c(2,1)*s52*clinex_iii
     & (i3,i1,i4)%d(1,1)+u5_2(i2)%a(2,2)*clinex_iii(i3,i1,i4)%c(
     & 2,1)
      u52_314(i2,i3,i1,i4)%d(2,1)=rmass(id5)*(u5_2(i2)%b(2,1)*cl
     & inex_iii(i3,i1,i4)%d(1,1)+u5_2(i2)%d(2,2)*clinex_iii(i3,i
     & 1,i4)%c(2,1))
      u52_314(i2,i3,i1,i4)%a(2,2)=u5_2(i2)%c(2,1)*s52*clinex_iii
     & (i3,i1,i4)%b(1,2)+u5_2(i2)%a(2,2)*clinex_iii(i3,i1,i4)%a(
     & 2,2)
      u52_314(i2,i3,i1,i4)%b(2,2)=rmass(id5)*(u5_2(i2)%b(2,1)*cl
     & inex_iii(i3,i1,i4)%b(1,2)+u5_2(i2)%d(2,2)*clinex_iii(i3,i
     & 1,i4)%a(2,2))
      u52_314(i2,i3,i1,i4)%c(2,2)=rmass(id5)*(u5_2(i2)%c(2,1)*cl
     & inex_iii(i3,i1,i4)%c(1,2)+u5_2(i2)%a(2,2)*clinex_iii(i3,i
     & 1,i4)%d(2,2))
      u52_314(i2,i3,i1,i4)%d(2,2)=u5_2(i2)%b(2,1)*clinex_iii(i3,
     & i1,i4)%c(1,2)+u5_2(i2)%d(2,2)*s52*clinex_iii(i3,i1,i4)%d(
     & 2,2)
      end do
      end do
      end do
      end do
      endif
  
* DOWN PART                                                             
  
*           314                                                         
*            \|/                                                        
*             o                                                         
*             |  |  | 26                                                
*  -----------0-----                                                    
*   p578                                                                
  
      quqd=(s578+s26-s134)/2d0
* z insertion                                                           
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p578,qd=p26,v=cz314(i3,i1,i4)%e,a=clinex_iii(i3,i1,i4)%a,b=cli
* nex_iii(i3,i1,i4)%b,c=clinex_iii(i3,i1,i4)%c,d=clinex_iii(i3,i1,i4)%d,
* cr=zcr(id6),cl=zcl(id6),nsum=0
      ceps_0=-cz314(i3,i1,i4)%ek0*(p578(2)*p26(3)-p26(2)*p578(3)
     & )+p578k0*(cz314(i3,i1,i4)%e(2)*p26(3)-p26(2)*cz314(i3,i1,
     & i4)%e(3))-p26k0*(cz314(i3,i1,i4)%e(2)*p578(3)-p578(2)*cz3
     & 14(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz314(i3,i1,i4)%e(3)*p578k0+p578(3)*cz314(i3,i1,i4
     & )%ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz314(i3,i1,i4)%e(3)*p26k0+p26(3)*cz314(i3,i1,i4)%
