      d6_728(i3,i1,i4)%c(2,1)=d6_728(i3,i1,i4)%c(2,1)+fcl(id6)*(
     & -cauxc+ceps_1)
      d6_728(i3,i1,i4)%d(1,1)=d6_728(i3,i1,i4)%d(1,1)+fcl(id6)*c
     & f728(i3,i1,i4)%ek0
      d6_728(i3,i1,i4)%d(2,2)=d6_728(i3,i1,i4)%d(2,2)+fcr(id6)*c
     & f728(i3,i1,i4)%ek0
      end do
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id7).eq.1).and.(ibot(id6).eq.1)) then
* TH -- qu=p5134,qd=p6,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p5134k0*p6(2)+p6k0*p5134(2)
      cauxa=auxa-cim*(p6(3)*p5134k0-p5134(3)*p6k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p6k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p5134k0
      clineth%c(2,2)=clineth%c(1,1)
  
      do i3=1,2
      do i1=1,2
      do i4=1,2
         d6_728(i3,i1,i4)%a(1,2)=clineth%a(1,2)*ch728(i3,i1,i4)
         d6_728(i3,i1,i4)%a(2,1)=clineth%a(2,1)*ch728(i3,i1,i4)
  
         d6_728(i3,i1,i4)%b(1,1)=clineth%b(1,1)*ch728(i3,i1,i4)
         d6_728(i3,i1,i4)%b(2,2)=clineth%b(2,2)*ch728(i3,i1,i4)
  
         d6_728(i3,i1,i4)%c(1,1)=clineth%c(1,1)*ch728(i3,i1,i4)
         d6_728(i3,i1,i4)%c(2,2)=clineth%c(2,2)*ch728(i3,i1,i4)
      enddo
      enddo
      enddo
      x6_728=.true.
  
      else
      x6_728=.false.
  
      endif ! on higgs
  
      endif ! on (iquark(id7)), compute only per quark forks
*** END: insertions of forks with one gluon into fermion lines          
  
  
* insertions of forks with one gluon into fermion lines                 
* in which inserted from the outer side the other gluon                 
  
* gluons are involved, compute only per (quark base line AND            
* quark fork)                                                           
      if ((iquark(id5).eq.1).and.(iquark(id7).eq.1)) then
  
  
* UP PART                                                               
  
*    718       cz\\718, ch718                                           
*     \|/                                                               
*      o       o is a sum over 2 gluon positions                        
*    | |                                                                
*  ----0------------       0 is a sum over z,f,h                        
* |          p346                                                       
*  52                                                                   
  
      quqd=(s346+s52-s178)/2d0
* z insertion                                                           
      ccr=zcr(id5)/(f346)
      ccl=zcl(id5)/(f346)
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p52,qd=p346,v=cz718(i3,i1,i4)%e,a=clinex_iii(i3,i1,i4)%a,b=cli
* nex_iii(i3,i1,i4)%b,c=clinex_iii(i3,i1,i4)%c,d=clinex_iii(i3,i1,i4)%d,
* cr=ccr,cl=ccl,nsum=0
      ceps_0=-cz718(i3,i1,i4)%ek0*(p52(2)*p346(3)-p346(2)*p52(3)
     & )+p52k0*(cz718(i3,i1,i4)%e(2)*p346(3)-p346(2)*cz718(i3,i1
     & ,i4)%e(3))-p346k0*(cz718(i3,i1,i4)%e(2)*p52(3)-p52(2)*cz7
     & 18(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz718(i3,i1,i4)%e(3)*p52k0+p52(3)*cz718(i3,i1,i4)%
     & ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz718(i3,i1,i4)%e(3)*p346k0+p346(3)*cz718(i3,i1,i4
     & )%ek0
      ceps_2=ceps_2*cim
      cvqu=cz718(i3,i1,i4)%e(0)*p52(0)-cz718(i3,i1,i4)%e(1)*p52(
     & 1)-cz718(i3,i1,i4)%e(2)*p52(2)-cz718(i3,i1,i4)%e(3)*p52(3
     & )
      cvqd=cz718(i3,i1,i4)%e(0)*p346(0)-cz718(i3,i1,i4)%e(1)*p34
     & 6(1)-cz718(i3,i1,i4)%e(2)*p346(2)-cz718(i3,i1,i4)%e(3)*p3
     & 46(3)
      cauxa=-cz718(i3,i1,i4)%ek0*quqd+p52k0*cvqd+p346k0*cvqu
      cauxb=-cz718(i3,i1,i4)%ek0*p346(2)+p346k0*cz718(i3,i1,i4)%
     & e(2)
      cauxc=+cz718(i3,i1,i4)%ek0*p52(2)-p52k0*cz718(i3,i1,i4)%e(
     & 2)
      clinex_iii(i3,i1,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      clinex_iii(i3,i1,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      clinex_iii(i3,i1,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%d(1,1)=ccl*cz718(i3,i1,i4)%ek0
      clinex_iii(i3,i1,i4)%d(2,2)=ccr*cz718(i3,i1,i4)%ek0
      end do
      end do
      end do
  
* f insertion                                                           
      ccr=fcr(id5)/(f346)
      ccl=fcl(id5)/(f346)
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p52,qd=p346,v=cf718(i3,i1,i4)%e,a=clinex_iii(i3,i1,i4)%a,b=cli
* nex_iii(i3,i1,i4)%b,c=clinex_iii(i3,i1,i4)%c,d=clinex_iii(i3,i1,i4)%d,
* cr=ccr,cl=ccl,nsum=1
      ceps_0=-cf718(i3,i1,i4)%ek0*(p52(2)*p346(3)-p346(2)*p52(3)
     & )+p52k0*(cf718(i3,i1,i4)%e(2)*p346(3)-p346(2)*cf718(i3,i1
     & ,i4)%e(3))-p346k0*(cf718(i3,i1,i4)%e(2)*p52(3)-p52(2)*cf7
     & 18(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cf718(i3,i1,i4)%e(3)*p52k0+p52(3)*cf718(i3,i1,i4)%
     & ek0
      ceps_1=ceps_1*cim
      ceps_2=-cf718(i3,i1,i4)%e(3)*p346k0+p346(3)*cf718(i3,i1,i4
     & )%ek0
      ceps_2=ceps_2*cim
      cvqu=cf718(i3,i1,i4)%e(0)*p52(0)-cf718(i3,i1,i4)%e(1)*p52(
     & 1)-cf718(i3,i1,i4)%e(2)*p52(2)-cf718(i3,i1,i4)%e(3)*p52(3
     & )
      cvqd=cf718(i3,i1,i4)%e(0)*p346(0)-cf718(i3,i1,i4)%e(1)*p34
     & 6(1)-cf718(i3,i1,i4)%e(2)*p346(2)-cf718(i3,i1,i4)%e(3)*p3
     & 46(3)
      cauxa=-cf718(i3,i1,i4)%ek0*quqd+p52k0*cvqd+p346k0*cvqu
      cauxb=-cf718(i3,i1,i4)%ek0*p346(2)+p346k0*cf718(i3,i1,i4)%
     & e(2)
      cauxc=+cf718(i3,i1,i4)%ek0*p52(2)-p52k0*cf718(i3,i1,i4)%e(
     & 2)
      clinex_iii(i3,i1,i4)%a(1,1)=clinex_iii(i3,i1,i4)%a(1,1)+cc
     & r*(cauxa+ceps_0)
      clinex_iii(i3,i1,i4)%a(2,2)=clinex_iii(i3,i1,i4)%a(2,2)+cc
     & l*(cauxa-ceps_0)
      clinex_iii(i3,i1,i4)%b(1,2)=clinex_iii(i3,i1,i4)%b(1,2)+cc
     & l*(cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%b(2,1)=clinex_iii(i3,i1,i4)%b(2,1)+cc
     & r*(-cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%c(1,2)=clinex_iii(i3,i1,i4)%c(1,2)+cc
     & r*(cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%c(2,1)=clinex_iii(i3,i1,i4)%c(2,1)+cc
     & l*(-cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%d(1,1)=clinex_iii(i3,i1,i4)%d(1,1)+cc
     & l*cf718(i3,i1,i4)%ek0
      clinex_iii(i3,i1,i4)%d(2,2)=clinex_iii(i3,i1,i4)%d(2,2)+cc
     & r*cf718(i3,i1,i4)%ek0
      end do
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id7).eq.1).and.(ibot(id5).eq.1)) then
      ccoupl=rhbb/(f346)
* TH -- qu=p52,qd=p346,a=clineth%a,b=clineth%b,c=clineth%c,coupl=ccoupl
      auxa=-p52k0*p346(2)+p346k0*p52(2)
      cauxa=auxa-cim*(p346(3)*p52k0-p52(3)*p346k0)
      clineth%a(1,2)=ccoupl*cauxa
      clineth%a(2,1)=-ccoupl*conjg(cauxa)
      clineth%b(1,1)=ccoupl*p346k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=ccoupl*p52k0
      clineth%c(2,2)=clineth%c(1,1)
  
      do i3=1,2
      do i1=1,2
      do i4=1,2
         clinex_iii(i3,i1,i4)%a(1,2)=clineth%a(1,2)*ch718(i3,i1,i4)
         clinex_iii(i3,i1,i4)%a(2,1)=clineth%a(2,1)*ch718(i3,i1,i4)
  
         clinex_iii(i3,i1,i4)%b(1,1)=clineth%b(1,1)*ch718(i3,i1,i4)
         clinex_iii(i3,i1,i4)%b(2,2)=clineth%b(2,2)*ch718(i3,i1,i4)
  
         clinex_iii(i3,i1,i4)%c(1,1)=clineth%c(1,1)*ch718(i3,i1,i4)
         clinex_iii(i3,i1,i4)%c(2,2)=clineth%c(2,2)*ch718(i3,i1,i4)
      enddo
      enddo
      enddo
      x_iii=.true.
      else
      x_iii=.false.
  
      endif ! on higgs
  
* merge u5_2 with clinex_iii                                            
      if (x_iii) then
      do i2=1,2
      do i3=1,2
      do i1=1,2
      do i4=1,2
* TTs -- aa=u52_718(i2,i3,i1,i4)%a,bb=u52_718(i2,i3,i1,i4)%b,cc=u52_718(
* i2,i3,i1,i4)%c,dd=u52_718(i2,i3,i1,i4)%d,a1=u5_2(i2)%a,b1=u5_2(i2)%b,c
* 1=u5_2(i2)%c,d1=u5_2(i2)%d,a2=clinex_iii(i3,i1,i4)%a,b2=clinex_iii(i3,
* i1,i4)%b,c2=clinex_iii(i3,i1,i4)%c,d2=clinex_iii(i3,i1,i4)%d,prq=s52,m
* =rmass(id5),nsum=0
      do jut=1,2
      cx1=clinex_iii(i3,i1,i4)%a(1,jut)+rmass(id5)*clinex_iii(i3
     & ,i1,i4)%b(1,jut)
      cx2=clinex_iii(i3,i1,i4)%a(2,jut)+rmass(id5)*clinex_iii(i3
     & ,i1,i4)%b(2,jut)
      cy1=s52*clinex_iii(i3,i1,i4)%b(1,jut)+rmass(id5)*clinex_ii
     & i(i3,i1,i4)%a(1,jut)
      cy2=s52*clinex_iii(i3,i1,i4)%b(2,jut)+rmass(id5)*clinex_ii
     & i(i3,i1,i4)%a(2,jut)
      cw1=clinex_iii(i3,i1,i4)%c(1,jut)+rmass(id5)*clinex_iii(i3
     & ,i1,i4)%d(1,jut)
      cw2=clinex_iii(i3,i1,i4)%c(2,jut)+rmass(id5)*clinex_iii(i3
     & ,i1,i4)%d(2,jut)
      cz1=s52*clinex_iii(i3,i1,i4)%d(1,jut)+rmass(id5)*clinex_ii
     & i(i3,i1,i4)%c(1,jut)
      cz2=s52*clinex_iii(i3,i1,i4)%d(2,jut)+rmass(id5)*clinex_ii
     & i(i3,i1,i4)%c(2,jut)
      u52_718(i2,i3,i1,i4)%a(1,jut)=u5_2(i2)%a(1,1)*cx1+u5_2(i2)
     & %c(1,2)*cy2
      u52_718(i2,i3,i1,i4)%b(1,jut)=u5_2(i2)%d(1,1)*cy1+u5_2(i2)
     & %b(1,2)*cx2
      u52_718(i2,i3,i1,i4)%c(1,jut)=u5_2(i2)%a(1,1)*cw1+u5_2(i2)
     & %c(1,2)*cz2
      u52_718(i2,i3,i1,i4)%d(1,jut)=u5_2(i2)%d(1,1)*cz1+u5_2(i2)
     & %b(1,2)*cw2
      u52_718(i2,i3,i1,i4)%a(2,jut)=u5_2(i2)%c(2,1)*cy1+u5_2(i2)
     & %a(2,2)*cx2
      u52_718(i2,i3,i1,i4)%b(2,jut)=u5_2(i2)%b(2,1)*cx1+u5_2(i2)
     & %d(2,2)*cy2
      u52_718(i2,i3,i1,i4)%c(2,jut)=u5_2(i2)%c(2,1)*cz1+u5_2(i2)
     & %a(2,2)*cw2
      u52_718(i2,i3,i1,i4)%d(2,jut)=u5_2(i2)%b(2,1)*cw1+u5_2(i2)
     & %d(2,2)*cz2
      end do
      end do
      end do
      end do
      end do
      else
      do i2=1,2
      do i3=1,2
      do i1=1,2
      do i4=1,2
* TT -- aa=u52_718(i2,i3,i1,i4)%a,bb=u52_718(i2,i3,i1,i4)%b,cc=u52_718(i
* 2,i3,i1,i4)%c,dd=u52_718(i2,i3,i1,i4)%d,a1=u5_2(i2)%a,b1=u5_2(i2)%b,c1
* =u5_2(i2)%c,d1=u5_2(i2)%d,a2=clinex_iii(i3,i1,i4)%a,b2=clinex_iii(i3,i
* 1,i4)%b,c2=clinex_iii(i3,i1,i4)%c,d2=clinex_iii(i3,i1,i4)%d,prq=s52,m=
* rmass(id5),nsum=0
      u52_718(i2,i3,i1,i4)%a(1,1)=u5_2(i2)%a(1,1)*clinex_iii(i3,
     & i1,i4)%a(1,1)+u5_2(i2)%c(1,2)*s52*clinex_iii(i3,i1,i4)%b(
     & 2,1)
      u52_718(i2,i3,i1,i4)%b(1,1)=rmass(id5)*(u5_2(i2)%d(1,1)*cl
     & inex_iii(i3,i1,i4)%a(1,1)+u5_2(i2)%b(1,2)*clinex_iii(i3,i
     & 1,i4)%b(2,1))
      u52_718(i2,i3,i1,i4)%c(1,1)=rmass(id5)*(u5_2(i2)%a(1,1)*cl
     & inex_iii(i3,i1,i4)%d(1,1)+u5_2(i2)%c(1,2)*clinex_iii(i3,i
     & 1,i4)%c(2,1))
      u52_718(i2,i3,i1,i4)%d(1,1)=u5_2(i2)%d(1,1)*s52*clinex_iii
     & (i3,i1,i4)%d(1,1)+u5_2(i2)%b(1,2)*clinex_iii(i3,i1,i4)%c(
     & 2,1)
      u52_718(i2,i3,i1,i4)%a(1,2)=rmass(id5)*(u5_2(i2)%a(1,1)*cl
     & inex_iii(i3,i1,i4)%b(1,2)+u5_2(i2)%c(1,2)*clinex_iii(i3,i
     & 1,i4)%a(2,2))
      u52_718(i2,i3,i1,i4)%b(1,2)=u5_2(i2)%d(1,1)*s52*clinex_iii
     & (i3,i1,i4)%b(1,2)+u5_2(i2)%b(1,2)*clinex_iii(i3,i1,i4)%a(
     & 2,2)
      u52_718(i2,i3,i1,i4)%c(1,2)=u5_2(i2)%a(1,1)*clinex_iii(i3,
     & i1,i4)%c(1,2)+u5_2(i2)%c(1,2)*s52*clinex_iii(i3,i1,i4)%d(
     & 2,2)
      u52_718(i2,i3,i1,i4)%d(1,2)=rmass(id5)*(u5_2(i2)%d(1,1)*cl
     & inex_iii(i3,i1,i4)%c(1,2)+u5_2(i2)%b(1,2)*clinex_iii(i3,i
     & 1,i4)%d(2,2))
      u52_718(i2,i3,i1,i4)%a(2,1)=rmass(id5)*(u5_2(i2)%c(2,1)*cl
     & inex_iii(i3,i1,i4)%a(1,1)+u5_2(i2)%a(2,2)*clinex_iii(i3,i
     & 1,i4)%b(2,1))
      u52_718(i2,i3,i1,i4)%b(2,1)=u5_2(i2)%b(2,1)*clinex_iii(i3,
     & i1,i4)%a(1,1)+u5_2(i2)%d(2,2)*s52*clinex_iii(i3,i1,i4)%b(
     & 2,1)
      u52_718(i2,i3,i1,i4)%c(2,1)=u5_2(i2)%c(2,1)*s52*clinex_iii
     & (i3,i1,i4)%d(1,1)+u5_2(i2)%a(2,2)*clinex_iii(i3,i1,i4)%c(
     & 2,1)
      u52_718(i2,i3,i1,i4)%d(2,1)=rmass(id5)*(u5_2(i2)%b(2,1)*cl
     & inex_iii(i3,i1,i4)%d(1,1)+u5_2(i2)%d(2,2)*clinex_iii(i3,i
     & 1,i4)%c(2,1))
      u52_718(i2,i3,i1,i4)%a(2,2)=u5_2(i2)%c(2,1)*s52*clinex_iii
     & (i3,i1,i4)%b(1,2)+u5_2(i2)%a(2,2)*clinex_iii(i3,i1,i4)%a(
     & 2,2)
      u52_718(i2,i3,i1,i4)%b(2,2)=rmass(id5)*(u5_2(i2)%b(2,1)*cl
     & inex_iii(i3,i1,i4)%b(1,2)+u5_2(i2)%d(2,2)*clinex_iii(i3,i
     & 1,i4)%a(2,2))
      u52_718(i2,i3,i1,i4)%c(2,2)=rmass(id5)*(u5_2(i2)%c(2,1)*cl
     & inex_iii(i3,i1,i4)%c(1,2)+u5_2(i2)%a(2,2)*clinex_iii(i3,i
     & 1,i4)%d(2,2))
      u52_718(i2,i3,i1,i4)%d(2,2)=u5_2(i2)%b(2,1)*clinex_iii(i3,
     & i1,i4)%c(1,2)+u5_2(i2)%d(2,2)*s52*clinex_iii(i3,i1,i4)%d(
     & 2,2)
      end do
      end do
      end do
      end do
      endif
  
* DOWN PART                                                             
  
*           718                                                         
*            \|/                                                        
*             o                                                         
*             |  |  | 26                                                
*  -----------0-----                                                    
*   p534                                                                
  
      quqd=(s534+s26-s178)/2d0
* z insertion                                                           
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p534,qd=p26,v=cz718(i3,i1,i4)%e,a=clinex_iii(i3,i1,i4)%a,b=cli
* nex_iii(i3,i1,i4)%b,c=clinex_iii(i3,i1,i4)%c,d=clinex_iii(i3,i1,i4)%d,
