      quqd=(s3156-s156+rmass2(id3))/2d0
  
* z insertion                                                           
      ccr=zcr(id3)/(f3156)
      ccl=zcl(id3)/(f3156)
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p3,qd=p3156,v=cz516(i3,i1,i4)%e,a=u3_516(i3,i1,i4)%a,b=u3_516(
* i3,i1,i4)%b,c=u3_516(i3,i1,i4)%c,d=u3_516(i3,i1,i4)%d,cr=ccr,cl=ccl,ns
* um=0
      ceps_0=-cz516(i3,i1,i4)%ek0*(p3(2)*p3156(3)-p3156(2)*p3(3)
     & )+p3k0*(cz516(i3,i1,i4)%e(2)*p3156(3)-p3156(2)*cz516(i3,i
     & 1,i4)%e(3))-p3156k0*(cz516(i3,i1,i4)%e(2)*p3(3)-p3(2)*cz5
     & 16(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz516(i3,i1,i4)%e(3)*p3k0+p3(3)*cz516(i3,i1,i4)%ek
     & 0
      ceps_1=ceps_1*cim
      ceps_2=-cz516(i3,i1,i4)%e(3)*p3156k0+p3156(3)*cz516(i3,i1,
     & i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cz516(i3,i1,i4)%e(0)*p3(0)-cz516(i3,i1,i4)%e(1)*p3(1)
     & -cz516(i3,i1,i4)%e(2)*p3(2)-cz516(i3,i1,i4)%e(3)*p3(3)
      cvqd=cz516(i3,i1,i4)%e(0)*p3156(0)-cz516(i3,i1,i4)%e(1)*p3
     & 156(1)-cz516(i3,i1,i4)%e(2)*p3156(2)-cz516(i3,i1,i4)%e(3)
     & *p3156(3)
      cauxa=-cz516(i3,i1,i4)%ek0*quqd+p3k0*cvqd+p3156k0*cvqu
      cauxb=-cz516(i3,i1,i4)%ek0*p3156(2)+p3156k0*cz516(i3,i1,i4
     & )%e(2)
      cauxc=+cz516(i3,i1,i4)%ek0*p3(2)-p3k0*cz516(i3,i1,i4)%e(2)
      u3_516(i3,i1,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      u3_516(i3,i1,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      u3_516(i3,i1,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      u3_516(i3,i1,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      u3_516(i3,i1,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      u3_516(i3,i1,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      u3_516(i3,i1,i4)%d(1,1)=ccl*cz516(i3,i1,i4)%ek0
      u3_516(i3,i1,i4)%d(2,2)=ccr*cz516(i3,i1,i4)%ek0
      end do
