      cauxa=-cf516(i3,i1,i4)%ek0*quqd+p3k0*cvqd+p3156k0*cvqu
      cauxb=-cf516(i3,i1,i4)%ek0*p3156(2)+p3156k0*cf516(i3,i1,i4
     & )%e(2)
      cauxc=+cf516(i3,i1,i4)%ek0*p3(2)-p3k0*cf516(i3,i1,i4)%e(2)
      u3_516(i3,i1,i4)%a(1,1)=u3_516(i3,i1,i4)%a(1,1)+ccr*(cauxa
     & +ceps_0)
      u3_516(i3,i1,i4)%a(2,2)=u3_516(i3,i1,i4)%a(2,2)+ccl*(cauxa
     & -ceps_0)
      u3_516(i3,i1,i4)%b(1,2)=u3_516(i3,i1,i4)%b(1,2)+ccl*(cauxb
     & -ceps_2)
      u3_516(i3,i1,i4)%b(2,1)=u3_516(i3,i1,i4)%b(2,1)+ccr*(-caux
     & b-ceps_2)
      u3_516(i3,i1,i4)%c(1,2)=u3_516(i3,i1,i4)%c(1,2)+ccr*(cauxc
     & +ceps_1)
      u3_516(i3,i1,i4)%c(2,1)=u3_516(i3,i1,i4)%c(2,1)+ccl*(-caux
     & c+ceps_1)
      u3_516(i3,i1,i4)%d(1,1)=u3_516(i3,i1,i4)%d(1,1)+ccl*cf516(
     & i3,i1,i4)%ek0
      u3_516(i3,i1,i4)%d(2,2)=u3_516(i3,i1,i4)%d(2,2)+ccr*cf516(
