      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=ccoupl*p3k0
      clineth%c(2,2)=clineth%c(1,1)
  
      do i3=1,2
      do i1=1,2
      do i4=1,2
         u3_516(i3,i1,i4)%a(1,2)=clineth%a(1,2)*ch516(i3,i1,i4)
         u3_516(i3,i1,i4)%a(2,1)=clineth%a(2,1)*ch516(i3,i1,i4)
  
         u3_516(i3,i1,i4)%b(1,1)=clineth%b(1,1)*ch516(i3,i1,i4)
         u3_516(i3,i1,i4)%b(2,2)=clineth%b(2,2)*ch516(i3,i1,i4)
  
         u3_516(i3,i1,i4)%c(1,1)=clineth%c(1,1)*ch516(i3,i1,i4)
         u3_516(i3,i1,i4)%c(2,2)=clineth%c(2,2)*ch516(i3,i1,i4)
