* )%d,a2=d4_1(i2)%a,b2=d4_1(i2)%b,c2=d4_1(i2)%c,d2=d4_1(i2)%d,prq=s14,m=
* rmass(id4),nsum=0
      d41_526(i2,i3,i1,i4)%a(1,1)=clinex_iii(i3,i1,i4)%a(1,1)*d4
     & _1(i2)%a(1,1)+clinex_iii(i3,i1,i4)%c(1,2)*s14*d4_1(i2)%b(
