     & 1(i2)%c(2,1))
      d41_526(i2,i3,i1,i4)%d(1,1)=clinex_iii(i3,i1,i4)%d(1,1)*s1
     & 4*d4_1(i2)%d(1,1)+clinex_iii(i3,i1,i4)%b(1,2)*d4_1(i2)%c(
