      d41_526(i2,i3,i1,i4)%c(1,2)=clinex_iii(i3,i1,i4)%a(1,1)*d4
     & _1(i2)%c(1,2)+clinex_iii(i3,i1,i4)%c(1,2)*s14*d4_1(i2)%d(
