      d41_526(i2,i3,i1,i4)%d(1,2)=rmass(id4)*(clinex_iii(i3,i1,i
     & 4)%d(1,1)*d4_1(i2)%c(1,2)+clinex_iii(i3,i1,i4)%b(1,2)*d4_
     & 1(i2)%d(2,2))
      d41_526(i2,i3,i1,i4)%a(2,1)=rmass(id4)*(clinex_iii(i3,i1,i
     & 4)%c(2,1)*d4_1(i2)%a(1,1)+clinex_iii(i3,i1,i4)%a(2,2)*d4_
     & 1(i2)%b(2,1))
      d41_526(i2,i3,i1,i4)%b(2,1)=clinex_iii(i3,i1,i4)%b(2,1)*d4
