      d41_526(i2,i3,i1,i4)%c(2,2)=rmass(id4)*(clinex_iii(i3,i1,i
     & 4)%c(2,1)*d4_1(i2)%c(1,2)+clinex_iii(i3,i1,i4)%a(2,2)*d4_
