      if (iquark(id7).eq.1) then
  
* UP PART                                                               
  
*    718       cz\\718, ch718                                           
*     \|/                                                               
*      o       o is a sum over 2 gluon positions                        
*      |                                                                
*  ----0------------       0 is a sum over z,f,h                        
* |          p3178                                                      
*  3                                                                    
  
      quqd=(s3178-s178+rmass2(id3))/2d0
  
* z insertion                                                           
      ccr=zcr(id3)/(f3178)
      ccl=zcl(id3)/(f3178)
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p3,qd=p3178,v=cz718(i3,i1,i4)%e,a=u3_718(i3,i1,i4)%a,b=u3_718(
* i3,i1,i4)%b,c=u3_718(i3,i1,i4)%c,d=u3_718(i3,i1,i4)%d,cr=ccr,cl=ccl,ns
* um=0
      ceps_0=-cz718(i3,i1,i4)%ek0*(p3(2)*p3178(3)-p3178(2)*p3(3)
     & )+p3k0*(cz718(i3,i1,i4)%e(2)*p3178(3)-p3178(2)*cz718(i3,i
     & 1,i4)%e(3))-p3178k0*(cz718(i3,i1,i4)%e(2)*p3(3)-p3(2)*cz7
     & 18(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz718(i3,i1,i4)%e(3)*p3k0+p3(3)*cz718(i3,i1,i4)%ek
     & 0
      ceps_1=ceps_1*cim
      ceps_2=-cz718(i3,i1,i4)%e(3)*p3178k0+p3178(3)*cz718(i3,i1,
     & i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cz718(i3,i1,i4)%e(0)*p3(0)-cz718(i3,i1,i4)%e(1)*p3(1)
     & -cz718(i3,i1,i4)%e(2)*p3(2)-cz718(i3,i1,i4)%e(3)*p3(3)
      cvqd=cz718(i3,i1,i4)%e(0)*p3178(0)-cz718(i3,i1,i4)%e(1)*p3
     & 178(1)-cz718(i3,i1,i4)%e(2)*p3178(2)-cz718(i3,i1,i4)%e(3)
     & *p3178(3)
      cauxa=-cz718(i3,i1,i4)%ek0*quqd+p3k0*cvqd+p3178k0*cvqu
      cauxb=-cz718(i3,i1,i4)%ek0*p3178(2)+p3178k0*cz718(i3,i1,i4
     & )%e(2)
      cauxc=+cz718(i3,i1,i4)%ek0*p3(2)-p3k0*cz718(i3,i1,i4)%e(2)
      u3_718(i3,i1,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      u3_718(i3,i1,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      u3_718(i3,i1,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      u3_718(i3,i1,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      u3_718(i3,i1,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      u3_718(i3,i1,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      u3_718(i3,i1,i4)%d(1,1)=ccl*cz718(i3,i1,i4)%ek0
      u3_718(i3,i1,i4)%d(2,2)=ccr*cz718(i3,i1,i4)%ek0
      end do
      end do
      end do
  
* f insertion                                                           
      ccr=fcr(id3)/(f3178)
      ccl=fcl(id3)/(f3178)
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p3,qd=p3178,v=cf718(i3,i1,i4)%e,a=u3_718(i3,i1,i4)%a,b=u3_718(
* i3,i1,i4)%b,c=u3_718(i3,i1,i4)%c,d=u3_718(i3,i1,i4)%d,cr=ccr,cl=ccl,ns
* um=1
      ceps_0=-cf718(i3,i1,i4)%ek0*(p3(2)*p3178(3)-p3178(2)*p3(3)
     & )+p3k0*(cf718(i3,i1,i4)%e(2)*p3178(3)-p3178(2)*cf718(i3,i
     & 1,i4)%e(3))-p3178k0*(cf718(i3,i1,i4)%e(2)*p3(3)-p3(2)*cf7
     & 18(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cf718(i3,i1,i4)%e(3)*p3k0+p3(3)*cf718(i3,i1,i4)%ek
     & 0
      ceps_1=ceps_1*cim
      ceps_2=-cf718(i3,i1,i4)%e(3)*p3178k0+p3178(3)*cf718(i3,i1,
     & i4)%ek0
      ceps_2=ceps_2*cim
      cvqu=cf718(i3,i1,i4)%e(0)*p3(0)-cf718(i3,i1,i4)%e(1)*p3(1)
     & -cf718(i3,i1,i4)%e(2)*p3(2)-cf718(i3,i1,i4)%e(3)*p3(3)
      cvqd=cf718(i3,i1,i4)%e(0)*p3178(0)-cf718(i3,i1,i4)%e(1)*p3
     & 178(1)-cf718(i3,i1,i4)%e(2)*p3178(2)-cf718(i3,i1,i4)%e(3)
     & *p3178(3)
      cauxa=-cf718(i3,i1,i4)%ek0*quqd+p3k0*cvqd+p3178k0*cvqu
      cauxb=-cf718(i3,i1,i4)%ek0*p3178(2)+p3178k0*cf718(i3,i1,i4
     & )%e(2)
      cauxc=+cf718(i3,i1,i4)%ek0*p3(2)-p3k0*cf718(i3,i1,i4)%e(2)
      u3_718(i3,i1,i4)%a(1,1)=u3_718(i3,i1,i4)%a(1,1)+ccr*(cauxa
     & +ceps_0)
      u3_718(i3,i1,i4)%a(2,2)=u3_718(i3,i1,i4)%a(2,2)+ccl*(cauxa
     & -ceps_0)
      u3_718(i3,i1,i4)%b(1,2)=u3_718(i3,i1,i4)%b(1,2)+ccl*(cauxb
     & -ceps_2)
      u3_718(i3,i1,i4)%b(2,1)=u3_718(i3,i1,i4)%b(2,1)+ccr*(-caux
     & b-ceps_2)
      u3_718(i3,i1,i4)%c(1,2)=u3_718(i3,i1,i4)%c(1,2)+ccr*(cauxc
     & +ceps_1)
      u3_718(i3,i1,i4)%c(2,1)=u3_718(i3,i1,i4)%c(2,1)+ccl*(-caux
     & c+ceps_1)
      u3_718(i3,i1,i4)%d(1,1)=u3_718(i3,i1,i4)%d(1,1)+ccl*cf718(
     & i3,i1,i4)%ek0
      u3_718(i3,i1,i4)%d(2,2)=u3_718(i3,i1,i4)%d(2,2)+ccr*cf718(
     & i3,i1,i4)%ek0
