      end do
      end do
  
* higgs                                                                 
      if ((ibot(id7).eq.1).and.(ibot(id3).eq.1)) then
      ccoupl=rhbb/(f3178)
* TH -- qu=p3,qd=p3178,a=clineth%a,b=clineth%b,c=clineth%c,coupl=ccoupl
      auxa=-p3k0*p3178(2)+p3178k0*p3(2)
      cauxa=auxa-cim*(p3178(3)*p3k0-p3(3)*p3178k0)
      clineth%a(1,2)=ccoupl*cauxa
      clineth%a(2,1)=-ccoupl*conjg(cauxa)
      clineth%b(1,1)=ccoupl*p3178k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=ccoupl*p3k0
      clineth%c(2,2)=clineth%c(1,1)
  
      do i3=1,2
      do i1=1,2
      do i4=1,2
         u3_718(i3,i1,i4)%a(1,2)=clineth%a(1,2)*ch718(i3,i1,i4)
         u3_718(i3,i1,i4)%a(2,1)=clineth%a(2,1)*ch718(i3,i1,i4)
  
         u3_718(i3,i1,i4)%b(1,1)=clineth%b(1,1)*ch718(i3,i1,i4)
         u3_718(i3,i1,i4)%b(2,2)=clineth%b(2,2)*ch718(i3,i1,i4)
  
         u3_718(i3,i1,i4)%c(1,1)=clineth%c(1,1)*ch718(i3,i1,i4)
         u3_718(i3,i1,i4)%c(2,2)=clineth%c(2,2)*ch718(i3,i1,i4)
      enddo
      enddo
