      cauxa=-cf728(i3,i1,i4)%ek0*quqd+p3156k0*cvqd+p4k0*cvqu
      cauxb=-cf728(i3,i1,i4)%ek0*p4(2)+p4k0*cf728(i3,i1,i4)%e(2)
      cauxc=+cf728(i3,i1,i4)%ek0*p3156(2)-p3156k0*cf728(i3,i1,i4
     & )%e(2)
      d4_728(i3,i1,i4)%a(1,1)=d4_728(i3,i1,i4)%a(1,1)+fcr(id4)*(
     & cauxa+ceps_0)
      d4_728(i3,i1,i4)%a(2,2)=d4_728(i3,i1,i4)%a(2,2)+fcl(id4)*(
     & cauxa-ceps_0)
      d4_728(i3,i1,i4)%b(1,2)=d4_728(i3,i1,i4)%b(1,2)+fcl(id4)*(
     & cauxb-ceps_2)
      d4_728(i3,i1,i4)%b(2,1)=d4_728(i3,i1,i4)%b(2,1)+fcr(id4)*(
     & -cauxb-ceps_2)
      d4_728(i3,i1,i4)%c(1,2)=d4_728(i3,i1,i4)%c(1,2)+fcr(id4)*(
     & cauxc+ceps_1)
      d4_728(i3,i1,i4)%c(2,1)=d4_728(i3,i1,i4)%c(2,1)+fcl(id4)*(
     & -cauxc+ceps_1)
      d4_728(i3,i1,i4)%d(1,1)=d4_728(i3,i1,i4)%d(1,1)+fcl(id4)*c
     & f728(i3,i1,i4)%ek0
      d4_728(i3,i1,i4)%d(2,2)=d4_728(i3,i1,i4)%d(2,2)+fcr(id4)*c
     & f728(i3,i1,i4)%ek0
      end do
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id7).eq.1).and.(ibot(id4).eq.1)) then
* TH -- qu=p3156,qd=p4,a=clineth%a,b=clineth%b,c=clineth%c,coupl=rhbb
      auxa=-p3156k0*p4(2)+p4k0*p3156(2)
      cauxa=auxa-cim*(p4(3)*p3156k0-p3156(3)*p4k0)
      clineth%a(1,2)=rhbb*cauxa
      clineth%a(2,1)=-rhbb*conjg(cauxa)
      clineth%b(1,1)=rhbb*p4k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=rhbb*p3156k0
      clineth%c(2,2)=clineth%c(1,1)
  
      do i3=1,2
      do i1=1,2
      do i4=1,2
         d4_728(i3,i1,i4)%a(1,2)=clineth%a(1,2)*ch728(i3,i1,i4)
         d4_728(i3,i1,i4)%a(2,1)=clineth%a(2,1)*ch728(i3,i1,i4)
  
         d4_728(i3,i1,i4)%b(1,1)=clineth%b(1,1)*ch728(i3,i1,i4)
         d4_728(i3,i1,i4)%b(2,2)=clineth%b(2,2)*ch728(i3,i1,i4)
  
         d4_728(i3,i1,i4)%c(1,1)=clineth%c(1,1)*ch728(i3,i1,i4)
         d4_728(i3,i1,i4)%c(2,2)=clineth%c(2,2)*ch728(i3,i1,i4)
      enddo
      enddo
      enddo
      x4_728=.true.
  
      else
      x4_728=.false.
  
      endif ! on higgs
  
      endif ! on (iquark(id7)), compute only per quark forks
*** END: insertions of forks with one gluon into fermion lines          
  
  
* insertions of forks with one gluon into fermion lines                 
* in which inserted from the outer side the other gluon                 
  
* gluons are involved, compute only per (quark base line AND            
* quark fork)                                                           
      if ((iquark(id3).eq.1).and.(iquark(id7).eq.1)) then
  
  
* UP PART                                                               
  
*    718       cz\\718, ch718                                           
*     \|/                                                               
*      o       o is a sum over 2 gluon positions                        
*    | |                                                                
*  ----0------------       0 is a sum over z,f,h                        
* |          p564                                                       
*  32                                                                   
  
      quqd=(s564+s32-s178)/2d0
* z insertion                                                           
      ccr=zcr(id3)/(f564)
      ccl=zcl(id3)/(f564)
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p32,qd=p564,v=cz718(i3,i1,i4)%e,a=clinex_iii(i3,i1,i4)%a,b=cli
* nex_iii(i3,i1,i4)%b,c=clinex_iii(i3,i1,i4)%c,d=clinex_iii(i3,i1,i4)%d,
* cr=ccr,cl=ccl,nsum=0
      ceps_0=-cz718(i3,i1,i4)%ek0*(p32(2)*p564(3)-p564(2)*p32(3)
     & )+p32k0*(cz718(i3,i1,i4)%e(2)*p564(3)-p564(2)*cz718(i3,i1
     & ,i4)%e(3))-p564k0*(cz718(i3,i1,i4)%e(2)*p32(3)-p32(2)*cz7
     & 18(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cz718(i3,i1,i4)%e(3)*p32k0+p32(3)*cz718(i3,i1,i4)%
     & ek0
      ceps_1=ceps_1*cim
      ceps_2=-cz718(i3,i1,i4)%e(3)*p564k0+p564(3)*cz718(i3,i1,i4
     & )%ek0
      ceps_2=ceps_2*cim
      cvqu=cz718(i3,i1,i4)%e(0)*p32(0)-cz718(i3,i1,i4)%e(1)*p32(
     & 1)-cz718(i3,i1,i4)%e(2)*p32(2)-cz718(i3,i1,i4)%e(3)*p32(3
     & )
      cvqd=cz718(i3,i1,i4)%e(0)*p564(0)-cz718(i3,i1,i4)%e(1)*p56
     & 4(1)-cz718(i3,i1,i4)%e(2)*p564(2)-cz718(i3,i1,i4)%e(3)*p5
     & 64(3)
      cauxa=-cz718(i3,i1,i4)%ek0*quqd+p32k0*cvqd+p564k0*cvqu
      cauxb=-cz718(i3,i1,i4)%ek0*p564(2)+p564k0*cz718(i3,i1,i4)%
     & e(2)
      cauxc=+cz718(i3,i1,i4)%ek0*p32(2)-p32k0*cz718(i3,i1,i4)%e(
     & 2)
      clinex_iii(i3,i1,i4)%a(1,1)=ccr*(cauxa+ceps_0)
      clinex_iii(i3,i1,i4)%a(2,2)=ccl*(cauxa-ceps_0)
      clinex_iii(i3,i1,i4)%b(1,2)=ccl*(cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%b(2,1)=ccr*(-cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%c(1,2)=ccr*(cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%c(2,1)=ccl*(-cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%d(1,1)=ccl*cz718(i3,i1,i4)%ek0
      clinex_iii(i3,i1,i4)%d(2,2)=ccr*cz718(i3,i1,i4)%ek0
      end do
      end do
      end do
  
* f insertion                                                           
      ccr=fcr(id3)/(f564)
      ccl=fcl(id3)/(f564)
      do i3=1,2
      do i1=1,2
      do i4=1,2
* T -- qu=p32,qd=p564,v=cf718(i3,i1,i4)%e,a=clinex_iii(i3,i1,i4)%a,b=cli
* nex_iii(i3,i1,i4)%b,c=clinex_iii(i3,i1,i4)%c,d=clinex_iii(i3,i1,i4)%d,
* cr=ccr,cl=ccl,nsum=1
      ceps_0=-cf718(i3,i1,i4)%ek0*(p32(2)*p564(3)-p564(2)*p32(3)
     & )+p32k0*(cf718(i3,i1,i4)%e(2)*p564(3)-p564(2)*cf718(i3,i1
     & ,i4)%e(3))-p564k0*(cf718(i3,i1,i4)%e(2)*p32(3)-p32(2)*cf7
     & 18(i3,i1,i4)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-cf718(i3,i1,i4)%e(3)*p32k0+p32(3)*cf718(i3,i1,i4)%
     & ek0
      ceps_1=ceps_1*cim
      ceps_2=-cf718(i3,i1,i4)%e(3)*p564k0+p564(3)*cf718(i3,i1,i4
     & )%ek0
      ceps_2=ceps_2*cim
      cvqu=cf718(i3,i1,i4)%e(0)*p32(0)-cf718(i3,i1,i4)%e(1)*p32(
     & 1)-cf718(i3,i1,i4)%e(2)*p32(2)-cf718(i3,i1,i4)%e(3)*p32(3
     & )
      cvqd=cf718(i3,i1,i4)%e(0)*p564(0)-cf718(i3,i1,i4)%e(1)*p56
     & 4(1)-cf718(i3,i1,i4)%e(2)*p564(2)-cf718(i3,i1,i4)%e(3)*p5
     & 64(3)
      cauxa=-cf718(i3,i1,i4)%ek0*quqd+p32k0*cvqd+p564k0*cvqu
      cauxb=-cf718(i3,i1,i4)%ek0*p564(2)+p564k0*cf718(i3,i1,i4)%
     & e(2)
      cauxc=+cf718(i3,i1,i4)%ek0*p32(2)-p32k0*cf718(i3,i1,i4)%e(
     & 2)
      clinex_iii(i3,i1,i4)%a(1,1)=clinex_iii(i3,i1,i4)%a(1,1)+cc
     & r*(cauxa+ceps_0)
      clinex_iii(i3,i1,i4)%a(2,2)=clinex_iii(i3,i1,i4)%a(2,2)+cc
     & l*(cauxa-ceps_0)
      clinex_iii(i3,i1,i4)%b(1,2)=clinex_iii(i3,i1,i4)%b(1,2)+cc
     & l*(cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%b(2,1)=clinex_iii(i3,i1,i4)%b(2,1)+cc
     & r*(-cauxb-ceps_2)
      clinex_iii(i3,i1,i4)%c(1,2)=clinex_iii(i3,i1,i4)%c(1,2)+cc
     & r*(cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%c(2,1)=clinex_iii(i3,i1,i4)%c(2,1)+cc
     & l*(-cauxc+ceps_1)
      clinex_iii(i3,i1,i4)%d(1,1)=clinex_iii(i3,i1,i4)%d(1,1)+cc
     & l*cf718(i3,i1,i4)%ek0
      clinex_iii(i3,i1,i4)%d(2,2)=clinex_iii(i3,i1,i4)%d(2,2)+cc
     & r*cf718(i3,i1,i4)%ek0
      end do
      end do
      end do
  
* higgs                                                                 
      if ((ibot(id7).eq.1).and.(ibot(id3).eq.1)) then
      ccoupl=rhbb/(f564)
* TH -- qu=p32,qd=p564,a=clineth%a,b=clineth%b,c=clineth%c,coupl=ccoupl
      auxa=-p32k0*p564(2)+p564k0*p32(2)
      cauxa=auxa-cim*(p564(3)*p32k0-p32(3)*p564k0)
      clineth%a(1,2)=ccoupl*cauxa
      clineth%a(2,1)=-ccoupl*conjg(cauxa)
      clineth%b(1,1)=ccoupl*p564k0
      clineth%b(2,2)=clineth%b(1,1)
      clineth%c(1,1)=ccoupl*p32k0
      clineth%c(2,2)=clineth%c(1,1)
  
      do i3=1,2
      do i1=1,2
      do i4=1,2
         clinex_iii(i3,i1,i4)%a(1,2)=clineth%a(1,2)*ch718(i3,i1,i4)
         clinex_iii(i3,i1,i4)%a(2,1)=clineth%a(2,1)*ch718(i3,i1,i4)
  
         clinex_iii(i3,i1,i4)%b(1,1)=clineth%b(1,1)*ch718(i3,i1,i4)
         clinex_iii(i3,i1,i4)%b(2,2)=clineth%b(2,2)*ch718(i3,i1,i4)
  
         clinex_iii(i3,i1,i4)%c(1,1)=clineth%c(1,1)*ch718(i3,i1,i4)
         clinex_iii(i3,i1,i4)%c(2,2)=clineth%c(2,2)*ch718(i3,i1,i4)
      enddo
      enddo
      enddo
      x_iii=.true.
      else
      x_iii=.false.
  
      endif ! on higgs
  
* merge u3_2 with clinex_iii                                            
      if (x_iii) then
      do i2=1,2
      do i3=1,2
      do i1=1,2
      do i4=1,2
* TTs -- aa=u32_718(i2,i3,i1,i4)%a,bb=u32_718(i2,i3,i1,i4)%b,cc=u32_718(
* i2,i3,i1,i4)%c,dd=u32_718(i2,i3,i1,i4)%d,a1=u3_2(i2)%a,b1=u3_2(i2)%b,c
* 1=u3_2(i2)%c,d1=u3_2(i2)%d,a2=clinex_iii(i3,i1,i4)%a,b2=clinex_iii(i3,
* i1,i4)%b,c2=clinex_iii(i3,i1,i4)%c,d2=clinex_iii(i3,i1,i4)%d,prq=s32,m
* =rmass(id3),nsum=0
      do jut=1,2
      cx1=clinex_iii(i3,i1,i4)%a(1,jut)+rmass(id3)*clinex_iii(i3
     & ,i1,i4)%b(1,jut)
      cx2=clinex_iii(i3,i1,i4)%a(2,jut)+rmass(id3)*clinex_iii(i3
     & ,i1,i4)%b(2,jut)
      cy1=s32*clinex_iii(i3,i1,i4)%b(1,jut)+rmass(id3)*clinex_ii
     & i(i3,i1,i4)%a(1,jut)
      cy2=s32*clinex_iii(i3,i1,i4)%b(2,jut)+rmass(id3)*clinex_ii
     & i(i3,i1,i4)%a(2,jut)
      cw1=clinex_iii(i3,i1,i4)%c(1,jut)+rmass(id3)*clinex_iii(i3
     & ,i1,i4)%d(1,jut)
      cw2=clinex_iii(i3,i1,i4)%c(2,jut)+rmass(id3)*clinex_iii(i3
     & ,i1,i4)%d(2,jut)
      cz1=s32*clinex_iii(i3,i1,i4)%d(1,jut)+rmass(id3)*clinex_ii
     & i(i3,i1,i4)%c(1,jut)
      cz2=s32*clinex_iii(i3,i1,i4)%d(2,jut)+rmass(id3)*clinex_ii
     & i(i3,i1,i4)%c(2,jut)
      u32_718(i2,i3,i1,i4)%a(1,jut)=u3_2(i2)%a(1,1)*cx1+u3_2(i2)
     & %c(1,2)*cy2
      u32_718(i2,i3,i1,i4)%b(1,jut)=u3_2(i2)%d(1,1)*cy1+u3_2(i2)
     & %b(1,2)*cx2
      u32_718(i2,i3,i1,i4)%c(1,jut)=u3_2(i2)%a(1,1)*cw1+u3_2(i2)
     & %c(1,2)*cz2
      u32_718(i2,i3,i1,i4)%d(1,jut)=u3_2(i2)%d(1,1)*cz1+u3_2(i2)
     & %b(1,2)*cw2
      u32_718(i2,i3,i1,i4)%a(2,jut)=u3_2(i2)%c(2,1)*cy1+u3_2(i2)
     & %a(2,2)*cx2
      u32_718(i2,i3,i1,i4)%b(2,jut)=u3_2(i2)%b(2,1)*cx1+u3_2(i2)
     & %d(2,2)*cy2
      u32_718(i2,i3,i1,i4)%c(2,jut)=u3_2(i2)%c(2,1)*cz1+u3_2(i2)
     & %a(2,2)*cw2
      u32_718(i2,i3,i1,i4)%d(2,jut)=u3_2(i2)%b(2,1)*cw1+u3_2(i2)
     & %d(2,2)*cz2
      end do
      end do
      end do
      end do
      end do
      else
      do i2=1,2
      do i3=1,2
      do i1=1,2
      do i4=1,2
* TT -- aa=u32_718(i2,i3,i1,i4)%a,bb=u32_718(i2,i3,i1,i4)%b,cc=u32_718(i
* 2,i3,i1,i4)%c,dd=u32_718(i2,i3,i1,i4)%d,a1=u3_2(i2)%a,b1=u3_2(i2)%b,c1
* =u3_2(i2)%c,d1=u3_2(i2)%d,a2=clinex_iii(i3,i1,i4)%a,b2=clinex_iii(i3,i
* 1,i4)%b,c2=clinex_iii(i3,i1,i4)%c,d2=clinex_iii(i3,i1,i4)%d,prq=s32,m=
* rmass(id3),nsum=0
      u32_718(i2,i3,i1,i4)%a(1,1)=u3_2(i2)%a(1,1)*clinex_iii(i3,
     & i1,i4)%a(1,1)+u3_2(i2)%c(1,2)*s32*clinex_iii(i3,i1,i4)%b(
     & 2,1)
      u32_718(i2,i3,i1,i4)%b(1,1)=rmass(id3)*(u3_2(i2)%d(1,1)*cl
     & inex_iii(i3,i1,i4)%a(1,1)+u3_2(i2)%b(1,2)*clinex_iii(i3,i
     & 1,i4)%b(2,1))
      u32_718(i2,i3,i1,i4)%c(1,1)=rmass(id3)*(u3_2(i2)%a(1,1)*cl
     & inex_iii(i3,i1,i4)%d(1,1)+u3_2(i2)%c(1,2)*clinex_iii(i3,i
     & 1,i4)%c(2,1))
      u32_718(i2,i3,i1,i4)%d(1,1)=u3_2(i2)%d(1,1)*s32*clinex_iii
     & (i3,i1,i4)%d(1,1)+u3_2(i2)%b(1,2)*clinex_iii(i3,i1,i4)%c(
     & 2,1)
      u32_718(i2,i3,i1,i4)%a(1,2)=rmass(id3)*(u3_2(i2)%a(1,1)*cl
     & inex_iii(i3,i1,i4)%b(1,2)+u3_2(i2)%c(1,2)*clinex_iii(i3,i
     & 1,i4)%a(2,2))
      u32_718(i2,i3,i1,i4)%b(1,2)=u3_2(i2)%d(1,1)*s32*clinex_iii
     & (i3,i1,i4)%b(1,2)+u3_2(i2)%b(1,2)*clinex_iii(i3,i1,i4)%a(
     & 2,2)
      u32_718(i2,i3,i1,i4)%c(1,2)=u3_2(i2)%a(1,1)*clinex_iii(i3,
     & i1,i4)%c(1,2)+u3_2(i2)%c(1,2)*s32*clinex_iii(i3,i1,i4)%d(
     & 2,2)
      u32_718(i2,i3,i1,i4)%d(1,2)=rmass(id3)*(u3_2(i2)%d(1,1)*cl
     & inex_iii(i3,i1,i4)%c(1,2)+u3_2(i2)%b(1,2)*clinex_iii(i3,i
     & 1,i4)%d(2,2))
      u32_718(i2,i3,i1,i4)%a(2,1)=rmass(id3)*(u3_2(i2)%c(2,1)*cl
     & inex_iii(i3,i1,i4)%a(1,1)+u3_2(i2)%a(2,2)*clinex_iii(i3,i
     & 1,i4)%b(2,1))
      u32_718(i2,i3,i1,i4)%b(2,1)=u3_2(i2)%b(2,1)*clinex_iii(i3,
     & i1,i4)%a(1,1)+u3_2(i2)%d(2,2)*s32*clinex_iii(i3,i1,i4)%b(
     & 2,1)
      u32_718(i2,i3,i1,i4)%c(2,1)=u3_2(i2)%c(2,1)*s32*clinex_iii
     & (i3,i1,i4)%d(1,1)+u3_2(i2)%a(2,2)*clinex_iii(i3,i1,i4)%c(
     & 2,1)
      u32_718(i2,i3,i1,i4)%d(2,1)=rmass(id3)*(u3_2(i2)%b(2,1)*cl
     & inex_iii(i3,i1,i4)%d(1,1)+u3_2(i2)%d(2,2)*clinex_iii(i3,i
     & 1,i4)%c(2,1))
      u32_718(i2,i3,i1,i4)%a(2,2)=u3_2(i2)%c(2,1)*s32*clinex_iii
     & (i3,i1,i4)%b(1,2)+u3_2(i2)%a(2,2)*clinex_iii(i3,i1,i4)%a(
     & 2,2)
      u32_718(i2,i3,i1,i4)%b(2,2)=rmass(id3)*(u3_2(i2)%b(2,1)*cl
     & inex_iii(i3,i1,i4)%b(1,2)+u3_2(i2)%d(2,2)*clinex_iii(i3,i
     & 1,i4)%a(2,2))
      u32_718(i2,i3,i1,i4)%c(2,2)=rmass(id3)*(u3_2(i2)%c(2,1)*cl
     & inex_iii(i3,i1,i4)%c(1,2)+u3_2(i2)%a(2,2)*clinex_iii(i3,i
