     & (i2)%e(mu)+vwp(mu)*caux
      end do
      end do
      end do
      do i1=1,2
      do i2=1,2
* pk0 -- p=ctrip12(i1,i2)%e
      ctrip12(i1,i2)%ek0=ctrip12(i1,i2)%e(0)-ctrip12(i1,i2)%e(1)
      end do
      end do
  
* momenta for two-gluon outmost insertions                              
      do mu=0,3
         p312(mu)=p3(mu)+p12(mu)
         p124(mu)=-p12(mu)-p4(mu)
      enddo
  
* pk0 -- p=p312
      p312k0=p312(0)-p312(1)
* p.q -- p.q=s312,p=p312,q=p312,bef=,aft=
      s312=(p312(0)*p312(0)-p312(1)*p312(1)-p312(2)*p312(2)-p312
     & (3)*p312(3))
      f312=(s312-rmass2(id3))*p312k0
  
* pk0 -- p=p124
      p124k0=p124(0)-p124(1)
* p.q -- p.q=s124,p=p124,q=p124,bef=,aft=
      s124=(p124(0)*p124(0)-p124(1)*p124(1)-p124(2)*p124(2)-p124
     & (3)*p124(3))
      f124=(s124-rmass2(id4))*p124k0
  
      do mu=0,3
         p512(mu)=p5(mu)+p12(mu)
         p126(mu)=-p12(mu)-p6(mu)
      enddo
  
* pk0 -- p=p512
      p512k0=p512(0)-p512(1)
* p.q -- p.q=s512,p=p512,q=p512,bef=,aft=
      s512=(p512(0)*p512(0)-p512(1)*p512(1)-p512(2)*p512(2)-p512
     & (3)*p512(3))
      f512=(s512-rmass2(id5))*p512k0
  
* pk0 -- p=p126
      p126k0=p126(0)-p126(1)
* p.q -- p.q=s126,p=p126,q=p126,bef=,aft=
      s126=(p126(0)*p126(0)-p126(1)*p126(1)-p126(2)*p126(2)-p126
     & (3)*p126(3))
      f126=(s126-rmass2(id6))*p126k0
  
      do mu=0,3
         p712(mu)=p7(mu)+p12(mu)
         p128(mu)=-p12(mu)-p8(mu)
      enddo
  
* pk0 -- p=p712
      p712k0=p712(0)-p712(1)
* p.q -- p.q=s712,p=p712,q=p712,bef=,aft=
      s712=(p712(0)*p712(0)-p712(1)*p712(1)-p712(2)*p712(2)-p712
     & (3)*p712(3))
      f712=(s712-rmass2(id7))*p712k0
  
* pk0 -- p=p128
      p128k0=p128(0)-p128(1)
* p.q -- p.q=s128,p=p128,q=p128,bef=,aft=
      s128=(p128(0)*p128(0)-p128(1)*p128(1)-p128(2)*p128(2)-p128
     & (3)*p128(3))
      f128=(s128-rmass2(id8))*p128k0
  
  
* two gluon-outmost insertions                                          
      if (iquark(id3).eq.1) then
  
* triple vertex                                                         
         quqd=(s312+rmass2(id3)-s12)/2d0
      ccr=(gs*gs)/(f312*s12)
      ccl=(gs*gs)/(f312*s12)
      do i1=1,2
      do i2=1,2
* T -- qu=p3,qd=p312,v=ctrip12(i1,i2)%e,a=clinet_ii(i1,i2)%a,b=clinet_ii
* (i1,i2)%b,c=clinet_ii(i1,i2)%c,d=clinet_ii(i1,i2)%d,cr=ccr,cl=ccl,nsum
* =0
      ceps_0=-ctrip12(i1,i2)%ek0*(p3(2)*p312(3)-p312(2)*p3(3))+p
     & 3k0*(ctrip12(i1,i2)%e(2)*p312(3)-p312(2)*ctrip12(i1,i2)%e
     & (3))-p312k0*(ctrip12(i1,i2)%e(2)*p3(3)-p3(2)*ctrip12(i1,i
     & 2)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ctrip12(i1,i2)%e(3)*p3k0+p3(3)*ctrip12(i1,i2)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-ctrip12(i1,i2)%e(3)*p312k0+p312(3)*ctrip12(i1,i2)%
     & ek0
      ceps_2=ceps_2*cim
      cvqu=ctrip12(i1,i2)%e(0)*p3(0)-ctrip12(i1,i2)%e(1)*p3(1)-c
     & trip12(i1,i2)%e(2)*p3(2)-ctrip12(i1,i2)%e(3)*p3(3)
      cvqd=ctrip12(i1,i2)%e(0)*p312(0)-ctrip12(i1,i2)%e(1)*p312(
     & 1)-ctrip12(i1,i2)%e(2)*p312(2)-ctrip12(i1,i2)%e(3)*p312(3
     & )
      cauxa=-ctrip12(i1,i2)%ek0*quqd+p3k0*cvqd+p312k0*cvqu
      cauxb=-ctrip12(i1,i2)%ek0*p312(2)+p312k0*ctrip12(i1,i2)%e(
     & 2)
      cauxc=+ctrip12(i1,i2)%ek0*p3(2)-p3k0*ctrip12(i1,i2)%e(2)
      clinet_ii(i1,i2)%a(1,1)=ccr*(cauxa+ceps_0)
      clinet_ii(i1,i2)%a(2,2)=ccl*(cauxa-ceps_0)
      clinet_ii(i1,i2)%b(1,2)=ccl*(cauxb-ceps_2)
      clinet_ii(i1,i2)%b(2,1)=ccr*(-cauxb-ceps_2)
      clinet_ii(i1,i2)%c(1,2)=ccr*(cauxc+ceps_1)
      clinet_ii(i1,i2)%c(2,1)=ccl*(-cauxc+ceps_1)
      clinet_ii(i1,i2)%d(1,1)=ccl*ctrip12(i1,i2)%ek0
      clinet_ii(i1,i2)%d(2,2)=ccr*ctrip12(i1,i2)%ek0
      end do
      end do
  
*                                                                       
*                                                                       
*       | 1    | 2                                                      
*       |       |                                                       
*  3 ------------------                                                 
  
* t for 2 insertion                                                     
      quqd=(s312+s31)/2d0
      ccr=gs/(f312)
      ccl=gs/(f312)
      do i=1,2
* T -- qu=p31,qd=p312,v=ce2(i)%e,a=clinet_i(i)%a,b=clinet_i(i)%b,c=cline
* t_i(i)%c,d=clinet_i(i)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-ce2(i)%ek0*(p31(2)*p312(3)-p312(2)*p31(3))+p31k0*(
     & ce2(i)%e(2)*p312(3)-p312(2)*ce2(i)%e(3))-p312k0*(ce2(i)%e
     & (2)*p31(3)-p31(2)*ce2(i)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ce2(i)%e(3)*p31k0+p31(3)*ce2(i)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-ce2(i)%e(3)*p312k0+p312(3)*ce2(i)%ek0
      ceps_2=ceps_2*cim
      cvqu=ce2(i)%e(0)*p31(0)-ce2(i)%e(1)*p31(1)-ce2(i)%e(2)*p31
     & (2)-ce2(i)%e(3)*p31(3)
      cvqd=ce2(i)%e(0)*p312(0)-ce2(i)%e(1)*p312(1)-ce2(i)%e(2)*p
     & 312(2)-ce2(i)%e(3)*p312(3)
      cauxa=-ce2(i)%ek0*quqd+p31k0*cvqd+p312k0*cvqu
      cauxb=-ce2(i)%ek0*p312(2)+p312k0*ce2(i)%e(2)
      cauxc=+ce2(i)%ek0*p31(2)-p31k0*ce2(i)%e(2)
      clinet_i(i)%a(1,1)=ccr*(cauxa+ceps_0)
      clinet_i(i)%a(2,2)=ccl*(cauxa-ceps_0)
      clinet_i(i)%b(1,2)=ccl*(cauxb-ceps_2)
      clinet_i(i)%b(2,1)=ccr*(-cauxb-ceps_2)
      clinet_i(i)%c(1,2)=ccr*(cauxc+ceps_1)
      clinet_i(i)%c(2,1)=ccl*(-cauxc+ceps_1)
      clinet_i(i)%d(1,1)=ccl*ce2(i)%ek0
      clinet_i(i)%d(2,2)=ccr*ce2(i)%ek0
      end do
  
      do i1=1,2
      do i2=1,2
* TT -- aa=u3_12(i1,i2)%a,bb=u3_12(i1,i2)%b,cc=u3_12(i1,i2)%c,dd=u3_12(i
* 1,i2)%d,a1=u3_1(i1)%a,b1=u3_1(i1)%b,c1=u3_1(i1)%c,d1=u3_1(i1)%d,a2=cli
* net_i(i2)%a,b2=clinet_i(i2)%b,c2=clinet_i(i2)%c,d2=clinet_i(i2)%d,prq=
* s31,m=rmass(id3),nsum=0
      u3_12(i1,i2)%a(1,1)=u3_1(i1)%a(1,1)*clinet_i(i2)%a(1,1)+u3
     & _1(i1)%c(1,2)*s31*clinet_i(i2)%b(2,1)
      u3_12(i1,i2)%b(1,1)=rmass(id3)*(u3_1(i1)%d(1,1)*clinet_i(i
     & 2)%a(1,1)+u3_1(i1)%b(1,2)*clinet_i(i2)%b(2,1))
      u3_12(i1,i2)%c(1,1)=rmass(id3)*(u3_1(i1)%a(1,1)*clinet_i(i
     & 2)%d(1,1)+u3_1(i1)%c(1,2)*clinet_i(i2)%c(2,1))
      u3_12(i1,i2)%d(1,1)=u3_1(i1)%d(1,1)*s31*clinet_i(i2)%d(1,1
     & )+u3_1(i1)%b(1,2)*clinet_i(i2)%c(2,1)
      u3_12(i1,i2)%a(1,2)=rmass(id3)*(u3_1(i1)%a(1,1)*clinet_i(i
     & 2)%b(1,2)+u3_1(i1)%c(1,2)*clinet_i(i2)%a(2,2))
      u3_12(i1,i2)%b(1,2)=u3_1(i1)%d(1,1)*s31*clinet_i(i2)%b(1,2
     & )+u3_1(i1)%b(1,2)*clinet_i(i2)%a(2,2)
      u3_12(i1,i2)%c(1,2)=u3_1(i1)%a(1,1)*clinet_i(i2)%c(1,2)+u3
     & _1(i1)%c(1,2)*s31*clinet_i(i2)%d(2,2)
      u3_12(i1,i2)%d(1,2)=rmass(id3)*(u3_1(i1)%d(1,1)*clinet_i(i
     & 2)%c(1,2)+u3_1(i1)%b(1,2)*clinet_i(i2)%d(2,2))
      u3_12(i1,i2)%a(2,1)=rmass(id3)*(u3_1(i1)%c(2,1)*clinet_i(i
     & 2)%a(1,1)+u3_1(i1)%a(2,2)*clinet_i(i2)%b(2,1))
      u3_12(i1,i2)%b(2,1)=u3_1(i1)%b(2,1)*clinet_i(i2)%a(1,1)+u3
     & _1(i1)%d(2,2)*s31*clinet_i(i2)%b(2,1)
      u3_12(i1,i2)%c(2,1)=u3_1(i1)%c(2,1)*s31*clinet_i(i2)%d(1,1
     & )+u3_1(i1)%a(2,2)*clinet_i(i2)%c(2,1)
      u3_12(i1,i2)%d(2,1)=rmass(id3)*(u3_1(i1)%b(2,1)*clinet_i(i
     & 2)%d(1,1)+u3_1(i1)%d(2,2)*clinet_i(i2)%c(2,1))
      u3_12(i1,i2)%a(2,2)=u3_1(i1)%c(2,1)*s31*clinet_i(i2)%b(1,2
     & )+u3_1(i1)%a(2,2)*clinet_i(i2)%a(2,2)
      u3_12(i1,i2)%b(2,2)=rmass(id3)*(u3_1(i1)%b(2,1)*clinet_i(i
     & 2)%b(1,2)+u3_1(i1)%d(2,2)*clinet_i(i2)%a(2,2))
      u3_12(i1,i2)%c(2,2)=rmass(id3)*(u3_1(i1)%c(2,1)*clinet_i(i
     & 2)%c(1,2)+u3_1(i1)%a(2,2)*clinet_i(i2)%d(2,2))
      u3_12(i1,i2)%d(2,2)=u3_1(i1)%b(2,1)*clinet_i(i2)%c(1,2)+u3
     & _1(i1)%d(2,2)*s31*clinet_i(i2)%d(2,2)
      end do
      end do
  
* Add/Subtract triple vertex contribution                               
      do i1=1,2
         do i2=1,2
           u3_12(i1,i2)%a(1,1)=u3_12(i1,i2)%a(1,1)
     &           + clinet_ii(i1,i2)%a(1,1)
           u3_12(i1,i2)%a(2,2)=u3_12(i1,i2)%a(2,2)
     &          + clinet_ii(i1,i2)%a(2,2)
  
           u3_12(i1,i2)%b(1,2)=u3_12(i1,i2)%b(1,2)
     &          + clinet_ii(i1,i2)%b(1,2)
           u3_12(i1,i2)%b(2,1)=u3_12(i1,i2)%b(2,1)
     &          + clinet_ii(i1,i2)%b(2,1)
  
           u3_12(i1,i2)%c(1,2)=u3_12(i1,i2)%c(1,2)
     &          + clinet_ii(i1,i2)%c(1,2)
           u3_12(i1,i2)%c(2,1)=u3_12(i1,i2)%c(2,1)
     &          + clinet_ii(i1,i2)%c(2,1)
  
           u3_12(i1,i2)%d(1,1)=u3_12(i1,i2)%d(1,1)
     &          + clinet_ii(i1,i2)%d(1,1)
           u3_12(i1,i2)%d(2,2)=u3_12(i1,i2)%d(2,2)
     &          + clinet_ii(i1,i2)%d(2,2)
         enddo
      enddo
*                                                                       
*                                                                       
*       | 2    | 1                                                      
*       |       |                                                       
*  3 ------------------                                                 
  
* t for 1 insertion                                                     
      quqd=(s312+s32)/2d0
      ccr=gs/(f312)
      ccl=gs/(f312)
      do i=1,2
* T -- qu=p32,qd=p312,v=ce1(i)%e,a=clinet_i(i)%a,b=clinet_i(i)%b,c=cline
* t_i(i)%c,d=clinet_i(i)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-ce1(i)%ek0*(p32(2)*p312(3)-p312(2)*p32(3))+p32k0*(
     & ce1(i)%e(2)*p312(3)-p312(2)*ce1(i)%e(3))-p312k0*(ce1(i)%e
     & (2)*p32(3)-p32(2)*ce1(i)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ce1(i)%e(3)*p32k0+p32(3)*ce1(i)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-ce1(i)%e(3)*p312k0+p312(3)*ce1(i)%ek0
      ceps_2=ceps_2*cim
      cvqu=ce1(i)%e(0)*p32(0)-ce1(i)%e(1)*p32(1)-ce1(i)%e(2)*p32
     & (2)-ce1(i)%e(3)*p32(3)
      cvqd=ce1(i)%e(0)*p312(0)-ce1(i)%e(1)*p312(1)-ce1(i)%e(2)*p
     & 312(2)-ce1(i)%e(3)*p312(3)
      cauxa=-ce1(i)%ek0*quqd+p32k0*cvqd+p312k0*cvqu
      cauxb=-ce1(i)%ek0*p312(2)+p312k0*ce1(i)%e(2)
      cauxc=+ce1(i)%ek0*p32(2)-p32k0*ce1(i)%e(2)
      clinet_i(i)%a(1,1)=ccr*(cauxa+ceps_0)
      clinet_i(i)%a(2,2)=ccl*(cauxa-ceps_0)
      clinet_i(i)%b(1,2)=ccl*(cauxb-ceps_2)
      clinet_i(i)%b(2,1)=ccr*(-cauxb-ceps_2)
      clinet_i(i)%c(1,2)=ccr*(cauxc+ceps_1)
      clinet_i(i)%c(2,1)=ccl*(-cauxc+ceps_1)
      clinet_i(i)%d(1,1)=ccl*ce1(i)%ek0
      clinet_i(i)%d(2,2)=ccr*ce1(i)%ek0
      end do
  
      do i1=1,2
      do i2=1,2
* TT -- aa=u3_21(i1,i2)%a,bb=u3_21(i1,i2)%b,cc=u3_21(i1,i2)%c,dd=u3_21(i
* 1,i2)%d,a1=u3_2(i1)%a,b1=u3_2(i1)%b,c1=u3_2(i1)%c,d1=u3_2(i1)%d,a2=cli
* net_i(i2)%a,b2=clinet_i(i2)%b,c2=clinet_i(i2)%c,d2=clinet_i(i2)%d,prq=
* s32,m=rmass(id3),nsum=0
      u3_21(i1,i2)%a(1,1)=u3_2(i1)%a(1,1)*clinet_i(i2)%a(1,1)+u3
     & _2(i1)%c(1,2)*s32*clinet_i(i2)%b(2,1)
      u3_21(i1,i2)%b(1,1)=rmass(id3)*(u3_2(i1)%d(1,1)*clinet_i(i
     & 2)%a(1,1)+u3_2(i1)%b(1,2)*clinet_i(i2)%b(2,1))
      u3_21(i1,i2)%c(1,1)=rmass(id3)*(u3_2(i1)%a(1,1)*clinet_i(i
     & 2)%d(1,1)+u3_2(i1)%c(1,2)*clinet_i(i2)%c(2,1))
      u3_21(i1,i2)%d(1,1)=u3_2(i1)%d(1,1)*s32*clinet_i(i2)%d(1,1
     & )+u3_2(i1)%b(1,2)*clinet_i(i2)%c(2,1)
      u3_21(i1,i2)%a(1,2)=rmass(id3)*(u3_2(i1)%a(1,1)*clinet_i(i
     & 2)%b(1,2)+u3_2(i1)%c(1,2)*clinet_i(i2)%a(2,2))
      u3_21(i1,i2)%b(1,2)=u3_2(i1)%d(1,1)*s32*clinet_i(i2)%b(1,2
     & )+u3_2(i1)%b(1,2)*clinet_i(i2)%a(2,2)
      u3_21(i1,i2)%c(1,2)=u3_2(i1)%a(1,1)*clinet_i(i2)%c(1,2)+u3
     & _2(i1)%c(1,2)*s32*clinet_i(i2)%d(2,2)
      u3_21(i1,i2)%d(1,2)=rmass(id3)*(u3_2(i1)%d(1,1)*clinet_i(i
     & 2)%c(1,2)+u3_2(i1)%b(1,2)*clinet_i(i2)%d(2,2))
      u3_21(i1,i2)%a(2,1)=rmass(id3)*(u3_2(i1)%c(2,1)*clinet_i(i
     & 2)%a(1,1)+u3_2(i1)%a(2,2)*clinet_i(i2)%b(2,1))
      u3_21(i1,i2)%b(2,1)=u3_2(i1)%b(2,1)*clinet_i(i2)%a(1,1)+u3
     & _2(i1)%d(2,2)*s32*clinet_i(i2)%b(2,1)
      u3_21(i1,i2)%c(2,1)=u3_2(i1)%c(2,1)*s32*clinet_i(i2)%d(1,1
     & )+u3_2(i1)%a(2,2)*clinet_i(i2)%c(2,1)
      u3_21(i1,i2)%d(2,1)=rmass(id3)*(u3_2(i1)%b(2,1)*clinet_i(i
     & 2)%d(1,1)+u3_2(i1)%d(2,2)*clinet_i(i2)%c(2,1))
      u3_21(i1,i2)%a(2,2)=u3_2(i1)%c(2,1)*s32*clinet_i(i2)%b(1,2
     & )+u3_2(i1)%a(2,2)*clinet_i(i2)%a(2,2)
      u3_21(i1,i2)%b(2,2)=rmass(id3)*(u3_2(i1)%b(2,1)*clinet_i(i
     & 2)%b(1,2)+u3_2(i1)%d(2,2)*clinet_i(i2)%a(2,2))
      u3_21(i1,i2)%c(2,2)=rmass(id3)*(u3_2(i1)%c(2,1)*clinet_i(i
     & 2)%c(1,2)+u3_2(i1)%a(2,2)*clinet_i(i2)%d(2,2))
      u3_21(i1,i2)%d(2,2)=u3_2(i1)%b(2,1)*clinet_i(i2)%c(1,2)+u3
     & _2(i1)%d(2,2)*s32*clinet_i(i2)%d(2,2)
      end do
      end do
  
* Add/Subtract triple vertex contribution                               
      do i1=1,2
         do i2=1,2
           u3_21(i2,i1)%a(1,1)=u3_21(i2,i1)%a(1,1)
     &           - clinet_ii(i1,i2)%a(1,1)
           u3_21(i2,i1)%a(2,2)=u3_21(i2,i1)%a(2,2)
     &          - clinet_ii(i1,i2)%a(2,2)
  
           u3_21(i2,i1)%b(1,2)=u3_21(i2,i1)%b(1,2)
