      cvqd=ce2(i)%e(0)*p712(0)-ce2(i)%e(1)*p712(1)-ce2(i)%e(2)*p
     & 712(2)-ce2(i)%e(3)*p712(3)
      cauxa=-ce2(i)%ek0*quqd+p71k0*cvqd+p712k0*cvqu
      cauxb=-ce2(i)%ek0*p712(2)+p712k0*ce2(i)%e(2)
