      u7_12(i1,i2)%b(2,1)=u7_1(i1)%b(2,1)*clinet_i(i2)%a(1,1)+u7
     & _1(i1)%d(2,2)*s71*clinet_i(i2)%b(2,1)
      u7_12(i1,i2)%c(2,1)=u7_1(i1)%c(2,1)*s71*clinet_i(i2)%d(1,1
     & )+u7_1(i1)%a(2,2)*clinet_i(i2)%c(2,1)
      u7_12(i1,i2)%d(2,1)=rmass(id7)*(u7_1(i1)%b(2,1)*clinet_i(i
     & 2)%d(1,1)+u7_1(i1)%d(2,2)*clinet_i(i2)%c(2,1))
      u7_12(i1,i2)%a(2,2)=u7_1(i1)%c(2,1)*s71*clinet_i(i2)%b(1,2
     & )+u7_1(i1)%a(2,2)*clinet_i(i2)%a(2,2)
      u7_12(i1,i2)%b(2,2)=rmass(id7)*(u7_1(i1)%b(2,1)*clinet_i(i
     & 2)%b(1,2)+u7_1(i1)%d(2,2)*clinet_i(i2)%a(2,2))
      u7_12(i1,i2)%c(2,2)=rmass(id7)*(u7_1(i1)%c(2,1)*clinet_i(i
     & 2)%c(1,2)+u7_1(i1)%a(2,2)*clinet_i(i2)%d(2,2))
      u7_12(i1,i2)%d(2,2)=u7_1(i1)%b(2,1)*clinet_i(i2)%c(1,2)+u7
     & _1(i1)%d(2,2)*s71*clinet_i(i2)%d(2,2)
