           u7_12(i1,i2)%c(1,2)=u7_12(i1,i2)%c(1,2)
     &          + clinet_ii(i1,i2)%c(1,2)
           u7_12(i1,i2)%c(2,1)=u7_12(i1,i2)%c(2,1)
