      ccl=gs/(f712)
      do i=1,2
* T -- qu=p72,qd=p712,v=ce1(i)%e,a=clinet_i(i)%a,b=clinet_i(i)%b,c=cline
* t_i(i)%c,d=clinet_i(i)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-ce1(i)%ek0*(p72(2)*p712(3)-p712(2)*p72(3))+p72k0*(
     & ce1(i)%e(2)*p712(3)-p712(2)*ce1(i)%e(3))-p712k0*(ce1(i)%e
     & (2)*p72(3)-p72(2)*ce1(i)%e(3))
