      do i1=1,2
      do i2=1,2
* TT -- aa=u7_21(i1,i2)%a,bb=u7_21(i1,i2)%b,cc=u7_21(i1,i2)%c,dd=u7_21(i
* 1,i2)%d,a1=u7_2(i1)%a,b1=u7_2(i1)%b,c1=u7_2(i1)%c,d1=u7_2(i1)%d,a2=cli
