* t_i(i)%c,d=clinet_i(i)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-ce1(i)%ek0*(p124(2)*p24(3)-p24(2)*p124(3))+p124k0*
     & (ce1(i)%e(2)*p24(3)-p24(2)*ce1(i)%e(3))-p24k0*(ce1(i)%e(2
     & )*p124(3)-p124(2)*ce1(i)%e(3))
