      cvqd=ce1(i)%e(0)*p24(0)-ce1(i)%e(1)*p24(1)-ce1(i)%e(2)*p24
     & (2)-ce1(i)%e(3)*p24(3)
      cauxa=-ce1(i)%ek0*quqd+p124k0*cvqd+p24k0*cvqu
      cauxb=-ce1(i)%ek0*p24(2)+p24k0*ce1(i)%e(2)
      cauxc=+ce1(i)%ek0*p124(2)-p124k0*ce1(i)%e(2)
      clinet_i(i)%a(1,1)=ccr*(cauxa+ceps_0)
      clinet_i(i)%a(2,2)=ccl*(cauxa-ceps_0)
      clinet_i(i)%b(1,2)=ccl*(cauxb-ceps_2)
      clinet_i(i)%b(2,1)=ccr*(-cauxb-ceps_2)
      clinet_i(i)%c(1,2)=ccr*(cauxc+ceps_1)
      clinet_i(i)%c(2,1)=ccl*(-cauxc+ceps_1)
