      d4_12(i1,i2)%b(2,1)=clinet_i(i1)%b(2,1)*d4_2(i2)%a(1,1)+cl
     & inet_i(i1)%d(2,2)*s24*d4_2(i2)%b(2,1)
      d4_12(i1,i2)%c(2,1)=clinet_i(i1)%c(2,1)*s24*d4_2(i2)%d(1,1
     & )+clinet_i(i1)%a(2,2)*d4_2(i2)%c(2,1)
      d4_12(i1,i2)%d(2,1)=rmass(id4)*(clinet_i(i1)%b(2,1)*d4_2(i
     & 2)%d(1,1)+clinet_i(i1)%d(2,2)*d4_2(i2)%c(2,1))
      d4_12(i1,i2)%a(2,2)=clinet_i(i1)%c(2,1)*s24*d4_2(i2)%b(1,2
     & )+clinet_i(i1)%a(2,2)*d4_2(i2)%a(2,2)
      d4_12(i1,i2)%b(2,2)=rmass(id4)*(clinet_i(i1)%b(2,1)*d4_2(i
     & 2)%b(1,2)+clinet_i(i1)%d(2,2)*d4_2(i2)%a(2,2))
      d4_12(i1,i2)%c(2,2)=rmass(id4)*(clinet_i(i1)%c(2,1)*d4_2(i
     & 2)%c(1,2)+clinet_i(i1)%a(2,2)*d4_2(i2)%d(2,2))
      d4_12(i1,i2)%d(2,2)=clinet_i(i1)%b(2,1)*d4_2(i2)%c(1,2)+cl
     & inet_i(i1)%d(2,2)*s24*d4_2(i2)%d(2,2)
      end do
      end do
  
* Add/Subtract triple vertex contribution                               
      do i1=1,2
         do i2=1,2
           d4_12(i1,i2)%a(1,1)=d4_12(i1,i2)%a(1,1)
     &           + clinet_ii(i1,i2)%a(1,1)
           d4_12(i1,i2)%a(2,2)=d4_12(i1,i2)%a(2,2)
