      do i=1,2
* T -- qu=p124,qd=p14,v=ce2(i)%e,a=clinet_i(i)%a,b=clinet_i(i)%b,c=cline
* t_i(i)%c,d=clinet_i(i)%d,cr=ccr,cl=ccl,nsum=0
