      do i1=1,2
      do i2=1,2
* TT -- aa=d4_21(i1,i2)%a,bb=d4_21(i1,i2)%b,cc=d4_21(i1,i2)%c,dd=d4_21(i
* 1,i2)%d,a1=clinet_i(i1)%a,b1=clinet_i(i1)%b,c1=clinet_i(i1)%c,d1=cline
* t_i(i1)%d,a2=d4_1(i2)%a,b2=d4_1(i2)%b,c2=d4_1(i2)%c,d2=d4_1(i2)%d,prq=
