      d4_21(i1,i2)%b(1,1)=rmass(id4)*(clinet_i(i1)%d(1,1)*d4_1(i
     & 2)%a(1,1)+clinet_i(i1)%b(1,2)*d4_1(i2)%b(2,1))
      d4_21(i1,i2)%c(1,1)=rmass(id4)*(clinet_i(i1)%a(1,1)*d4_1(i
     & 2)%d(1,1)+clinet_i(i1)%c(1,2)*d4_1(i2)%c(2,1))
      d4_21(i1,i2)%d(1,1)=clinet_i(i1)%d(1,1)*s14*d4_1(i2)%d(1,1
     & )+clinet_i(i1)%b(1,2)*d4_1(i2)%c(2,1)
      d4_21(i1,i2)%a(1,2)=rmass(id4)*(clinet_i(i1)%a(1,1)*d4_1(i
     & 2)%b(1,2)+clinet_i(i1)%c(1,2)*d4_1(i2)%a(2,2))
      d4_21(i1,i2)%b(1,2)=clinet_i(i1)%d(1,1)*s14*d4_1(i2)%b(1,2
     & )+clinet_i(i1)%b(1,2)*d4_1(i2)%a(2,2)
      d4_21(i1,i2)%c(1,2)=clinet_i(i1)%a(1,1)*d4_1(i2)%c(1,2)+cl
     & inet_i(i1)%c(1,2)*s14*d4_1(i2)%d(2,2)
      d4_21(i1,i2)%d(1,2)=rmass(id4)*(clinet_i(i1)%d(1,1)*d4_1(i
     & 2)%c(1,2)+clinet_i(i1)%b(1,2)*d4_1(i2)%d(2,2))
      d4_21(i1,i2)%a(2,1)=rmass(id4)*(clinet_i(i1)%c(2,1)*d4_1(i
     & 2)%a(1,1)+clinet_i(i1)%a(2,2)*d4_1(i2)%b(2,1))
      d4_21(i1,i2)%b(2,1)=clinet_i(i1)%b(2,1)*d4_1(i2)%a(1,1)+cl
