     &          - clinet_ii(i1,i2)%c(1,2)
           d4_21(i2,i1)%c(2,1)=d4_21(i2,i1)%c(2,1)
     &          - clinet_ii(i1,i2)%c(2,1)
  
           d4_21(i2,i1)%d(1,1)=d4_21(i2,i1)%d(1,1)
     &          - clinet_ii(i1,i2)%d(1,1)
           d4_21(i2,i1)%d(2,2)=d4_21(i2,i1)%d(2,2)
     &          - clinet_ii(i1,i2)%d(2,2)
         enddo
