      ceps_2=-ctrip12(i1,i2)%e(3)*p6k0+p6(3)*ctrip12(i1,i2)%ek0
      ceps_2=ceps_2*cim
      cvqu=ctrip12(i1,i2)%e(0)*p126(0)-ctrip12(i1,i2)%e(1)*p126(
     & 1)-ctrip12(i1,i2)%e(2)*p126(2)-ctrip12(i1,i2)%e(3)*p126(3
     & )
      cvqd=ctrip12(i1,i2)%e(0)*p6(0)-ctrip12(i1,i2)%e(1)*p6(1)-c
     & trip12(i1,i2)%e(2)*p6(2)-ctrip12(i1,i2)%e(3)*p6(3)
      cauxa=-ctrip12(i1,i2)%ek0*quqd+p126k0*cvqd+p6k0*cvqu
      cauxb=-ctrip12(i1,i2)%ek0*p6(2)+p6k0*ctrip12(i1,i2)%e(2)
      cauxc=+ctrip12(i1,i2)%ek0*p126(2)-p126k0*ctrip12(i1,i2)%e(
     & 2)
      clinet_ii(i1,i2)%a(1,1)=ccr*(cauxa+ceps_0)
      clinet_ii(i1,i2)%a(2,2)=ccl*(cauxa-ceps_0)
      clinet_ii(i1,i2)%b(1,2)=ccl*(cauxb-ceps_2)
      clinet_ii(i1,i2)%b(2,1)=ccr*(-cauxb-ceps_2)
      clinet_ii(i1,i2)%c(1,2)=ccr*(cauxc+ceps_1)
      clinet_ii(i1,i2)%c(2,1)=ccl*(-cauxc+ceps_1)
      clinet_ii(i1,i2)%d(1,1)=ccl*ctrip12(i1,i2)%ek0
      clinet_ii(i1,i2)%d(2,2)=ccr*ctrip12(i1,i2)%ek0
