      do i=1,2
* T -- qu=p126,qd=p26,v=ce1(i)%e,a=clinet_i(i)%a,b=clinet_i(i)%b,c=cline
* t_i(i)%c,d=clinet_i(i)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-ce1(i)%ek0*(p126(2)*p26(3)-p26(2)*p126(3))+p126k0*
