      d8_12(i1,i2)%d(1,1)=clinet_i(i1)%d(1,1)*s28*d8_2(i2)%d(1,1
     & )+clinet_i(i1)%b(1,2)*d8_2(i2)%c(2,1)
      d8_12(i1,i2)%a(1,2)=rmass(id8)*(clinet_i(i1)%a(1,1)*d8_2(i
     & 2)%b(1,2)+clinet_i(i1)%c(1,2)*d8_2(i2)%a(2,2))
      d8_12(i1,i2)%b(1,2)=clinet_i(i1)%d(1,1)*s28*d8_2(i2)%b(1,2
     & )+clinet_i(i1)%b(1,2)*d8_2(i2)%a(2,2)
      d8_12(i1,i2)%c(1,2)=clinet_i(i1)%a(1,1)*d8_2(i2)%c(1,2)+cl
     & inet_i(i1)%c(1,2)*s28*d8_2(i2)%d(2,2)
      d8_12(i1,i2)%d(1,2)=rmass(id8)*(clinet_i(i1)%d(1,1)*d8_2(i
     & 2)%c(1,2)+clinet_i(i1)%b(1,2)*d8_2(i2)%d(2,2))
      d8_12(i1,i2)%a(2,1)=rmass(id8)*(clinet_i(i1)%c(2,1)*d8_2(i
     & 2)%a(1,1)+clinet_i(i1)%a(2,2)*d8_2(i2)%b(2,1))
      d8_12(i1,i2)%b(2,1)=clinet_i(i1)%b(2,1)*d8_2(i2)%a(1,1)+cl
     & inet_i(i1)%d(2,2)*s28*d8_2(i2)%b(2,1)
      d8_12(i1,i2)%c(2,1)=clinet_i(i1)%c(2,1)*s28*d8_2(i2)%d(1,1
     & )+clinet_i(i1)%a(2,2)*d8_2(i2)%c(2,1)
      d8_12(i1,i2)%d(2,1)=rmass(id8)*(clinet_i(i1)%b(2,1)*d8_2(i
     & 2)%d(1,1)+clinet_i(i1)%d(2,2)*d8_2(i2)%c(2,1))
      d8_12(i1,i2)%a(2,2)=clinet_i(i1)%c(2,1)*s28*d8_2(i2)%b(1,2
     & )+clinet_i(i1)%a(2,2)*d8_2(i2)%a(2,2)
      d8_12(i1,i2)%b(2,2)=rmass(id8)*(clinet_i(i1)%b(2,1)*d8_2(i
     & 2)%b(1,2)+clinet_i(i1)%d(2,2)*d8_2(i2)%a(2,2))
      d8_12(i1,i2)%c(2,2)=rmass(id8)*(clinet_i(i1)%c(2,1)*d8_2(i
     & 2)%c(1,2)+clinet_i(i1)%a(2,2)*d8_2(i2)%d(2,2))
      d8_12(i1,i2)%d(2,2)=clinet_i(i1)%b(2,1)*d8_2(i2)%c(1,2)+cl
     & inet_i(i1)%d(2,2)*s28*d8_2(i2)%d(2,2)
      end do
      end do
  
* Add/Subtract triple vertex contribution                               
      do i1=1,2
         do i2=1,2
           d8_12(i1,i2)%a(1,1)=d8_12(i1,i2)%a(1,1)
     &           + clinet_ii(i1,i2)%a(1,1)
           d8_12(i1,i2)%a(2,2)=d8_12(i1,i2)%a(2,2)
     &          + clinet_ii(i1,i2)%a(2,2)
  
           d8_12(i1,i2)%b(1,2)=d8_12(i1,i2)%b(1,2)
     &          + clinet_ii(i1,i2)%b(1,2)
           d8_12(i1,i2)%b(2,1)=d8_12(i1,i2)%b(2,1)
     &          + clinet_ii(i1,i2)%b(2,1)
  
           d8_12(i1,i2)%c(1,2)=d8_12(i1,i2)%c(1,2)
     &          + clinet_ii(i1,i2)%c(1,2)
           d8_12(i1,i2)%c(2,1)=d8_12(i1,i2)%c(2,1)
     &          + clinet_ii(i1,i2)%c(2,1)
  
           d8_12(i1,i2)%d(1,1)=d8_12(i1,i2)%d(1,1)
     &          + clinet_ii(i1,i2)%d(1,1)
           d8_12(i1,i2)%d(2,2)=d8_12(i1,i2)%d(2,2)
     &          + clinet_ii(i1,i2)%d(2,2)
         enddo
      enddo
*                                                                       
*                                                                       
*            | 2    | 1                                                 
*            |       |                                                  
*          --------------- 8                                            
*                                                                       
*                                                                       
*                                                                       
  
* t for 2 insertion                                                     
      quqd=(s128+s18)/2d0
      ccr=gs/(f128)
      ccl=gs/(f128)
      do i=1,2
* T -- qu=p128,qd=p18,v=ce2(i)%e,a=clinet_i(i)%a,b=clinet_i(i)%b,c=cline
* t_i(i)%c,d=clinet_i(i)%d,cr=ccr,cl=ccl,nsum=0
      ceps_0=-ce2(i)%ek0*(p128(2)*p18(3)-p18(2)*p128(3))+p128k0*
     & (ce2(i)%e(2)*p18(3)-p18(2)*ce2(i)%e(3))-p18k0*(ce2(i)%e(2
     & )*p128(3)-p128(2)*ce2(i)%e(3))
      ceps_0=ceps_0*cim
      ceps_1=-ce2(i)%e(3)*p128k0+p128(3)*ce2(i)%ek0
      ceps_1=ceps_1*cim
      ceps_2=-ce2(i)%e(3)*p18k0+p18(3)*ce2(i)%ek0
      ceps_2=ceps_2*cim
      cvqu=ce2(i)%e(0)*p128(0)-ce2(i)%e(1)*p128(1)-ce2(i)%e(2)*p
     & 128(2)-ce2(i)%e(3)*p128(3)
      cvqd=ce2(i)%e(0)*p18(0)-ce2(i)%e(1)*p18(1)-ce2(i)%e(2)*p18
     & (2)-ce2(i)%e(3)*p18(3)
      cauxa=-ce2(i)%ek0*quqd+p128k0*cvqd+p18k0*cvqu
      cauxb=-ce2(i)%ek0*p18(2)+p18k0*ce2(i)%e(2)
      cauxc=+ce2(i)%ek0*p128(2)-p128k0*ce2(i)%e(2)
      clinet_i(i)%a(1,1)=ccr*(cauxa+ceps_0)
      clinet_i(i)%a(2,2)=ccl*(cauxa-ceps_0)
      clinet_i(i)%b(1,2)=ccl*(cauxb-ceps_2)
      clinet_i(i)%b(2,1)=ccr*(-cauxb-ceps_2)
      clinet_i(i)%c(1,2)=ccr*(cauxc+ceps_1)
      clinet_i(i)%c(2,1)=ccl*(-cauxc+ceps_1)
      clinet_i(i)%d(1,1)=ccl*ce2(i)%ek0
      clinet_i(i)%d(2,2)=ccr*ce2(i)%ek0
      end do
  
      do i1=1,2
      do i2=1,2
* TT -- aa=d8_21(i1,i2)%a,bb=d8_21(i1,i2)%b,cc=d8_21(i1,i2)%c,dd=d8_21(i
* 1,i2)%d,a1=clinet_i(i1)%a,b1=clinet_i(i1)%b,c1=clinet_i(i1)%c,d1=cline
* t_i(i1)%d,a2=d8_1(i2)%a,b2=d8_1(i2)%b,c2=d8_1(i2)%c,d2=d8_1(i2)%d,prq=
* s18,m=rmass(id8),nsum=0
      d8_21(i1,i2)%a(1,1)=clinet_i(i1)%a(1,1)*d8_1(i2)%a(1,1)+cl
     & inet_i(i1)%c(1,2)*s18*d8_1(i2)%b(2,1)
      d8_21(i1,i2)%b(1,1)=rmass(id8)*(clinet_i(i1)%d(1,1)*d8_1(i
     & 2)%a(1,1)+clinet_i(i1)%b(1,2)*d8_1(i2)%b(2,1))
      d8_21(i1,i2)%c(1,1)=rmass(id8)*(clinet_i(i1)%a(1,1)*d8_1(i
     & 2)%d(1,1)+clinet_i(i1)%c(1,2)*d8_1(i2)%c(2,1))
      d8_21(i1,i2)%d(1,1)=clinet_i(i1)%d(1,1)*s18*d8_1(i2)%d(1,1
     & )+clinet_i(i1)%b(1,2)*d8_1(i2)%c(2,1)
      d8_21(i1,i2)%a(1,2)=rmass(id8)*(clinet_i(i1)%a(1,1)*d8_1(i
     & 2)%b(1,2)+clinet_i(i1)%c(1,2)*d8_1(i2)%a(2,2))
      d8_21(i1,i2)%b(1,2)=clinet_i(i1)%d(1,1)*s18*d8_1(i2)%b(1,2
     & )+clinet_i(i1)%b(1,2)*d8_1(i2)%a(2,2)
      d8_21(i1,i2)%c(1,2)=clinet_i(i1)%a(1,1)*d8_1(i2)%c(1,2)+cl
     & inet_i(i1)%c(1,2)*s18*d8_1(i2)%d(2,2)
      d8_21(i1,i2)%d(1,2)=rmass(id8)*(clinet_i(i1)%d(1,1)*d8_1(i
     & 2)%c(1,2)+clinet_i(i1)%b(1,2)*d8_1(i2)%d(2,2))
      d8_21(i1,i2)%a(2,1)=rmass(id8)*(clinet_i(i1)%c(2,1)*d8_1(i
     & 2)%a(1,1)+clinet_i(i1)%a(2,2)*d8_1(i2)%b(2,1))
      d8_21(i1,i2)%b(2,1)=clinet_i(i1)%b(2,1)*d8_1(i2)%a(1,1)+cl
     & inet_i(i1)%d(2,2)*s18*d8_1(i2)%b(2,1)
      d8_21(i1,i2)%c(2,1)=clinet_i(i1)%c(2,1)*s18*d8_1(i2)%d(1,1
     & )+clinet_i(i1)%a(2,2)*d8_1(i2)%c(2,1)
      d8_21(i1,i2)%d(2,1)=rmass(id8)*(clinet_i(i1)%b(2,1)*d8_1(i
     & 2)%d(1,1)+clinet_i(i1)%d(2,2)*d8_1(i2)%c(2,1))
      d8_21(i1,i2)%a(2,2)=clinet_i(i1)%c(2,1)*s18*d8_1(i2)%b(1,2
     & )+clinet_i(i1)%a(2,2)*d8_1(i2)%a(2,2)
      d8_21(i1,i2)%b(2,2)=rmass(id8)*(clinet_i(i1)%b(2,1)*d8_1(i
     & 2)%b(1,2)+clinet_i(i1)%d(2,2)*d8_1(i2)%a(2,2))
      d8_21(i1,i2)%c(2,2)=rmass(id8)*(clinet_i(i1)%c(2,1)*d8_1(i
     & 2)%c(1,2)+clinet_i(i1)%a(2,2)*d8_1(i2)%d(2,2))
      d8_21(i1,i2)%d(2,2)=clinet_i(i1)%b(2,1)*d8_1(i2)%c(1,2)+cl
     & inet_i(i1)%d(2,2)*s18*d8_1(i2)%d(2,2)
      end do
      end do
  
* Add/Subtract triple vertex contribution                               
      do i1=1,2
         do i2=1,2
           d8_21(i2,i1)%a(1,1)=d8_21(i2,i1)%a(1,1)
     &           - clinet_ii(i1,i2)%a(1,1)
           d8_21(i2,i1)%a(2,2)=d8_21(i2,i1)%a(2,2)
     &          - clinet_ii(i1,i2)%a(2,2)
  
           d8_21(i2,i1)%b(1,2)=d8_21(i2,i1)%b(1,2)
     &          - clinet_ii(i1,i2)%b(1,2)
           d8_21(i2,i1)%b(2,1)=d8_21(i2,i1)%b(2,1)
     &          - clinet_ii(i1,i2)%b(2,1)
  
           d8_21(i2,i1)%c(1,2)=d8_21(i2,i1)%c(1,2)
     &          - clinet_ii(i1,i2)%c(1,2)
           d8_21(i2,i1)%c(2,1)=d8_21(i2,i1)%c(2,1)
     &          - clinet_ii(i1,i2)%c(2,1)
  
           d8_21(i2,i1)%d(1,1)=d8_21(i2,i1)%d(1,1)
     &          - clinet_ii(i1,i2)%d(1,1)
           d8_21(i2,i1)%d(2,2)=d8_21(i2,i1)%d(2,2)
     &          - clinet_ii(i1,i2)%d(2,2)
         enddo
      enddo
      endif
  
  
* compute all forks ( Z's, gamma's, higgs's                             
*   "decaying" to two fermions) with two gluons                         
  
* momenta for forks with two gluons                                     
      do mu=0,3
         p1234(mu)=p12(mu)+p34(mu)
      enddo
* p.q -- p.q=s1234,p=p1234,q=p1234,bef=,aft=
      s1234=(p1234(0)*p1234(0)-p1234(1)*p1234(1)-p1234(2)*p1234(
     & 2)-p1234(3)*p1234(3))
      do mu=0,3
         p1256(mu)=p12(mu)+p56(mu)
      enddo
* p.q -- p.q=s1256,p=p1256,q=p1256,bef=,aft=
      s1256=(p1256(0)*p1256(0)-p1256(1)*p1256(1)-p1256(2)*p1256(
     & 2)-p1256(3)*p1256(3))
      do mu=0,3
         p1278(mu)=p12(mu)+p78(mu)
      enddo
* p.q -- p.q=s1278,p=p1278,q=p1278,bef=,aft=
      s1278=(p1278(0)*p1278(0)-p1278(1)*p1278(1)-p1278(2)*p1278(
     & 2)-p1278(3)*p1278(3))
  
  
*      Z's and gammas                                                   
      if (iquark(id3).eq.1) then
  
* t's for Z,f attachement at the end of the 34 line with two gluons     
  
         quqd=(s1234-s312-rmass2(id4))/2d0
* T -- qu=p312,qd=p4,v=0,a=crzlinet_mu(0)%a,b=crzlinet_mu(0)%b,c=crzline
* t_mu(0)%c,d=crzlinet_mu(0)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      eps_0=-p312(2)*p4(3)+p4(2)*p312(3)
      ceps_0=eps_0*cim
      ceps_1=p312(3)*cim
      ceps_2=p4(3)*cim
      auxa=-quqd+p312k0*p4(0)+p4k0*p312(0)
      crzlinet_mu(0)%a(1,1)=zcr(id3)*(auxa+ceps_0)
      crzlinet_mu(0)%a(2,2)=zcl(id3)*(auxa-ceps_0)
      crzlinet_mu(0)%b(1,2)=-zcl(id3)*(p4(2)+ceps_2)
      crzlinet_mu(0)%b(2,1)=zcr(id3)*(p4(2)-ceps_2)
      crzlinet_mu(0)%c(1,2)=zcr(id3)*(p312(2)+ceps_1)
      crzlinet_mu(0)%c(2,1)=zcl(id3)*(-p312(2)+ceps_1)
      crzlinet_mu(0)%d(1,1)=zcl(id3)
      crzlinet_mu(0)%d(2,2)=zcr(id3)
* T -- qu=p312,qd=p4,v=1,a=crzlinet_mu(1)%a,b=crzlinet_mu(1)%b,c=crzline
* t_mu(1)%c,d=crzlinet_mu(1)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      auxa=-quqd+p312k0*p4(1)+p4k0*p312(1)
      crzlinet_mu(1)%a(1,1)=zcr(id3)*(auxa+ceps_0)
      crzlinet_mu(1)%a(2,2)=zcl(id3)*(auxa-ceps_0)
      crzlinet_mu(1)%b(1,2)=-zcl(id3)*(p4(2)+ceps_2)
      crzlinet_mu(1)%b(2,1)=zcr(id3)*(p4(2)-ceps_2)
      crzlinet_mu(1)%c(1,2)=zcr(id3)*(p312(2)+ceps_1)
      crzlinet_mu(1)%c(2,1)=zcl(id3)*(-p312(2)+ceps_1)
      crzlinet_mu(1)%d(1,1)=zcl(id3)
      crzlinet_mu(1)%d(2,2)=zcr(id3)
* T -- qu=p312,qd=p4,v=2,a=crzlinet_mu(2)%a,b=crzlinet_mu(2)%b,c=crzline
* t_mu(2)%c,d=crzlinet_mu(2)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      eps_0=-p312k0*p4(3)+p4k0*p312(3)
      ceps_0=eps_0*cim
      auxa=p312k0*p4(2)+p4k0*p312(2)
      crzlinet_mu(2)%a(1,1)=zcr(id3)*(auxa+ceps_0)
      crzlinet_mu(2)%a(2,2)=zcl(id3)*(auxa-ceps_0)
      crzlinet_mu(2)%b(1,2)=-zcl(id3)*p4k0
      crzlinet_mu(2)%b(2,1)=zcr(id3)*p4k0
      crzlinet_mu(2)%c(1,2)=zcr(id3)*p312k0
      crzlinet_mu(2)%c(2,1)=-zcl(id3)*p312k0
* T -- qu=p312,qd=p4,v=3,a=crzlinet_mu(3)%a,b=crzlinet_mu(3)%b,c=crzline
* t_mu(3)%c,d=crzlinet_mu(3)%d,cr=zcr(id3),cl=zcl(id3),nsum=0
      eps_0=p312k0*p4(2)-p4k0*p312(2)
      ceps_0=eps_0*cim
      ceps_1=p312k0*cim
      ceps_2=p4k0*cim
      auxa=+p312k0*p4(3)+p4k0*p312(3)
      crzlinet_mu(3)%a(1,1)=zcr(id3)*(auxa+ceps_0)
      crzlinet_mu(3)%a(2,2)=zcl(id3)*(auxa-ceps_0)
      crzlinet_mu(3)%b(1,2)=-zcl(id3)*ceps_2
      crzlinet_mu(3)%b(2,1)=-zcr(id3)*ceps_2
      crzlinet_mu(3)%c(1,2)=zcr(id3)*ceps_1
      crzlinet_mu(3)%c(2,1)=zcl(id3)*ceps_1
* T -- qu=p312,qd=p4,v=0,a=crflinet_mu(0)%a,b=crflinet_mu(0)%b,c=crfline
* t_mu(0)%c,d=crflinet_mu(0)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      eps_0=-p312(2)*p4(3)+p4(2)*p312(3)
      ceps_0=eps_0*cim
      ceps_1=p312(3)*cim
      ceps_2=p4(3)*cim
      auxa=-quqd+p312k0*p4(0)+p4k0*p312(0)
      crflinet_mu(0)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      crflinet_mu(0)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      crflinet_mu(0)%b(1,2)=-fcl(id3)*(p4(2)+ceps_2)
      crflinet_mu(0)%b(2,1)=fcr(id3)*(p4(2)-ceps_2)
      crflinet_mu(0)%c(1,2)=fcr(id3)*(p312(2)+ceps_1)
      crflinet_mu(0)%c(2,1)=fcl(id3)*(-p312(2)+ceps_1)
      crflinet_mu(0)%d(1,1)=fcl(id3)
      crflinet_mu(0)%d(2,2)=fcr(id3)
* T -- qu=p312,qd=p4,v=1,a=crflinet_mu(1)%a,b=crflinet_mu(1)%b,c=crfline
* t_mu(1)%c,d=crflinet_mu(1)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      auxa=-quqd+p312k0*p4(1)+p4k0*p312(1)
      crflinet_mu(1)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      crflinet_mu(1)%a(2,2)=fcl(id3)*(auxa-ceps_0)
      crflinet_mu(1)%b(1,2)=-fcl(id3)*(p4(2)+ceps_2)
      crflinet_mu(1)%b(2,1)=fcr(id3)*(p4(2)-ceps_2)
      crflinet_mu(1)%c(1,2)=fcr(id3)*(p312(2)+ceps_1)
      crflinet_mu(1)%c(2,1)=fcl(id3)*(-p312(2)+ceps_1)
      crflinet_mu(1)%d(1,1)=fcl(id3)
      crflinet_mu(1)%d(2,2)=fcr(id3)
* T -- qu=p312,qd=p4,v=2,a=crflinet_mu(2)%a,b=crflinet_mu(2)%b,c=crfline
* t_mu(2)%c,d=crflinet_mu(2)%d,cr=fcr(id3),cl=fcl(id3),nsum=0
      eps_0=-p312k0*p4(3)+p4k0*p312(3)
      ceps_0=eps_0*cim
      auxa=p312k0*p4(2)+p4k0*p312(2)
      crflinet_mu(2)%a(1,1)=fcr(id3)*(auxa+ceps_0)
      crflinet_mu(2)%a(2,2)=fcl(id3)*(auxa-ceps_0)
